INSERT INTO `yien_goods` VALUES ('5825', '113970090565560', '26', '金雪小店', '东野圭吾：造彩虹的人', '31', '40', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:39', '东野圭吾长篇小说。其实每个人身上都会发光，但只有纯粹渴求光芒的人才能看到。从那一刻起，人生会发生奇妙的转折。', '《造彩虹的人》是东野圭吾深刻描绘人性的长篇小说，中文简体出版。看完《造彩虹的人》会觉得，其实每个人身上都会发光，但只有纯粹渴求光芒的人才能看到。从那一刻起，人生会发生奇妙的转折。', '功一高中退学后无所事事，加入暴走族消极度日；政史备战高考却无法集中精神，几近崩溃；辉美因家庭不和对生活失去勇气，决定自杀。面对糟糕的人生，他们无所适从，直到一天夜里，一道如同彩虹的光闯进视野。', '凝视着那道光，原本几乎要耗尽的气力，源源不断地涌了出来。一切又开始充满希望。打起精神来，不能输。到这儿来呀，快来呀——那道光低声呼唤着。', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fKAQXaEAAH_Dr8RYqc764.jpg', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fKARN8jAAH_Dr8RYqc545.jpg', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fKABc1zAAH_Dr8RYqc723.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:39', '88', '2019-02-04 15:29:56');
