INSERT INTO `yien_goods` VALUES ('5831', '113968770838698', '88', '陈翠小店', '大唐李白：少年游', '28', '39', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:31', '李白，改变了唐诗，却错过了时代；而整个大唐，又怎么错过了他？一个身为星宿、发为仙音，却只剩下名字的诗人；一个号称盛世，却以虚荣摧残着诗的时代', '　　张大春，台湾作家，1957年出生，祖籍山东。好故事，会说书，擅书法，爱赋诗。著作等身，曾获多种华语文学奖项。2013年，出版《大唐李白》系列首部曲《少年游》，融历史、传记、小说、诗论于一体，可谓其现代小说技艺与古典文化素养之集大成作品。　　《大唐李白》计划共四部，一百万字，后续三部分别为《凤凰台》《将进酒》《捉月歌》。', '　　大唐，文治武功的极盛之世，一个以无比的自信和激昂风采拥抱世界的时代。原本最自由的诗，却被赋予格律的法度，成为改变命运的手段。　　飘然不群的李白，心怀“申管晏之谈，谋帝王之术”的理想，却为何没有科考资格，甚至隐瞒出身外出飘荡，注定与整个繁华世道错身而过？既然无从追随时代的格律，写诗恰是随意的他，又如何作出无人匹敌的诗句以达天听，成就“高力士脱靴，杨贵妃斟酒”的无上光荣？日后名满天下的他，何以还是迷失了最初的自我，以至千载以下，人们居然多只记得他的名字而已？　　盛世背后、盛名之下，常常被忽略的，是自由的重负。后人所景仰、企羡、而追之不及的仙，不过是为俗世生涯所排挤在外的人；当现实的人生展开之际，诗句中的仙境，便也随着时代的种种前提、限制，一点一滴地凋零了。　　李白，改变了唐诗，却错过了时代；而整个大唐，又怎么错过了他？　　《大唐李白：少年游》系列是作家张大春现代小说技艺与古典文化素养之集大成作品，拟以百万字篇幅再造诗仙李白的一生、大唐盛世的兴衰。首部曲《大唐李白：少年游》透过梳理李白早年的萍踪游历，为读者解开诗人的身世、师从之谜，勾勒出盛唐时代的斑斓世相。作者在小说和历史之间捭阖出入，不仅以诗句推理出当时文人笔下心绪由来的内外世界，甚至大胆替李白“代笔”，对其诗作进行续补、改写。虚实难辨，却精彩叫绝，堪称理性和知识的完美狎戏。', null, 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fOAU6-YAAChrS5ArGc957.jpg', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fOAMb46AAChrS5ArGc851.jpg', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fOAAM5TAAChrS5ArGc256.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:31', '16', '2019-02-04 15:29:57');
INSERT INTO `yien_goods` VALUES ('5832', '113970142242703', '80', '王青小店', '人生', '19', '25', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:34', '', '　　《人生》是路遥的一部中篇小说，发表于1982年，它以改革时期陕北高原的城乡生活为时空背景，叙述了高中毕业生高加林回到土地又离开土地，再回到土地这样人生的变化过程。高加林同农村姑娘刘巧珍、城市姑娘黄亚萍之间的感情纠葛构成了故事发展的矛盾，也正是体现那种艰难选择的悲剧。', '', '', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fOAVKYhAABZmiDz2kM993.jpg', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fOAYoRFAABZmiDz2kM920.jpg', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fOAGbniAABZmiDz2kM797.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:34', '39', '2019-02-04 15:29:57');
