INSERT INTO `yien_goods` VALUES ('5837', '113971243807487', '33', '夏侯小店', '受戒(插图珍藏版）', '22', '36', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:37', '', '汪曾祺（1920—1997），沈从文先生的高徒，现当代著名小说家、散文家，京派小说的传人，被称为“中国最后一个纯粹的文人，中国最后一个士大夫”。他在短篇小说创作上颇有成就，对戏剧与民间文艺也有深入钻研。其散文《端午的鸭蛋》和《胡同文化》皆入选中学语文课本。', '', '', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fOALY-9AACiEc7Poik708.jpg', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fOAVAMLAACiEc7Poik019.jpg', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6fOAYeCbAACiEc7Poik916.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:37', '95', '2019-02-04 15:29:58');
