INSERT INTO `yien_goods` VALUES ('5852', '113968420052614', '46', '戚半小店', '井上靖作品：孔子（2014年版)', '28', '32', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:36', '', '　　井上靖（1907-1991），日本当代著名小说家，曾任日中文化交流协会会长。写得最多、最成功的是历史小说，取材于中国历史的小说尤为出色。1936年长篇处女作《流转》获千叶龟雄文学奖，1950年《斗牛》获芥川龙之介奖，1958年《天平之甍》获日本艺术选奖，1960年《敦煌》、《楼兰》同获每日艺术奖。1976年获日本文化勋章。1989年，完成了被誉为“历史小说明珠”的《孔子》，获野间文艺奖。1991年病逝于东京。', '　　《孔子》为日本著名作家井上靖重要代表作，也是他创作生涯的压轴力作。《孔子》出版后在日本引起巨大轰动，半年内售出60多万册，荣获野间文艺奖。井上靖在《就〈孔子〉致中国读者》一文中写道：“我晚至七十岁才读《论语》，为之倾倒，到八十岁又将《论语》编成小说，就是这一部《孔子》。”　　孔子一介教书匠，为何要周游列国？孔子有如一个流浪汉，为什么能吸引那么多粉丝？孔子什么时候开始有“治世”的想法的？孔子何以能够在那么战火硝烟、礼崩乐坏的乱世中脱颖而出？一部《论语》何以成为世代君王的必修之书？孔子的思想为什么能够成为广袤的东方两千多年的“圣经”？一言以问：孔子成为“孔子”的核心秘密是什么？', null, 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6faAc6-AAAEf9UVYIbo296.jpg', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6faAJFrTAAEf9UVYIbo647.jpg', 'http://192.168.21.158:8888/group1/M00/00/2B/wKgVnlxX6faAdsHyAAEf9UVYIbo248.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:36', '4', '2019-02-04 15:30:01');
