INSERT INTO `yien_goods` VALUES ('5868', '113968552118080', '1', '彭翠小店', '慈禧全传（全十册）', '299', '398', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:26', '', '历史小说应该有趣味，易于接受，引起读者反应，共鸣，印象深刻鲜明，情节也合情合理，不与史情相悖……——高阳        《慈禧全传》是高阳以小说形式全景式描绘晚清社会的一部巨著，共十册，包括《慈禧前传》《玉座珠帘》（上、下）、《清宫外史》（上、下）、《母子君臣》《胭脂井》（上、下）、《瀛台落日》（上、下）。全书以主要人物慈禧的活动为主线，从咸丰皇帝驾崩热河，慈禧联合恭王，自肃顺为首的顾命大臣手中夺取大权，垂帘听政，写到慈禧去世，溥仪继位，前后跨越四十多年。高阳熟知清朝历史掌故，凡笔记、野史、杂著、诗文及民间传说都烂熟于心，信手拈来，很自然地融入到小说的情境当中。作为小说家，高阳又是个讲故事的高手，他将头绪纷繁、变幻莫测的一段晚清历史，写得跌宕起伏，生动还原了一个有血有肉的“东方的维多利亚女王”——慈禧。有人说，读完《慈禧全传》，你会沦为“高阳脑残粉”，患上“穿越分裂症”，成为“格局分析狂”，它会嵌入你的精神世界，成为你生命的一部分。', '历史小说大家高阳全景式再现晚清风云的史诗巨著      比《晚清七十年》更鲜活   比《胡雪岩》更宏阔      她是大清朝的独裁女主，也是揭开中国现代化序幕的铁腕太后      在男人专权的政治舞台上，她展现出高人一筹的政治手腕，两次发动宫廷政变，两次决定皇位继承人，作为实际掌权者，统治中国长达四十多年。      在列强环伺的风雨飘摇中，她果断决策，改组军机，建立现代海关，废除科举制度，推动君主立宪。对俄、对日、对法都独有一番应对。      在传统与现代的交汇点，她顺时而变，引进西方教育，开设培养翻译人才的同文馆，公派留学生、驻外使节，并且派政府官员出国考察，此举被誉为“晚清中国人走向世界的一次盛举”。      她又是宫廷秘闻的不二主角  关于她众说纷纭、莫衷一是      慈安暴毙、珍妃投井、光绪暴崩……重重疑团，皆因她而起；      同光中兴、戊戌变法、八国联军进京……她的名字与近代很多重要事件联系在一起。      她是“东方的维多利亚女王”——慈禧', null, 'http://192.168.21.158:8888/group1/M00/00/2C/wKgVnlxX6fqAYb73AABoSBA9pr0279.jpg', 'http://192.168.21.158:8888/group1/M00/00/2C/wKgVnlxX6fqAfIonAABoSBA9pr0358.jpg', 'http://192.168.21.158:8888/group1/M00/00/2C/wKgVnlxX6fqAcmEGAABoSBA9pr0024.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:26', '36', '2019-02-04 15:30:05');
