INSERT INTO `yien_goods` VALUES ('5880', '113969345458223', '41', '尤曼小店', '建军大业', '44', '58', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:25', '', '', '　　本书是青年作家关河五十州创作的历史小说。　　1927年，北伐战争势如破竹之际，同一战壕内的国共两大阵营间却杀机四伏。在北伐后方，四月至五月，广西、上海、广州、湖南先后爆发屠杀共产党的血腥事变；在北伐前线，七月，武汉国民政府宣布\"分共\"，中国共产党在政治和军事上双双陷入孤立。　　各方势力环伺之下，八月一日，中共秘密发动南昌起义，一举成功。　　然而，夺取南昌城几乎是这支起义军最后的顺境：南昌四面平原，无险可守，地处水陆要冲，随时面临敌军的四面合围。起义军果断突围，寻求前往潮汕地区建立根据地。在无后方、无补给的绝境下，起义军一路苦战，经会昌战役、汀江漂流、汤坑战役，至十月初流沙之战后，叶挺、贺龙所部起义军主力已濒临瓦解。危难之际，朱德挺身而出，率领起义军余部转战闽粤赣湘边区，于第二年四月与毛泽东所部顺利会师井冈山。', null, 'http://192.168.21.158:8888/group1/M00/00/2C/wKgVnlxX6fyAdvlAAAC4o_E27G4784.jpg', 'http://192.168.21.158:8888/group1/M00/00/2C/wKgVnlxX6fyAOY5hAAC4o_E27G4688.jpg', 'http://192.168.21.158:8888/group1/M00/00/2C/wKgVnlxX6fyAdbHHAAC4o_E27G4868.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:25', '86', '2019-02-04 15:30:06');
