INSERT INTO `yien_goods` VALUES ('5883', '113970562013565', '7', '姜槐小店', '山本（精装 贾平凹2018年新作）', '37', '59', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:43', '一部震撼人心的民间秘史，一部描绘秦岭的百科全书。一条龙脉，横亘在那里，提携了黄河长江，统领着北方南方。这就是秦岭，中国*伟大的山。', '小说以秦岭深处一个名为涡镇的小镇为起始，讲述了杨家棺材铺童养媳陆菊人从娘家带来了三分胭脂风水宝地，被不知情的公公赠与井宗秀葬父后竟使涡镇的世道完全改变，从而引发了一幕幕激烈动荡的战争，逛山、刀客、土匪，游击队等多股势力一时间风起云涌，割据各方不断厮杀，同时井家兄弟之间的特殊关系与阮家族群的刻骨仇恨也在特定的时期与地点中变化升级。 除此之外，作者更是对秦岭一代的草木鸟兽有着详尽的描述，篇幅之多足以称得上一部秦岭地方志。', '', '', 'http://192.168.21.158:8888/group1/M00/00/2C/wKgVnlxX6fyACI53AACeZwYoo7Y556.jpg', 'http://192.168.21.158:8888/group1/M00/00/2C/wKgVnlxX6fyAY8IwAACeZwYoo7Y850.jpg', 'http://192.168.21.158:8888/group1/M00/00/2C/wKgVnlxX6fyAXZiNAACeZwYoo7Y234.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:43', '30', '2019-02-04 15:30:07');
