INSERT INTO `yien_goods` VALUES ('5889', '113971063163538', '4', '孙雅小店', '红树林 (莫言作品全编）', '25', '37', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:41', '2017定稿版，诺贝尔文学奖得主莫言亲认。莫言*部反腐题材都市小说，内附精美插页、书签。', '《红树林》的故事从“高密东北乡”转向了南海之滨的现代都市和淳朴的南国渔村。小说的主人公林岚是南江市副市长，在她光鲜亮丽的身份背后却是挣扎于金钱、权力与错乱情欲之间的扭曲人生。而另外一位美丽淳朴的渔家姑娘珍珠，从红树林边来到都市，在与林岚及其儿子的纠葛中饱尝人生的苦楚，却*终在痛苦中成长起来。作者以“珍珠”隐喻人生，通过书写乡村人物走入城市所带来的冲击与异化，迷失与成长，为读者建构了一个纷繁错杂的欲望迷宫。', '', '', 'http://192.168.21.158:8888/group1/M00/00/2D/wKgVnlxX6f2Ac3-vAAEjODKn1FQ625.jpg', 'http://192.168.21.158:8888/group1/M00/00/2D/wKgVnlxX6f2AVzOCAAEjODKn1FQ778.jpg', 'http://192.168.21.158:8888/group1/M00/00/2D/wKgVnlxX6f2Afn1vAAEjODKn1FQ614.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:41', '85', '2019-02-04 15:30:08');
