INSERT INTO `yien_goods` VALUES ('5925', '113971423344593', '94', '陈萱小店', '知更鸟女孩 4 末日风暴', '26', '42', '重庆', '2019-01-16 16:45:02', '十二个月', '2019-02-02 00:12:43', '知更鸟女孩4末日风暴（媲美《哈利·波特》《权力的游戏》的史诗经典系列。当死亡的末日风暴残酷来袭，谁的灵魂能够惊险逃脱？）', '也许你忘了，她知道你将如何死去！', '在米莉安灰暗颠沛的人生中，只有温柔善良的路易斯可以给予她丰沛的爱与情感。可是在她鼓起勇气给路易斯打电话时，他却说：“米莉安，我遇见了一个姑娘，她叫萨曼莎，我们订婚了。”还有什么比这种更让人无望的吗？然而一次偶然的机会，米莉安握住了萨曼莎的手，脑海中却呈现出一幅令她万分惊恐的画面——订婚之夜，萨曼莎的脖子却被一双手紧紧卡住，直到慢慢没有了呼吸。而这双手的主人，竟是路易斯！在这场末日风暴里，当你wei一所爱的人也开始面目模糊，真假难辨，来自于人性的拷问才刚刚开始。', '', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gOAal5-AAF1HjqLwqM772.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gOAG8yGAAF1HjqLwqM740.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gOACkrUAAF1HjqLwqM073.jpg', '6', 'selling_now', '2019-01-16 16:45:02', '2019-02-02 00:12:43', '40', '2019-02-04 15:30:14');
