INSERT INTO `yien_goods` VALUES ('5927', '113970741366352', '86', '喻巧小店', '红拂夜奔', '31', '39', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:38', '王小波经典代表作，逝世二十周年纪念版！怀疑三部曲之“趣味之书”——“假如这世界上没有有趣的事我情愿不活。”', '《红拂夜奔》王小波“怀疑三部曲”中的“趣味之书”，王小波说：“凡人都喜欢有趣。这是我一生不可动摇的信条，假如这世界上没有有趣的事我情愿不活……《红拂夜奔》谈的是这一点。”', '《红拂夜奔》借隋末大将军李靖和杨素家妓红拂的风流韵事为蓝本，以现代人的眼光去观照历史，表现知识分子在反智社会中的尴尬处境。在历史与现实，虚幻与真实的纷繁交错中，小说看似荒诞，却处处体现着对现实的反讽，对自由、趣味的向往。正如王小波在序言中所言：“我写的是内心而不是外形，是神似而不是形似。”', '', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gOAfJjOAAGrN0R9z6o776.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gOACbjfAAGrN0R9z6o601.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gOARuCCAAGrN0R9z6o236.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:38', '39', '2019-02-04 15:30:14');
INSERT INTO `yien_goods` VALUES ('5928', '962170865227546', '40', '陶听小店', '创意家居切菜器生活小百货店居家用日用品厨房用具神器同款商用 【北欧蓝】', '67', '89', '成都', '2019-01-23 22:26:22', '九个月', '2019-02-02 00:12:56', '商品名称：创意家居切菜器生活小百货店居家用日用品厨房用具神器同款商用 【北欧蓝】null', '', null, null, 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gSACResAACFLJOAa2s420.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gSAb0loAAB0rSHSnfE338.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gSAWm2qAADfansPADs980.jpg', '8', 'selling_now', '2019-01-23 22:26:22', '2019-02-02 00:12:56', '6', '2019-02-04 15:30:14');
INSERT INTO `yien_goods` VALUES ('5929', '113970407210205', '39', '赵凌小店', '被掩埋的巨人/2017年诺贝尔文学奖获得者石黑一雄作品  [The Buried Giant]', '31', '39', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:30', '2017年诺贝尔文学奖得主石黑一雄作品系列，以巨大情感力量，发掘隐藏深渊 。上海译文出版社出品。', '　　石黑一雄《被掩埋的巨人》讲述公元六世纪的英格兰，本土不列颠人与撒克逊入侵者之间的战争似乎已走到了终点——和平降临了这片土地，两个族群比邻而居，相安无事地共同生活了数十年。但与此同时，一片奇怪的“遗忘之雾”充盈着英格兰的山谷，吞噬着村民们的记忆，使他们的生活好似一场毫无意义的白日梦。一对年迈的不列颠夫妇想要赶在记忆完全丧失前找到此刻依稀停留在脑海中的儿子，于是匆匆踏上了一段艰辛的旅程。他们渴望让迷雾散去，渴望重拾两人相伴一生的恩爱回忆——但这片静谧的雾霭掩盖的却是一个黑暗血腥的过去，那是一个在数十年前被不列颠人的亚瑟王用违背理想的手段掩埋的巨人。一个神秘的撒克逊武士肩负使命来到这片看似平和的山谷，他那谦逊的外表背后究竟隐藏着怎样秘而不宣的动机？他的使命带给这个国度将是宽恕的橄榄枝还是复仇的剑与火？而亚瑟王最后的骑士高文则决心用生命守护国王的遗产，因为守护它就就意味着守护最后的和平。记忆与宽恕，复仇与和平，四人的命运不可避免地交织在了一处，而结局只有一个。　　', '', '', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gSAGoIWAAE0Eqr0a34462.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gSARHN2AAE0Eqr0a34512.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gSAYblnAAE0Eqr0a34800.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:30', '11', '2019-02-04 15:30:14');
