INSERT INTO `yien_goods` VALUES ('5945', '113967271855864', '21', '吕曼小店', '东野圭吾：加贺探案集（6）只差一个谎言  [嘘をもうひとつだけ]', '20', '25', '重庆', '2019-01-16 16:44:57', '十二个月', '2019-02-02 00:12:34', '', '　　东野圭吾，日本作家。　　1985年，凭《放学后》获第31届江户川乱步奖，开始专职写作；1999年，《秘密》获第52届日本推理作家协会奖；此后《白夜行》、《单恋》、《信》、《幻夜》先后入围直木奖。2005年出版的《嫌疑人X的献身》将第134届直木奖、第6届本格推理小说大奖，以及年度三大推理小说排行榜一并斩获；2008年，《流星之绊》获第43届新风奖；2012年，《浪矢杂货店的奇迹》获第7届中央公论文艺奖。　　早期作品多为精巧细致的本格推理，后期笔锋越发老辣，文字鲜加雕琢，叙述简练凶狠，情节跌宕诡异，故事架构几至匪夷所思的地步，擅长从极不合理处写出极合理的故事，功力之深令世人骇然。', '', '', 'https://img12.360buyimg.com/n1/g10/M00/0E/14/rBEQWFFRQ3MIAAAAAAakIMoo4W0AAC3JAEiKNcABqQ4173.jpg', '', 'https://img12.360buyimg.com/n1/g10/M00/0E/14/rBEQWFFRQ3MIAAAAAAakIMoo4W0AAC3JAEiKNcABqQ4173.jpg', '6', 'selling_now', '2019-01-16 16:44:57', '2019-02-02 00:12:34', '20', '2019-02-02 00:12:34');
