INSERT INTO `yien_goods` VALUES ('5952', '113970613687295', '30', '王蓝小店', '偷书贼', '51', '68', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:41', '媲美《解忧杂货店》和《追风筝的人》，用阅读的力量战胜孤独和恐惧，这本书将改变你的人生', '《偷书贼》是澳大利亚知名作家马库斯·苏萨克的长篇小说代表作，讲述了一个孤苦的小女孩如何凭借读书的力量，度过生命中艰难的时期。', '二战期间，九岁的德国姑娘莉泽尔和弟弟被送往寄养家庭。弟弟不幸病死在火车上。在埋葬弟弟的荒原上，莉泽尔捡到了一本对她意义非凡的书《掘墓人手册》。', '来到慕尼黑贫民区的寄养家庭，莉泽尔夜夜抱着《掘墓人手册》入睡。养父为安慰她，每晚给她朗读手册的内容，还教她阅读。', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giAZtAbAAFqMUPUCRA515.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giALAO3AAFqMUPUCRA786.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giAa-tjAAFqMUPUCRA590.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:41', '41', '2019-02-04 15:30:18');
INSERT INTO `yien_goods` VALUES ('5953', '113965278515844', '10', '赵兰小店', '追击者（李小冉、于和伟、朱雨辰、罗嘉良领衔主演同名谍战剧即将火热上映）', '19', '32', '重庆', '2019-01-16 16:44:55', '十二个月', '2019-02-02 00:12:32', '“追击者”重重潜伏，“伪装者”步步悬崖！ 席卷谍战圈的年度大戏《追击者》，北京卫视、辽宁卫视同步上映！朱雨辰、李小冉、于和伟、罗嘉良领衔主演！王海鸰、侯小强、海清倾情推荐！', '故事发生在解放前后。当了半辈子小人物的常平安一心想杀敌，可直到解放的前一天，也没等来一次开枪的机会。一次意外，他接连失去了生命中重要的两个人：情同父亲的师傅和相爱的初恋情人。', '解放后的常平安成了一名市公安局的小警察，他的结发妻子王小玉却不知道他身上的秘密。常平安终于找到了杀死师傅的凶手，他竟是自己的顶头上司、潜伏在我党内部的国民党特务曹若飞，两个人的明争暗斗也随之展开。', '而和常平安有过感情纠葛的女子傅云，再次现身之后却成了曹若飞的妻子。杀 “父”仇，夺“妻”恨，常平安心如刀绞。面对曹若飞这个心思缜密的强大对手，常平安面临着严峻挑战。', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giAQGKLAAE7bfH2Azc675.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giAcM44AAEb_5zAE0M114.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giAU0QaAAE7bfH2Azc691.jpg', '6', 'selling_now', '2019-01-16 16:44:55', '2019-02-02 00:12:32', '78', '2019-02-04 15:30:18');
INSERT INTO `yien_goods` VALUES ('5954', '96302815556903', '86', '喻巧小店', '厨房用品用具小百货小工具创意实用懒人神器酒店小帮手厨房收纳盒', '28', '40', '成都', '2019-01-22 11:33:39', '九个月', '2019-02-02 00:12:49', '商品名称：厨房用品用具小百货小工具创意实用懒人神器酒店小帮手厨房收纳盒本店部分商品为定制商品，所有商品不含食物，请联系客服询问后下单，直接下单有权不发，谢谢！', 'https://misc.360buyimg.com/lib/img/e/blank.gif', null, null, 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giAddZ4AADaMe9JyrE948.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giAEQJ6AADEkv4T35Y158.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giAVP80AAC4MM1xMak258.jpg', '8', 'selling_now', '2019-01-22 11:33:39', '2019-02-02 00:12:49', '95', '2019-02-04 15:30:19');
INSERT INTO `yien_goods` VALUES ('5955', '113968731497553', '90', '奚忆小店', '现货二月河文集13册全套 康熙大帝全4册+乾隆皇帝全套6册+雍正皇帝全套3册雍正王朝皇帝历史小说', '298', '390', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:25', '点击购买二月河文集彩插珍藏康熙大帝+雍正皇帝+乾隆皇帝 共13册', '　　二月河帝王系列，包括《康熙大帝》（4卷），雍正皇帝（3卷），《乾隆皇帝》（6卷）。三卷皇帝，合起来看，是一幅气势恢宏、大气磅礴、百科全书式的清朝盛世之历史长卷图。　　小说立足清庭，放眼古今。既写了三代盛世皇帝的文治武功，帝王心术，又写了名臣才子的权谋与沉浮，也写了市井百态，风土人情。究天人之际，通兴衰之变，成一家之言。堪称史书、权书、谋书、人情书。　　　　《康熙大帝》（4卷），第一卷从康熙八岁即位写起，写他清君侧、诛鳌拜；第二卷写他平三藩，扫叛逆；第三卷写他励精图治，开创大统；第四卷写他晚年弊政丛生，选立皇储，定下了留名清史的雍正继承大统。从中可以窥见康熙大帝的隐忍、铁血，预见力，以及该忍就忍、当断则断的谋略智慧。　　《雍正皇帝》（3卷），第一卷写九王夺嫡之争，雍正险中取胜。第二卷写雍正一面应对八爷党的不死夺位之心，一面选贤任能，推行新政。第三卷写一面写乾清宫内的风起云涌，一面写雍正王朝的世相百态。谋篇布局更加出神入化，气象万千。从中可见窥见雍正皇帝“少说废话，多干要事”，杀出权力重围，抓住机会，依靠实力，巧妙运作的权力博弈之术。　　《乾隆皇帝》（6卷），乾隆皇帝继位后立志要开创清朝的盛世，以宽为政，微服私访，踌躇满志，锐意进取。他整顿吏治、整饬军队，平定叛乱，七下江南，至他晚年朝庭风起云涌，边境危机四伏，皇子勾心斗角，一个盛世的王朝日显衰疲。从此书可见乾隆为上驶下，分权制衡的为政法则。', '　　★本文集包括《康熙大帝》、《雍正皇帝》、《乾隆皇帝》，共13卷！　　★写出前清三代帝王的治国御人之术！　　　　《康熙大帝》该书获河南省文艺成果奖、河南省改革十年优秀图书一等奖等奖项。《雍正皇帝》（三卷本）1996年6月，香港《亚洲周刊》评选的“20世纪中文小说一百强”，本书还被改编成电视连续剧《雍正王朝》在中央电视台播放。《乾隆皇帝》（六卷本）多次再版，获1996年全国十佳长篇小说奖。　　', null, 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giAdLiQAACjCPwg0co773.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giABQIVAACjCPwg0co246.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6giACymnAACjCPwg0co346.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:25', '75', '2019-02-04 15:30:19');
