INSERT INTO `yien_goods` VALUES ('5957', '113968368507348', '97', '杨柏小店', '流血的仕途（套装上下册）', '64', '90', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:43', '《流血的仕途》还原了李斯从区区草民步至大秦政坛男二号的奋斗历程，也复活了李斯与嬴政、吕不韦、嫪毐、韩非等枭雄明争暗斗的历史图卷。', '　　曹昇，新派历史小说名家，出版有《流血的仕途》《嗜血的皇冠》等历史畅销佳作。曹再挟令人惊叹的写作才华，一反以往历史小说的平铺刻板，以诙趣的笔法还原历史，用鲜活的文字复原历史，将当时多变的历史格局与李斯运筹帷幄的人生智慧写得妙趣横生、自成一派。　　《流血的仕途》洋洋六十万字铸就，还原了李斯在战国末年的乱世里，从区区草民步至大秦名相的奋斗历程，也复活了李斯与赢政、吕不韦、韩非、缪毒等枭雄明争暗斗的历史图卷。', '《流血的仕途（套装上下册）》将战国末年群雄逐鹿的历史盛卷亦庄亦谐地铺展开来，刻画出了千古一相李斯曲折、传奇的一生。书中密布的智慧与谋略、心术与玄机，读来令人心惊。', null, 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gmANbjQAAA6fxon2X0162.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gmAOmGQAAA6fxon2X0042.jpg', 'http://192.168.21.158:8888/group1/M00/00/2E/wKgVnlxX6gmAaU7DAAA6fxon2X0485.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:43', '94', '2019-02-04 15:30:19');
