INSERT INTO `yien_goods` VALUES ('5972', '113970625922445', '34', '朱卉小店', '俗世奇人1+2（套装共2册）', '24', '40', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:34', '第七届鲁迅文学奖获奖作品。收录冯骥才先生描写清末民初天津卫奇人异士的所有作品，配有同一时代《醒俗画报》刊载的图画，有助于读者感受与认知那个时代。其中多篇作品入选《语文》教材，被多地中小学列入必读书目。', '　　《俗世奇人2》是作家冯骥才继《俗世奇人》之后的又一部描写天津卫清末民初奇人异士的力作，它与《俗世奇人》一样，也收录了十八篇短篇小说。但之前的十八个故事，只是作者众多故事里的一小部分，为让读者更深入地了解清末民初天津卫的各色人物，市井生活，作者在百忙中挤时间写出了这部《俗世奇人贰》。小说里的人物有声有色有脾气有模样，活灵活现，读完小说掩卷之后，你会看到活脱脱一群立在书上的天津卫奇人异士。小说具有浓郁的地域性，鲜明的人物性格、生动有趣的故事耐人寻味，尤其是作者精练、有画面感的语言，准确地为读者勾勒出清末民初天津卫的各色人物。', '　　本书插图还是选用了《醒俗画报》的一些图画，它们虽然与小说故事不相干，但属于同一时代，能真切地反映小说中人物的生活场景，具有很强的生活气息。', '', 'http://192.168.21.158:8888/group1/M00/00/2F/wKgVnlxX6guAViK8AAFr__6jqjw312.jpg', 'http://192.168.21.158:8888/group1/M00/00/2F/wKgVnlxX6guAZPYTAAFr__6jqjw698.jpg', 'http://192.168.21.158:8888/group1/M00/00/2F/wKgVnlxX6guAThFzAAFr__6jqjw971.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:34', '71', '2019-02-04 15:30:22');
