INSERT INTO `yien_goods` VALUES ('5980', '113969825802856', '79', '严千小店', '许三观卖血记（新版）', '21', '32', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:32', '', '《余华作品：许三观卖血记（2017年版）》其实是一首很长的民歌，它的节奏是回忆的速度，旋律温和地跳跃着，休止符被韵脚隐藏了起来。作者在这里虚构的只是两个人的历史，而试图唤起的是更多人的记忆。', '《余华作品：许三观卖血记（2017年版）》表达了作者对长度的迷恋，一条道路、一条河流、一条雨后的彩虹、一个绵延不绝的回忆、一首有始无终的民歌、一个人的一生。这一切犹如盘起来的一捆绳子，被叙述慢慢拉出去，拉到了路的尽头。在这里，作者有时候会无所事事。因为他从一开始就发现虚构的人物同样有自己的声音，他认为应该尊重这些声音，让它们自己去风中寻找答案。于是，作者不再是一位叙述上的侵略者，而是一位聆听者，一位耐心、仔细、善解人意和感同身受的聆听者。他努力这样去做，在叙述的时候，他试图取消自己作者的身份，他觉得自己应该是一位读者。事实也是如此，当这《余华作品：许三观卖血记（2012年版）》完成之后，他发现自己知道的并不比别人多。', '', 'http://192.168.21.158:8888/group1/M00/00/2F/wKgVnlxX6gyATQsiAABclQ_Q2lE741.jpg', 'http://192.168.21.158:8888/group1/M00/00/2F/wKgVnlxX6gyACTStAABclQ_Q2lE587.jpg', 'http://192.168.21.158:8888/group1/M00/00/2F/wKgVnlxX6gyAClv7AABclQ_Q2lE479.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:32', '63', '2019-02-04 15:30:23');
INSERT INTO `yien_goods` VALUES ('5981', '962169717606580', '65', '戚紫小店', '实用厨房卫生间用具创意家居生活日用品家用小东西百货礼物送女友大学生寝室宿舍用品义乌新奇特小商品小玩意 免钉无痕门后挂钩', '25', '47', '成都', '2019-01-23 22:26:21', '九个月', '2019-02-02 00:12:55', '商品名称：实用厨房卫生间用具创意家居生活日用品家用小东西百货礼物送女友大学生寝室宿舍用品义乌新奇特小商品小玩意 免钉无痕门后挂钩null', 'https://misc.360buyimg.com/lib/img/e/blank.gif', null, null, 'http://192.168.21.158:8888/group1/M00/00/2F/wKgVnlxX6gyAMkfiAAB5ciPpEew658.jpg', 'http://192.168.21.158:8888/group1/M00/00/2F/wKgVnlxX6gyANVz0AAC9ZgCNIsI489.jpg', 'http://192.168.21.158:8888/group1/M00/00/2F/wKgVnlxX6gyAb7QCAADALWiln7I646.jpg', '8', 'selling_now', '2019-01-23 22:26:21', '2019-02-02 00:12:55', '75', '2019-02-04 15:30:23');
INSERT INTO `yien_goods` VALUES ('5982', '113967457748546', '61', '何亦小店', '罪恶生涯', '40', '50', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:08:12', 'J.K.罗琳今年不单有《哈利?波特与被诅咒的孩子》《神奇动物在哪里》，还有这本侦探小说！', '　　伦敦跛脚侦探斯特莱克的助理罗宾收到一个包裹，继而惊恐地发现，包裹里是一条女人的断腿。', '　　斯特莱克没有她那么震惊，但也警觉起来。他觉得，有四个他过去认识的人能干出这种事来，这四个人全都擅长持续地做出无法言喻的暴行。', '　　警方锁定那四人中的一个为嫌疑人，但斯特莱克觉得，那个人并非行凶者。他和罗宾开始自己调查，深入另外三人黑暗而又无常的世界。但更多恐怖的事件发生了，斯特莱克和罗宾已经没有多少时间……', 'https://img14.360buyimg.com/n1/jfs/t3208/174/4706913159/604899/fc9d14fb/5850a9b9N7b08a72b.jpg', '', 'https://img14.360buyimg.com/n1/jfs/t3208/174/4706913159/604899/fc9d14fb/5850a9b9N7b08a72b.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:08:12', '76', '2019-02-02 00:08:12');
