INSERT INTO `yien_goods` VALUES ('5993', '113968616024168', '53', '吴寒小店', '太阳照在桑干河上（红色长篇小说经典）', '23', '29', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:25', '丁玲经典作品 必读红色经典 人民文学出版社D家版权', '', '《太阳照在桑乾河上》是丁玲深入农村斗争生活后写的反映土改运动的优秀长篇小说。由于思想上和艺术上的成就，曾荣获1951年度斯大林文学奖金二等奖。', null, 'http://192.168.21.158:8888/group1/M00/00/2F/wKgVnlxX6g6AbSG7AAC7S-ALcC8222.jpg', 'http://192.168.21.158:8888/group1/M00/00/2F/wKgVnlxX6g6AC0wyAAC7S-ALcC8628.jpg', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6g6AOLvrAAC7S-ALcC8201.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:25', '61', '2019-02-04 15:30:25');
INSERT INTO `yien_goods` VALUES ('5994', '113968564335544', '66', '东方小店', '汉武大帝（套装全三册）/长篇历史小说经典书系', '77', '120', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:35', '他建立了一个国家的尊严，他给了一个族群挺立千秋的自信，他塑造了一个民族奋起图强的伟大时代，他开创了一段留传千古的帝国传奇，他的国号成了一个民族永远的名字。明犯强汉者，虽远必诛！', '　　《汉武大帝》以刘彻的幼年开篇，通过风险继位，掌握大权；用贤变法，尊王攘夷；大战匈奴，出使西域；巫蛊为乱，罪己示民等重大事件，围绕和与战、治与乱、忠与叛、生与死、得与失、情与恨的矛盾，向读者全景式地展现了汉武帝纵横跌宕的一生和那个风云变幻、英雄辈出的时代。　　其间宫廷的明争暗斗，大汉帝国征战四方、金戈铁马的壮观气象。“黄沙百战穿金甲，不破楼兰终不还！”抵御外族入侵，气势宏大的战争场面，壮烈激越的将士情怀，雄视天下的盛世风华，都将在这部作品中得到淋漓尽致地展现。', '他建立了一个国家的尊严，', null, 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6g6AAC9jAADXJIgjQns774.jpg', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6g6ANmedAADXJIgjQns864.jpg', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6g6AZbJ9AADXJIgjQns754.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:35', '19', '2019-02-04 15:30:25');
