INSERT INTO `yien_goods` VALUES ('6005', '113968997652576', '58', '陶云小店', '大唐悬疑录4：大明宫密码', '25', '36', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:31', '易学奇书《推背图》引爆大唐皇室危机！女神探裴玄静系列迎来大结局，《兰亭序密码》《璇玑图密码》《长恨歌密码》所有谜团一次解决！', '楔子', '唐隐，著名历史悬疑作家，紫焰品牌作者。其笔下的大唐盛世精致细腻、神秘辉煌。作品入选2017年国家图书版权输出奖励计划。代表作《大唐悬疑录》系列出版以来加印数次，连续两年成为年度畅销书。繁体版一经上市，横扫台湾金石堂、博客来、诚品网络书店小说榜，引爆跨海阅读的浪潮。', null, 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hCARP6kAADGLJMAsJw880.jpg', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hCALvMFAADGLJMAsJw376.jpg', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hCAbBNMAADGLJMAsJw783.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:31', '14', '2019-02-04 15:30:26');
