INSERT INTO `yien_goods` VALUES ('6008', '113971295421639', '6', '褚旋小店', '伊斯坦布尔 : 一座城市的记忆', '60', '76', '重庆', '2019-01-16 16:45:02', '十二个月', '2019-02-02 00:12:29', '', '　　2006年诺贝尔文学奖获得者、土耳其作家奥尔罕?帕慕克的自传性作品。对帕慕克而言，伊斯坦布尔一直是一座充满帝国遗迹的城市。这个城市特有的“呼愁”，早已渗入少年帕慕克的身体和灵魂之中。如今作为作家的帕慕克，以其独特的历史感与善于描写的杰出天分，重访家族秘史，发掘旧地往事的脉络，拼贴出当代伊斯坦布尔的城市生活。跟随他的成长记忆，我们可以目睹他个人失落的美好时光，认识传统和现代并存的城市历史，感受土耳其文明的感伤。', '　　“伊斯坦布尔的命运就是我的命运：我依附于这个城市，只因她造就了今天的我。”《伊斯坦布尔：一座城市的记忆》书写的既是一部个人的历史，更是这座城市的忧伤。', '', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hCANbmIAABDUIYSUFc284.jpg', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hCAdDQgAABDUIYSUFc968.jpg', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hCAcOcXAABDUIYSUFc975.jpg', '6', 'selling_now', '2019-01-16 16:45:02', '2019-02-02 00:12:29', '71', '2019-02-04 15:30:27');
