INSERT INTO `yien_goods` VALUES ('6014', '113968783097432', '23', '钱惜小店', '大军师司马懿之虎啸龙吟', '37', '48', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:29', '吴秀波、刘涛、李晨、张钧甯、唐艺昕、王洛勇、刘欢主演； 现象级历史剧《虎啸龙吟》正版原著小说； 87亿次播放，豆瓣评分8.2分，5年磨一剑的精良之作（随书附赠4张官方剧照明信片 和人物关系表）', '常江，笔名掠水惊鸿，晋江文学网、九界文学网人气作家。其作品有着扎实的历史和文学功底，在读者群体中享有盛誉。已出版长篇小说《明宫秋词》《明宫秋词2：莫相负》等作品。近几年主要从事影视剧编剧工作，担任《大军师司马懿之军师联盟》独立编剧、《三国机密之潜龙在渊》独立编剧、《九州缥缈录》编剧。', '曹丕死后，司马懿复出，继续辅佐曹叡。他与诸葛亮在六出祁山的较量与博弈中相知相惜。五丈原秋风，一曲梁甫吟。他彻底战胜了毕生极为强大的对手，却对着飘渺的棋局失声痛哭。', null, 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hKABV3RAAF_BKEGBo4987.jpg', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hKASWA1AAF_BKEGBo4029.jpg', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hKAUqHtAAF_BKEGBo4765.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:29', '61', '2019-02-04 15:30:28');
