INSERT INTO `yien_goods` VALUES ('6016', '113968394202406', '28', '郎卉小店', '井上靖作品：敦煌（2014版）', '22', '25', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:42', '无数读者奔赴敦煌莫高窟，惊天动地讲述藏经洞千古之谜', '　　《敦煌》是日本文学巨匠井上靖以中国为题材创作的重要历史小说之一，曾获得每日艺术奖。莫高窟的浩繁经卷如今是世人为之称奇的宝物，但是这些经卷到底是谁为何而埋，而那个未留姓名的藏经人背后，究竟还有多少谜团？井上靖用一部惊天动地的《敦煌》，引导人们前赴后继奔向那片神奇的土地。宋仁宗天圣年间，书生赵行德进京赶考，因瞌睡错过了考试。他失魂落魄，四处游荡，偶然得到从未见过的西夏文布片。西域的气息瞬间改变了赵行德的命运，也为后人留下了一段千年未解之谜……', '　　★日本文学巨匠井上靖之作', null, 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hKAbeD1AAE4c0yw1rU593.jpg', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hKAVpLkAAE4c0yw1rU048.jpg', 'http://192.168.21.158:8888/group1/M00/00/30/wKgVnlxX6hKAGhH5AAE4c0yw1rU718.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:42', '76', '2019-02-04 15:30:29');
