INSERT INTO `yien_goods` VALUES ('6019', '113965310524898', '4', '孙雅小店', '金田一探案集16：恶魔的宠儿  [悪魔の寵児]', '21', '28', '重庆', '2019-01-16 16:44:56', '十二个月', '2019-02-02 00:12:36', '', '　　横沟正史（1902-1981），日本最重要的推理小说家，代表作《金田一探案集》是唯一能抗衡《福尔摩斯探案集》的推理小说典范。凭借《本阵杀人事件》获得第1届日本推理作家协会奖。　　作品以传统的本格推理为主，表面氛围奇诡，但完全摒弃了风行一时的非现实情节，以纯粹的写实手法将推理小说的各种典型要素浓缩在创作中，同时融入日本社会特有的人情风俗，将日本推理小说的水平提升到了全新高度。　　代表作有《八墓村》、《狱门岛》、《恶魔吹着笛子来》、《犬神家族》、《恶魔的彩球歌》等，在日本掀起的“横沟热潮”数十年不退，延续至今。', '', '', 'https://img13.360buyimg.com/n1/g15/M09/1C/08/rBEhWlKqwKIIAAAAAAHW51-M6Z4AAGurADRC_cAAdb_617.jpg', '', 'https://img13.360buyimg.com/n1/g15/M09/1C/08/rBEhWlKqwKIIAAAAAAHW51-M6Z4AAGurADRC_cAAdb_617.jpg', '6', 'selling_now', '2019-01-16 16:44:56', '2019-02-02 00:12:36', '95', '2019-02-02 00:12:36');
