INSERT INTO `yien_goods` VALUES ('6040', '113970360853165', '35', '万俟小店', '世界的凛冬（通宵小说大师肯·福莱特世纪三部曲，全球读者平均三个通宵读完！以恢宏辽阔、荡气回肠的故事全景展现整个20世纪人类史。）', '95', '132', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:31', '全球读者平均3个通宵读完的超级小说！《巨人的陨落》续篇！火遍全球的20世纪人类史诗“世纪三部曲”第二部。我亲眼目睹，每一个迈向死亡的生命都在热烈地生长。16国争相出版，首次登陆中国。读客出品', '我亲眼目睹，每一个迈向死亡的生命都在热烈地生长。《世界的凛冬》是火遍全球的20世纪人类史诗“世纪三部曲”的第二部，是《巨人的陨落》的续篇。整个20世纪的吉光片羽，都被肯·福莱特写进了这部伟大的小说里。一切都始于那个裂变中的大时代——希特勒上台，爱德华八世退位，原子弹在广岛和长崎爆炸……世界剧烈改变，我该怎么办？', '这正是他们的困惑——一群处于人生黄金时代的少男少女，来自德国、美国、英国、苏俄和威尔士的五大家族，他们父辈的命运因一战而彻底改变。如今，世界再次破碎，甚至更加暴烈和残酷。然而，这就是他们的时代！在时间的永恒流动中，每个人都在创造历史。所以，为什么不一起来，会一会命运？', '', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6haASOa9AAJjB0hyWcI256.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6haAOr6kAAJjB0hyWcI891.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6haAPOkWAAJjB0hyWcI912.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:31', '6', '2019-02-04 15:30:33');
