INSERT INTO `yien_goods` VALUES ('6047', '962169051699648', '22', '王觅小店', '厨房用具创意家居日用品 抖音神器小工具实用生活居家小百货懒人 压面机 2头 基本款', '43', '65', '成都', '2019-01-23 22:26:21', '九个月', '2019-02-02 00:12:53', '商品名称：厨房用具创意家居日用品 抖音神器小工具实用生活居家小百货懒人 压面机 2头 基本款null', 'https://misc.360buyimg.com/lib/img/e/blank.gif', null, null, 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6heAEbcuAADX_lczlmE877.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6heAOhtHAAC_VCKO7Tc369.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6heADyJOAAC_ZV2uOY0026.jpg', '8', 'selling_now', '2019-01-23 22:26:21', '2019-02-02 00:12:53', '61', '2019-02-04 15:30:34');
INSERT INTO `yien_goods` VALUES ('6048', '113966619591383', '20', '施凌小店', '血疑', '29', '38', '重庆', '2019-01-16 16:44:57', '十二个月', '2019-02-02 00:12:30', '苏格兰黑色之王挑战校园枪击案！', '　　伊恩·兰金，被誉为苏格兰黑色之王，当代最优秀的侦探小说家之一。　　让人惊奇的不只是他踏入文坛的年龄，更特别的是，兰金在如此年轻的时候，却创造了一位四十一岁、离婚、酗酒而且烟瘾极大的雷布思警探，并把故事背景设定在复杂的警察世界之中，如果没有足够的文字功力，肯定无法在竞争激烈的英国大众文坛脱颖而出。这本兼具惊悚与悬疑气氛的警探小说深入描写了人类心理层次的黑暗面，加上鲜活的人物个性与深入贴近社会的叙事角度，引起了读者的巨大回响，也鼓舞兰金继续写下去，一写就是二十几个年头。迄今为止，他的十七本系列作品被翻译成三十一国文字出版，兰金也早已成为英国当代最重要的作家之一。　　兰金在英国文坛的成就极高，曾获得声望卓著的钱德勒－富布赖特推理文学奖。他曾经四度获选英国犯罪小说作家协会匕首奖，其中《黑与蓝》（Black and Blue）荣获一九九七年英国犯罪小说作家协会金匕首奖，同时获得美国推理小说作家协会爱伦坡奖提名。一九九九年，《死灵魂》（Dead Souls）再获金匕首奖提名；二〇〇四年，《掘墓盗尸人》（Resurrection Men）夺得爱伦坡奖最佳小说奖；二〇〇五、二〇〇六年连续两年赢得英国国家图书奖年度犯罪惊悚小说奖。　　二〇〇二年，兰金因其文学贡献获得大英帝国勋章；二〇〇五年获得英国犯罪小说作家协会颁予代表终身成就的钻石匕首奖，成为史上最年轻的钻石匕首奖得主；同年，兰金再获法国推理小说大奖、德国犯罪电影奖与苏格兰杰出人物奖，并于一九九九至二〇〇五年间获得四所大学的荣誉博士学位。　　兰金目前与妻子跟两个儿子住在爱丁堡，与著名作家J. K.罗琳比邻而居。在完成“哈利·波特”系列之后，J.K.罗琳开始创作侦探小说，而兰金为她的创作提供了诸多帮助，被罗琳称作侦探小说创作上的领路人。', '', '', 'https://img10.360buyimg.com/n1/g10/M00/13/0B/rBEQWFFk0XAIAAAAAAJzcqMGXzEAADx6gM3A-sAAnOK122.jpg', '', 'https://img10.360buyimg.com/n1/g10/M00/13/0B/rBEQWFFk0XAIAAAAAAJzcqMGXzEAADx6gM3A-sAAnOK122.jpg', '6', 'selling_now', '2019-01-16 16:44:57', '2019-02-02 00:12:30', '10', '2019-02-02 00:12:30');
