INSERT INTO `yien_goods` VALUES ('6053', '113971025086248', '86', '喻巧小店', '村上春树：寻羊冒险记（精装）  [羊をめぐる冒険]', '36', '46', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:36', '', '村上春树（1949- ），日本当代作家。京都府人。早稻田大学文学部毕业。主要著作有《挪威的森林》、《寻羊冒险记》、《世界尽头与冷酷仙境》、《舞！舞！舞！》、《奇鸟行状录》、《海边的拉夫卡》、《天黑以后》等。作品真实反映当代日本都市人群的生活、心理，风格洗练，富于想象力，具有很高的艺术价值和深刻的社会批评精神，在世界各地影响广泛，因其笔下人物与我国改革开放后的都市青年群体有着共通之处，故尤其能够得到青年阅读层的喜爱和共鸣。', '', '', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hiACG78AAA_2BmNEIk912.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hiANW0mAAA_2BmNEIk106.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hiACi_ZAAA_2BmNEIk791.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:36', '0', '2019-02-04 15:30:34');
INSERT INTO `yien_goods` VALUES ('6054', '113967594734137', '51', '朱凌小店', '超禁忌游戏.1（新版）', '30', '42', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:40', '', '这是一场极度刺激、充满悬念的超能猎杀游戏，获胜者将成为能够改变全人类命运的“新神”，而失败，就意味着死亡。', '同个补习班的50名学生卷入了一场突如其来的猎杀里，分别被唤醒了隐藏在潜意识中的控制某种事物的超能力。所有一切，都是一个自称上一届游戏获胜者，号称“旧神”的人安排的。从他出现开始，这50个人的人生被彻底改变——弱小的人变得强大；贫穷的人获得了金钱； 丑陋的人变得美丽…… 他们每用自己的超能力击倒一个竞争对手，能力就会随即升级增强一倍，被击倒的对手的等级，会转移到自己身上。', '更为残酷的是，这场超能力对抗禁忌游戏时间年限只有一年，如果没人在最后成为weiyi的胜者，那么结局将是全灭，世界也将走向末日。', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hiAKfZpAAETo4hCIqM514.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hiAN2NHAADq97FIq9I064.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hiASqTEAAETo4hCIqM438.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:40', '36', '2019-02-04 15:30:35');
