INSERT INTO `yien_goods` VALUES ('6060', '962174500479362', '19', '孔恨小店', '韩国创意家居厨房用品用具小百货居家日用品家用生活工具东西神器 两双装 （有四个） 洗碗神器', '79', '101', '成都', '2019-01-23 22:26:26', '九个月', '2019-02-02 00:13:01', '商品名称：韩国创意家居厨房用品用具小百货居家日用品家用生活工具东西神器 两双装 （有四个） 洗碗神器null', '', null, null, 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hmAZmFbAACV6as1-Ks883.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hmAc425AACesdRqbLM297.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hmABEvoAAB9gWnMW8E757.jpg', '8', 'selling_now', '2019-01-23 22:26:26', '2019-02-02 00:13:01', '70', '2019-02-04 15:30:35');
INSERT INTO `yien_goods` VALUES ('6061', '113970048068968', '35', '万俟小店', '高山上的小邮局', '37', '49', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:32', '超过《追风筝的人》的奇迹之书，2018年征服千万读者的治愈故事！那些没有说出口的话，没能去的地方，不再见的人······让这本书替你完成。随书附赠定制限量版信封信纸一套，写下你心中无法说出的话！', '　　在西班牙山村波韦尼尔，萨拉是仅有的邮差。因为电子邮件的普及，人们渐渐不再写信，邮政总局打算关闭波韦尼尔邮局，将萨拉调到首府。萨拉的邻居，八十岁的老太太罗莎想出了一个方法，把萨拉留在波韦尼尔。她暗暗决定寄一封信，并让收信人也像她一样，给村里的人写信，创造一个匿名书信接龙。', '　　罗莎把信写给了失联多年的好友路易莎。当年，罗莎和路易莎是形影不离的闺蜜，但罗莎爱上了路易莎暗恋的男子并与之结婚，路易莎因此远走他乡，两人失去了联络。六十年后，罗莎希望通过自己的信来弥补多年前的裂痕。她不期待回复，只要求收信人能把匿名书信继续下去，从而向邮政总局证明，村民们依然需要手写书信、需要萨拉的存在和她提供的服务。', '　　一封信引出了另一封信。众多不为人知的人生故事，在书信中渐渐揭开……', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hmAVmFdAACbrR0OQ_w022.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hmAD7lwAACbrR0OQ_w973.jpg', 'http://192.168.21.158:8888/group1/M00/00/31/wKgVnlxX6hmARgERAACbrR0OQ_w373.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:32', '81', '2019-02-04 15:30:36');
