INSERT INTO `yien_goods` VALUES ('6071', '113970295697806', '35', '万俟小店', '穆斯林的葬礼(2015版)', '37', '50', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:37', '', '《穆斯林的葬礼》是一部长篇小说，一个穆斯林家族，六十年间的兴衰，三代人命运的沉浮，两个发生在不同时代、有着不同内容却又交错扭结的爱情悲剧。两根故事线，一大家子人的悲欢离合，就这样交织重叠地，从作者笔下娓娓流出。“一道门，隔着两个世界。”——一个是玉的世界，一个是月的世界。霍达用穿插的笔法，写下了如此震撼人心的一部作品，为我们展示了穆斯林独特的风俗习惯和人生历程，描绘了回族人民在“人生的舞台上，悲剧，喜剧，轮番演出，不舍昼夜，无尽无休……”的“演出”，体现了他们生生不息的强大的民族凝聚力和向心力。', '', '', 'http://192.168.21.158:8888/group1/M00/00/32/wKgVnlxX6huAMXxMAACbNWCEOto097.jpg', 'http://192.168.21.158:8888/group1/M00/00/32/wKgVnlxX6huAFJ19AACbNWCEOto743.jpg', 'http://192.168.21.158:8888/group1/M00/00/32/wKgVnlxX6huAZ-jsAACbNWCEOto059.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:37', '9', '2019-02-04 15:30:37');
