INSERT INTO `yien_goods` VALUES ('6098', '113970484576200', '86', '喻巧小店', '重返狼群（2018完整升级版）', '39', '52', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:29', '格林，由人类抚养并成功回归自然的狼。同名电影获陆川、冯小刚、冯绍峰、孙俪等明星真情推荐。千万观众与读者见证，跨越物种的感情与羁绊，一个人与一匹狼,一段关于爱和自由的传奇。果麦文化 出品', '　　', '　　2010年4月，若尔盖草原，女画家李微漪救下奄奄一息的小狼崽\"格林\"，带回成都喂养。两个半月以后，繁华城市中不再有一匹狼的容身之地。看着格林孤独迷茫的样子，她决定带它回归真正的家园。', '　　然而，由人类抚养长大的狼，是不被野生狼群接受的。', 'http://192.168.21.158:8888/group1/M00/00/32/wKgVnlxX6h-AT-HSAAC3q08UC7Y682.jpg', 'http://192.168.21.158:8888/group1/M00/00/32/wKgVnlxX6h-AKj-wAAC3q08UC7Y971.jpg', 'http://192.168.21.158:8888/group1/M00/00/32/wKgVnlxX6h-AJPhQAAC3q08UC7Y209.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:29', '48', '2019-02-04 15:30:41');
