INSERT INTO `yien_goods` VALUES ('6107', '113968848240688', '25', '窦梦小店', '三家巷 苦斗（红色长篇小说经典）', '46', '59', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:30', '', '1978年欧阳山写作此文时，中国文艺界尚处在“文革”风暴过后的“重建”中，欧阳山的这些思考代表了一个有良知的文学写作者的自我反思，其间透着知识分子的清醒与独立。更为重要的是，欧阳山对这些文学创作中的具体问题都给出了自己的答案。', '欧阳山（1908一2000），现代作家。原名杨凤岐，笔名凡鸟、罗西等。1908年12月出生在湖北荆州一个城市贫民家庭里，因家境贫寒几个月时被卖给姓杨的人家，从小便随养父四处奔波，在外流浪，接触过很多下层社会的穷苦人。16岁那年第一篇短篇小说《那一夜》在上海《学生杂志》上发表，从此开始了文学创作。著有作品《玫瑰花残了》《英雄三生》《前程似锦》《一代风流》《三家巷》等。新中国成立后，长期担任文艺界的领导工作，历任中国作协广东分会主席、广东省文联主席、中国作协副主席等职。', null, 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iGAbSrBAACsXcoo_9I917.jpg', 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iGAGn2vAACsXcoo_9I074.jpg', 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iGAXK8EAACsXcoo_9I942.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:30', '99', '2019-02-04 15:30:43');
