INSERT INTO `yien_goods` VALUES ('6111', '113969371176864', '92', '章南小店', '草冠（套装上下册）', '80', '128', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:42', '罗马主宰系列第二部 名著《荆棘鸟》的作者 澳大利亚作家 考琳·麦卡洛 赢得博士学位的历史小说代表作 从生活到战争 细致再现古罗马时代的文学史诗', '　　《草冠》是澳大利亚著名作家考琳?麦卡洛的历史小说系列“罗马主宰”的第三、四册。这套小说描写了古罗马激荡的历史时刻，无数历史巨人是其中的主角：马略、苏拉、凯撒、庞培。　　流传至今的历史资料对于古罗马的历史是断断续续的，而考琳?麦卡洛通过小说的手法历史巧妙连接成生动的故事。而小说对于历史的严谨性又得到了学术界的认可，澳大利亚墨尔本大学因为这套书授予了作者荣誉历史博士的崇高称号，也让这套小说成为了一段佳话。', '　　1.名著《荆棘鸟》的作者，澳大利亚作家考琳?麦卡洛的历史小说代表作。　　2.以小说家细腻生动的笔触呈现古罗马的激荡历史，再现马略、恺撒等巨人的舞台，事无巨细的历史背景研究，以虚构作品为作者赢得历史博士殊荣。', null, 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iGAdcoqAACoOOo-utU761.jpg', 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iGAM9EEAACoOOo-utU734.jpg', 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iGAAwHjAACoOOo-utU903.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:42', '0', '2019-02-04 15:30:44');
