INSERT INTO `yien_goods` VALUES ('6114', '113971037463516', '47', '严凌小店', '十三步 (莫言作品全编）', '25', '37', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:40', '', '《十三步》是莫言创作的一部极富艺术实验色彩的长篇小说。小说运用现代派艺术手法，通过人称和视角的不断变换，用荒诞、夸张的笔法全力描绘了当代中国知识分子的苦难与困境和现实生活中的怪异与荒谬。中学物理教师方富贵劳累致死，因为殡仪馆要给死去的王副市长整容，于是先被塞进冰柜，居然荒诞离奇地复活；妻子屠小英以为他已经死去，不让他再进家门。殡仪馆特级美容师李玉婵将死而复活的方富贵改容成自己的丈夫物理教师张赤球，让他代替张赤球登上讲台给学生上课，同时让真正的张赤球去做生意赚钱。真实的张赤球成了没有身份的孤魂野鬼，有家不能归；真实的方富贵面对尴尬的双重身份，无所适从。现实生活中原有的秩序不复存在，每个人都在荒诞的境遇中逐渐失去本性，无可挽回地走向必然降临的厄运……', '', '', 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iKAKszoAAE2Q45d9dY802.jpg', 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iKAMd3aAAE2Q45d9dY692.jpg', 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iKADEnTAAE2Q45d9dY149.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:40', '73', '2019-02-04 15:30:44');
