INSERT INTO `yien_goods` VALUES ('6120', '113968693342067', '9', '上官小店', '德川家康第三辑:王道无敌（套装共5册）  [徳川家康]', '171', '195', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:28', '全5册 权书史书商书三书合一 平均每个日本人手中有3册《德川家康》 并附赠独版书签', '　　日本历史小说家山冈庄八著《德川家康》分三辑：《德川家康一辑：崛起三河》《德川家康第二辑：双雄罢兵》《德川家康第三辑：王道无敌》。　　知名历史学家柏杨说：“中国有两部书可以和《德川家康》相比，一是《资治通鉴》，一是《三国演义》。”美国前驻日大使赖世和说：“每一个日本人都是一个德川家康，要了解日本、超过日本，必须先了解德川家康。”德川家康究竟是何许人？　　德川家康结束了日本百余年的战乱，开创三百年太平盛世，建立了完整意义上的日本国。《德川家康》将日本战国中后期织田信长、武田信玄、丰臣秀吉、德川家康等群雄并起的历史苍劲地铺展开来。　　《德川家康第三辑：王道无敌》，共5册，讲述了德川家康在丰臣秀吉病殁后继承秀吉“给天下苍生带来太平”的遗志，在江户开创幕府，颁布《武家诸法度》，明确公家和武家的政权范围，确立“士农工商”的等级制度。此外，撤兵朝鲜，积极与海外诸国进行贸易，使民安居乐业。德川家康一生节俭、勤政、爱臣民、忧天下，直到他七十五岁逝世。', '　　', null, 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iOAZUXwAAJVRC544eU445.jpg', 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iOAKdcAAAJVRC544eU515.jpg', 'http://192.168.21.158:8888/group1/M00/00/33/wKgVnlxX6iOAX5tPAAJVRC544eU183.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:28', '98', '2019-02-04 15:30:45');
