INSERT INTO `yien_goods` VALUES ('6141', '113969774200805', '97', '杨柏小店', '平凡的世界：全三册', '75', '108', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:37', '茅盾文学奖皇冠上的明珠，激励亿万读者的不朽作品，深受老师和学生喜爱的新课标必读书', '这是一部现实主义小说，也是小说化的家族史。作家高度浓缩了中国西北农村的历史变迁过程，作品达到了思想性与艺术性的高度统一，特别是主人公面对困境艰苦奋斗的精神，对今天的大学生朋友仍有启迪。这是一部全景式地表现中国当代城乡社会生活的长篇小说，本书共三部。作者在近十年问广阔背景上，通过复杂的矛盾纠葛，刻划了社会各阶层众多普通人的形象。劳动与爱情，挫折与追求，痛苦与欢乐，日常生活与巨大社会冲突，纷繁地交织在一起，深刻地展示了普通人在大时代历史进程中所走过的艰难曲折的道路。', '', '', 'http://192.168.21.158:8888/group1/M00/00/34/wKgVnlxX6iaANS0xAACH2VKdwCM526.jpg', 'http://192.168.21.158:8888/group1/M00/00/34/wKgVnlxX6iaAaxl6AACH2VKdwCM469.jpg', 'http://192.168.21.158:8888/group1/M00/00/34/wKgVnlxX6iaAW5D6AACH2VKdwCM636.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:37', '29', '2019-02-04 15:30:48');
