INSERT INTO `yien_goods` VALUES ('6175', '113969813654589', '45', '卫山小店', '摆渡人2重返荒原', '27', '43', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:30', '（百万畅销心灵治愈小说《摆渡人》第二季重磅来袭！中英文版全球同步上市。每一个镌刻着爱与善意的灵魂，都会成为我们生命中的摆渡人。 内附精美插图）', '女孩迪伦和灵魂摆渡人崔斯坦在经历了异常惊心动魄的抉择之后，终于打破生死界限，有惊无险地来到了现实世界中。', '与此同时，一位名叫苏珊娜的摆渡人因为窥探到他们逃离了荒原，也心生向往，渴望来到现实世界里生活，为此她欺骗了一个由她引渡的灵魂，并引发了一场巨变……', '就在所有人都以为可以安然无恙的时候，命运的审判者骤然降临，它无声无息，强大而神秘，冷酷地下达了判决：', 'http://192.168.21.158:8888/group1/M00/00/35/wKgVnlxX6i2ABdCHAAE8GsqhwvQ725.jpg', 'http://192.168.21.158:8888/group1/M00/00/35/wKgVnlxX6i2AWyHYAAE8GsqhwvQ514.jpg', 'http://192.168.21.158:8888/group1/M00/00/35/wKgVnlxX6i2ACxPnAAE8GsqhwvQ129.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:30', '65', '2019-02-04 15:30:56');
