INSERT INTO `yien_goods` VALUES ('6185', '113970231849745', '8', '秦友小店', '你在哪里？', '27', '42', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:44', '单本累计销量超过260万册，《偷影子的人》作者马克·李维全新治愈系小说，这世上总有一个地方，让无处安放的灵魂找到栖息之所', '苏珊与菲利普从小一起长大，他们是彼此生命里的一切，然而命运却让他们不断分离。过早经历家庭变故的苏珊一直学不会与这个世界和平相处，即便是在爱她的人身边，她也无法克服内心的慌乱。于是，她不断地逃离，远走他乡去帮助那些因飓风失去家园的人。苏珊知道，不管她走到哪里，不管岁月带给他们多少变化，菲利普都是她后的依靠，是她可以托付生命的人。这是他们彼此的承诺，而这个承诺将给他们的命运带来不可预知的改变……', '', '', 'http://192.168.21.158:8888/group1/M00/00/35/wKgVnlxX6i-ATsD9AAE0lMwfjl8026.jpg', 'http://192.168.21.158:8888/group1/M00/00/35/wKgVnlxX6i-AD2ySAAE0lMwfjl8166.jpg', 'http://192.168.21.158:8888/group1/M00/00/35/wKgVnlxX6i-ABjL9AAE0lMwfjl8254.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:44', '54', '2019-02-04 15:30:57');
