INSERT INTO `yien_goods` VALUES ('6196', '113969049292483', '61', '何亦小店', '我的帝王生涯（茅盾文学奖获得者苏童写作生涯代表作品 精装珍藏版）', '33', '42', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:37', '当代小说家中zui有魅力的说故事者之一 苏童写作生涯代表作品，架空类历史小说的开山之作 人人都想成为帝王，他却渴望走出被误判的一生。 这是一个帝皇的悲剧故事，身处王权顶端，自由成为奢想。', '当代小说家中zui有魅力的说故事者之一', '《我的帝王生涯》讲的是个扮皇帝的故事。小说中的少年皇帝是在一连串偷龙换凤的阴谋下，僭登龙位的。皇帝本人或许无知，他周遭的人等却是各怀鬼胎。但皇帝到底是皇帝，万岁爷就算是个冒牌，戏总得演下去。而我们的小皇帝虽然望之不似人君，人君所可能有的缺点，他都一应俱全。由登基到罢黜，他的问题不在于扮皇帝扮得不像，而是扮得太像了。苏童的小说由是透露著深沈的反讽。翻开历史，有多少「真命天子」其实是昏君懦主，不配一统江山。「假作真时真亦假」，在苏童笔下，两千年的帝王史有如儿戏，但这却是一场要命的儿戏。', null, 'http://192.168.21.158:8888/group1/M00/00/35/wKgVnlxX6jGAVAHpAADjCZsgZK4763.jpg', 'http://192.168.21.158:8888/group1/M00/00/35/wKgVnlxX6jGADneGAADjCZsgZK4305.jpg', 'http://192.168.21.158:8888/group1/M00/00/35/wKgVnlxX6jGAR2YBAADjCZsgZK4521.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:37', '100', '2019-02-04 15:30:59');
