INSERT INTO `yien_goods` VALUES ('6204', '113970870297472', '45', '卫山小店', '平凡的世界：普及本', '30', '40', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:42', '', '这是一部现实主义小说，也是小说化的家族史。作家高度浓缩了中国西北农村的历史变迁过程，作品达到了思想性与艺术性的高度统一，特别是主人公面对困境艰苦奋斗的精神，对今天的大学生朋友仍有启迪。这是一部全景式地表现中国当代城乡社会生活的长篇小说，本书共三部。作者在近十年问广阔背景上，通过复杂的矛盾纠葛，刻划了社会各阶层众多普通人的形象。劳动与爱情，挫折与追求，痛苦与欢乐，日常生活与巨大社会冲突，纷繁地交织在一起，深刻地展示了普通人在大时代历史进程中所走过的艰难曲折的道路。', '这是《平凡的世界》（共三部）的精华版，在原书三本的基础上缩写为一本，内容更为集中。', '', 'http://192.168.21.158:8888/group1/M00/00/35/wKgVnlxX6jKAe0_FAAFYYZuRx10123.jpg', 'http://192.168.21.158:8888/group1/M00/00/35/wKgVnlxX6jKAe5xoAAFYYZuRx10140.jpg', 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jKAQN-oAAFYYZuRx10083.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:42', '37', '2019-02-04 15:31:00');
