INSERT INTO `yien_goods` VALUES ('6217', '113970245457355', '29', '潘亦小店', '文学名著：毛姆:月亮与六便士', '23', '35', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:43', '一本好书 腾讯视频栏目推荐。胡一天推荐版本。毛姆代表作月亮和六便士，青年翻译家刘勇军倾情翻译。一部写给千万文艺青年的梦想之书！白岩松、村上、余华、张爱玲、高晓松等感动推荐。', '你我身边都有这样的朋友──平凡上班族，人届中年，已婚，育有一子，脚踏实地赚钱糊口。说不定，你自己就是这样的人，在这样的生活中不知不觉迈入中年。      《月亮与六便士》里面的主人公查尔斯正是如此，只不过，有一天他突然响应内心的呼唤，留下一张字条，说：晚餐准备好了。就此离经叛道舍弃一切离家出走，一意追寻他对画画的热爱，到南太平洋的塔希提岛与土著人一起生活，贫病交迫也不再回头。      妻子说：梦想？他这种年纪不会持久的，毕竟他都四十岁了，很快他就会回到我身边。      朋友问他：你不认为自己有任何责任义务吗？你到底要什么？      查尔斯胆敢成为别人眼中不可理喻的疯子、执迷不悟的傻子、冷酷无情的负心汉，很多人说他是痴人说梦、浪费生命，甚至不负责任，而只有他知道内心的热情和追求的理想，并以自己喜欢的方式选择了自己的人生道路！      但现实生活中，有多少人只是胆怯地抬头看一眼月亮，又继续低头追逐赖以温饱的六便士？', '', '', 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jSAfmYOAACwQxCoG7g755.jpg', 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jSAHaGhAACwQxCoG7g158.jpg', 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jSARPrhAACwQxCoG7g428.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:43', '99', '2019-02-04 15:31:02');
