INSERT INTO `yien_goods` VALUES ('6229', '4406567162474', '67', '尉迟小店', '【满199减100】心相印茶语抽纸丝享面巾纸宝宝餐巾纸3层130抽*24包整箱纸抽卫生纸批发', '104', '124', '东莞', '2019-01-21 10:02:03', '六个月', '2019-02-02 00:12:37', '商品名称：【满199减100】心相印茶语抽纸丝享面巾纸宝宝餐巾纸3层130抽*24包整箱纸抽卫生纸批发', '', null, null, 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jaAeGJBAAIyVnGjxQc306.jpg', 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jaAa3hNAAIyVnGjxQc247.jpg', 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jaANzZkAAEWSNEOm20529.jpg', '7', 'selling_now', '2019-01-21 10:02:03', '2019-02-02 00:12:37', '24', '2019-02-04 15:31:05');
INSERT INTO `yien_goods` VALUES ('6230', '113965125935168', '61', '何亦小店', '所罗门的伪证（套装全3册）', '122', '168', '重庆', '2019-01-16 16:44:55', '十二个月', '2019-02-02 00:12:39', '蔡康永力荐推理神作，读完赞叹宫部美雪“把其他小说家逼太惨啦！”', '　　少年的死是一面镜子，映照出恶与善、虚伪与真实。　　一九九〇年圣诞节的清晨，城东第三中学校园内的积雪之下发现一具尸体，死者是该校二年级的学生。这起很快被校方和警方认定为自杀的案件，却因一封匿名举报信揭发的谋杀疑云，渐渐演变成一场巨大的风波。　　谎言和恶意层层累积，新闻媒体插手其中大肆渲染，大人们的欺瞒与懈怠让事件变得越发不可收拾。不良少年被指认为凶手，校长和班主任引咎辞职，新的牺牲者接二连三地出现……孩子们终于忍无可忍，他们要用从未有过的方式找寻真相——　　一九九一年八月十五日，赌上人生的校内审判，即将开庭！', '', '', 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jaAd-6lAAE23P6fqgY125.jpg', 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jaAdgDuAAE3J0nsFb8537.jpg', 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jaALuRpAAE23P6fqgY277.jpg', '6', 'selling_now', '2019-01-16 16:44:55', '2019-02-02 00:12:39', '36', '2019-02-04 15:31:05');
