INSERT INTO `yien_goods` VALUES ('6232', '113969684599038', '84', '蒋灵小店', '汉高祖刘邦（全3册）', '88', '128', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:33', '媲美姚雪垠、二月河、孙皓晖的“帝王作家”秦俊长篇历史代表作！国人必读的“帝王之书”、成功之书、权谋之书、管理之书！普通人看懂上升逆袭之路，管理者看懂成功用人之道！', '《汉高祖刘邦（全三册）》为历史小说家秦俊所著的“大汉帝国”系列长篇小说，以民间的视角解读汉高祖刘邦“以布衣提三尺剑取天下”的传奇英雄故事。刘邦豁达大度，知人善任，纳谏如流，有政治家眼光，有战略家谋略，有军事家运筹，终打败项羽，奠定大汉帝国四百余年的基业。本书完整展现了刘邦从一介浪荡儿的小小亭长，到广纳贤良、独立统兵，再到熟练运用用人之道、带兵谋略，开创帝业，终成中国历史上一位布衣天子的历史画卷。秦俊将基层社会的历史、普通民众的历史、日常生活的历史和民间文化史融为一体，重新阐释了刘邦作为历代统治者为推重的封建君主，以及后世专家学者首肯的高明政治家、企业高管高度评价的领导管理者的独特魅力。', '★与姚雪垠、二月河、孙皓晖媲美的“帝王作家”秦俊长篇历史代表作！国人必读的“帝王之书”！★历代统治者为推重的封建君主，国内外专家学者首肯的高明政治家，企业高管高度评价的领导管理者——中国历史上一位布衣天子汉高祖刘邦如何缔造四百年大汉帝国！★成功之书、权谋之书、管理之书，普通人看懂上升逆袭之路，管理者看懂成功用人之道！★多部作品畅销美国、日本、新加坡、马来西亚、越南等国家，深受海外华人欢迎！多家影视机构筹拍其多部作品！★秦俊的作品以朴实通俗见长于文苑，忠于史实而不泥于事实，工于绘真且不拘于传闻，寓雅言于俗务，文笔干净畅晓，于老辣中见纯朴，通俗而不庸俗，乡土而不泥土，从众而不媚众，入雅而不佞雅。——二月河（历史小说家）★河南南阳的作家，从姚雪垠起，到今天的二月河、秦俊，都致力于历史小说创作，影响是不可低估的。河南历史题材创作形成三驾马车：姚雪垠二月河的雅致来叙述历史，刘震云的现实眼光反映历史，秦俊以民间的视角解说历史。——张炯（中国作协副主席）★人类历史上有远见、对后世影响大的两位政治人物，一位是开创罗马帝国的恺撒，另一位便是创建大汉文明的汉高祖刘邦。恺撒未能目睹罗马帝国的建立以及文明的兴起，便不幸遇刺身亡，而刘邦却亲手缔造了一个昌盛的时期，并以其极富远见的领导才能，为人类历史开创了新纪元。——﹝英﹞约瑟?汤因比（历史学家）★评论界有说法：中原写帝王的有三位作家，各有特色：姚雪垠站在阶级立场写闯王，二月河居丹陛之上写皇帝，秦俊以民间的角度写帝王。——人民网★他的小说把历史与民间、现实拉得这么近，这么紧，这么趣，适宜制作和播讲。——香港资讯卫视《史海钩沉》★“刘邦是一位高明的政治家”，“是封建皇帝里边厉害的一个”，“豁达大度，从谏如流的英雄人物”。——毛泽东★正主御邪臣，不能致理；正臣事邪主，亦不能致理。唯君臣相遇，有同鱼水，则海内可安也。昔汉高祖，田舍翁耳。提三尺剑定天下，既而规模弘远，庆流子孙者，此盖任得贤臣所致也。——﹝唐﹞李世民★惟汉高祖皇帝除嬴平项，宽仁大度，威加海内，年开四百。有君天下之德而安万世之功者也。——﹝明﹞朱元璋★高祖为人，仁而爱人，喜施，意豁如也，常有大度。——﹝汉﹞司马迁★古之英主，无出汉高。——﹝宋﹞苏轼', null, 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jeAGCjRAAID-XV-P2Y062.jpg', 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jeAQxGdAAID-XV-P2Y573.jpg', 'http://192.168.21.158:8888/group1/M00/00/36/wKgVnlxX6jeAaUPYAAID-XV-P2Y598.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:33', '29', '2019-02-04 15:31:05');
