INSERT INTO `yien_goods` VALUES ('6240', '113968526811208', '21', '吕曼小店', '苏童作品系列：妻妾成群', '17', '23', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:08:12', '', '', '　　随着《妻妾成群（中篇小说集）》被著名电影导演张艺谋改编成电影《大红灯笼高高挂》，获奥斯卡金像奖提名，苏童的名声蜚声海内外，无可争议是青年一代作家的佼佼者苏童显然不是在重复讲述封建婚姻悲剧的故事，对于苏童的叙事来说，“故事”似乎并不特别重要，主题甚至也无须深究。这个并不新颖别致的故事，却能给人以特别深刻的印象，就在于苏童富有韵味的叙事，那种纯净透明的语言感觉；那些刻划得异常鲜明的故事情境；那种温馨而感伤的气息、显然这个故事可以看到《家》、《春》、《秋》和《红搂梦》，甚至《金瓶梅》的影子；作者对这种生活的把玩观照，多少还可见中国旧式文人的传统态度。这些使得苏童的叙事既具有历史颓废主义的手笔，却也深藏着文化韵涵。 　　某种意义上，这篇小说表达了苏童乃至一代青年作家奇怪的历史观。即把“性”看作历史的根源和动力。由于“性”的紊乱，家族乃至历史破败的命运不可逃脱。除佐千作为一种古旧文化的历史记忆，他试困从年轻女性身上获得生殖力（生命力），他的企图的失败不过象征性地表示古旧的中国历史已经彻底丧失了延续的可能性。在这个意义上，这篇小说无意中写出一种历史颓败的情境，一种文化失败的历史命运。 　　苏童尤为擅长刻划女性形象，“红颜薄命”的古训，在苏童手里特别富有韵味。在他看来，也许“女性身上凝聚着更多的小说因素”，那些女性优雅明净，任性而薄命，浑身散发着感伤的诗意。不过，苏童笔下的女性也因此给人以雷同之感。她们有类似的心性，同样的命运。很显然，《妻妄成群》的结尾有些勉强，似乎有意营造悲剧性的结局，苏童的那些女性的命运早已被先验地注定了。 　　苏童的叙事优雅从容，纯净如水，《妻妾成群（中篇小说集）》尤见他的这一特色。平实写来却意韵横生；着笔清雅而富有江南情调；这应归结于苏童把叙事与抒情结合得恰到好处。对于自己的优雅一路的风格，苏童颇有疑虑；北方作家讥之日“脂粉气”、“女性味”。 　　近年来，苏童加大“凶猛”一类的原料，多讲土匪、复仇之类的故事。不管如何，苏童天赋甚高，悟性极好，且能知已知彼，虽已被戴上“高产作家”的帽子，然前途尚不可限量。', null, 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jiAYV6sAAAlEMaGt-E136.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jiAXgQNAAAlEMaGt-E296.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jiAU8B8AAAlEMaGt-E083.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:08:12', '76', '2019-02-04 15:31:06');
INSERT INTO `yien_goods` VALUES ('6241', '113967445847278', '8', '秦友小店', '命悬一线', '26', '42', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:25', '（华语犯罪悬疑力作，重磅上市。） 一则恶作剧视频，引起警察、富二代、地痞、杀手多方纠缠……以恶的脆弱和强悍，彰显对善的坚守。天涯神帖，超1000万点击作品，诡计上演，拷问人心。', '以恶的脆弱和强悍，彰显对善的坚守。《命悬一线》讲述了一个以“恶”制恶的故事。富二代贺彬同电脑天才程潭为了给无聊的生活加点料，策划了一场“偷拍”恶作剧，惹恼了被他们成功恶搞的韦烁。有着黑社会背景的韦烁伙同几个混混假扮警察，将贺彬等人绑架至山中寺庙。令人想不到的是，贺彬在偷拍时曾录下了一起凶杀案的间接证据，而寺庙又是凶手的落脚点。三方人马在寺庙不期而遇，猫鼠游戏血腥上演。同时，在警方的介入下，一个巨大的阴谋也慢慢浮出水面......', '', '', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jiAELu-AADzbZIn_iw032.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jiAC9DIAACMW20Tzp0797.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jiAKdA9AADzbZIn_iw171.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:25', '78', '2019-02-04 15:31:07');
