INSERT INTO `yien_goods` VALUES ('6243', '113967557873224', '93', '彭代小店', '铜钟谜案', '22', '34', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:40', '', '高罗佩（1910—1967），本名罗伯特.范.古利克（Robert Van Gulik），荷兰汉学家、东方学家、外交家、翻译家、小说家。作为荷兰职业外交官，他通晓英、法、德、汉、阿拉伯、日、藏、梵文等15种语言文字。高罗佩一生著述颇丰，涉及语言、宗教、民俗、美术、文学、音乐等众多门类。他zui为人知的成就，是将狄仁杰的故事翻译成英文，并据此以英文创作了推理侦探小说“狄公探案”系列小说，现已翻译成29种文字，在38个国家出版，“狄公”由此成为西方人眼中的“中国福尔摩斯”。', '姜逸青，上海文艺出版社副总编，兼上海文化出版社总编，主编过“企鹅（中文版）世界文学名著”等多套大中小型外国文学丛书。', '申霞，上海位育中学高级英语教师，国家教委高考英语卷命题组成员。', 'https://img14.360buyimg.com/n1/jfs/t16246/364/2325904063/452097/259a0be8/5aa4b852N74f55b4f.jpg', '', 'https://img14.360buyimg.com/n1/jfs/t16246/364/2325904063/452097/259a0be8/5aa4b852N74f55b4f.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:40', '8', '2019-02-02 00:12:40');
