INSERT INTO `yien_goods` VALUES ('6250', '113970999436804', '78', '诸葛小店', '萤火虫小巷套装（套装共2册）', '45', '72', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:26', '媲美《追风筝的人》《世界上的另一个你》的人性治愈小说，荣登《纽约时报》畅销榜Top3，全球超过百万名读者期待的人性救赎之作！失去的会以另外的方式永远存在，而拥有的需要加倍珍惜。', '', '', '', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jqATBjxAAG-2E4EqXA379.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jqAEgV3AAG-2E4EqXA056.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jqAHX6JAAG-2E4EqXA542.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:26', '67', '2019-02-04 15:31:08');
INSERT INTO `yien_goods` VALUES ('6251', '113968590311734', '26', '金雪小店', '井上靖作品：楼兰', '20', '25', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:30', '', '井上靖（1907-1991），日本当代著名小说家，日中文化交流协会前任会长。1936年长篇处女作《流转》获千叶龟雄文学奖，1950年《斗牛》获芥川龙之介奖，1958年《天平之甍》获日本艺术选奖，1960年《敦煌》《楼兰》同获每日艺术奖。1976年获得日本文化勋章。1989年，完成了被誉为“历史小说明珠”的《孔子》。1991年病逝于东京。', '从前，西域有个小国，叫楼兰。楼兰的罗布泊，是楼兰人的神，是是楼兰全部子民的生息之本。由于长期夹在匈奴与大汉王朝的争夺之中，弱小的楼兰不得已做出迁离罗布泊的决定。没有了罗布泊，楼兰和楼兰人将会走向何方？          日本文学巨匠井上靖用朴实的文字，讲述着神秘楼兰古国的变迁。井上靖的小说充满了浪漫的想象及对中国西域的憧憬和梦想。短篇小说集《楼兰》里有一篇《狼灾记》，曾被导演田壮壮同名搬上大银幕。另井上靖还创作长篇小说《敦煌》和《孔子》、《天平之甍》等。', null, 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jqAAeW7AACA_GHKSEg917.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jqAOemPAACA_GHKSEg645.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jqADMyuAACA_GHKSEg163.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:30', '87', '2019-02-04 15:31:09');
