INSERT INTO `yien_goods` VALUES ('6259', '113968796548961', '46', '戚半小店', '大唐李白（二）·凤凰台', '29', '39', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:41', '', '', '　　天下贤才是凤凰，但登台远望，凤凰为谁来？开元十三年，李白出蜀，初试啼声。在大唐社会变动最剧烈、攀附求名之势上行下效的时代，这是一次彻底诀别的浪游：他不能再作居乡之吟，不能再有归乡之思，甚至不能再图返乡之计。唯有如此，他李白才有机会成为帝国万里幅员中一个全新的人。然而，一旦卷入光辉盛世的名利游戏，名满天下的诗人，往往不过是诗句的附庸。凭借惊人的才情，既无经验亦无功名的李白，得到上至公侯下至歌姬胥吏的青睐。然而，出身的羁绊却一路如影随形，挥之不去。在慷慨漫游的旅次中，师母月娘告别往报父仇，相见遥未可期；挚友吴指南更是渐行渐远，终至客死异乡，临别遗言：“汝心事只向诗说，便是自绝于天下人！”身外无家的诗人，一心所向者，究竟为何？正如孟浩然之问：“汝于天下，有一诺否？”　　《凤凰台》是台湾作家张大春“大唐李白”系列四部曲之二，继《少年游》之后，讲述青年李白出蜀之后、沿江而下的游历生活。在这卷堪称“李白的漫游年代”之书中，李白与发小吴指南下渝州、经巫山、过荆门、到江陵；遇道士司马承祯，解洞庭钱塘、泾阳二龙之衅，奇遇不断，皆为其一步步向庙堂明君接近的精彩伏笔。金陵孙楚楼上，李白与一代名妓段七娘、贵胄子弟崔宗之等人一见如故；驿站江边初见孟浩然，更互相惊为天人。', null, 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6juAFom_AACeAVWv1no099.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6juAIcw8AACeAVWv1no718.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6juAFYBiAACeAVWv1no985.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:41', '8', '2019-02-04 15:31:10');
INSERT INTO `yien_goods` VALUES ('6260', '113970205993951', '26', '金雪小店', '一个青年艺术家的画像（全新修订版！牛津大学出版社授权导读珍藏版！献给每一个永不妥协的青年！）（读客经典文库）', '28', '39', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:39', '据Oxford University Press 2000定本全新修订606处！附牛津大学出版社授权导读！“20世纪百部小说Top3”！献给每一个永不妥协的青年！读客熊猫君出品', '献给每一个永不妥协的青年！', '', '生于都柏林的青年艺术家斯蒂芬从小就敏感、多思。童年时期懵懂无知，积极求学却遭遇痛打；少年时期冲动热情，却误入欲望的迷途；青年时期终于变得成熟理智，但最终主动选择流放异地。他说：“啊，生活！我准备第100万次去接触经验的现实”……', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6juAbMK7AAHDHpWi5Ms767.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6juAPrrCAAHDHpWi5Ms095.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6juAUkyCAAHDHpWi5Ms913.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:39', '18', '2019-02-04 15:31:10');
