INSERT INTO `yien_goods` VALUES ('6265', '113970013868262', '53', '吴寒小店', '灿烂千阳', '28', '36', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:41', '世纪文景出品。《追风筝的人》作者作者献给阿富汗女性的动人故事。关于不可宽恕的时代，不可能的友谊以及不可毁灭的爱。', '　　卡勒德·胡赛尼（Khaled Hosseini），1965年生于阿富汗喀布尔市，后随父亲迁往美国。毕业于加州大学圣地亚哥医学系，现居加州。著有小说《追风筝的人》(The Kite Runner，2003）、《灿烂千阳》(A Thousand Splendid Suns，2007)、《群山回唱》（And the Mountains Echoed,2013）。作品全球销量超过5000万册。', '　　“立志拂去蒙在阿富汗普通民众面孔的尘灰，将背后灵魂的悸动展示给世人”。2006年，因其作品巨大的国际影响力，胡赛尼获得联合国人道主义奖，并受邀担任联合国难民署亲善大使。他还创立了以自己名字命名的基金会，为阿富汗的难民提供人道主义援助。', '', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jyAGr3pAADH9QSkJwQ019.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jyAcINiAADH9QSkJwQ335.jpg', 'http://192.168.21.158:8888/group1/M00/00/37/wKgVnlxX6jyAXdCSAADH9QSkJwQ874.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:41', '28', '2019-02-04 15:31:11');
