INSERT INTO `yien_goods` VALUES ('6284', '113965332898498', '64', '魏青小店', '福尔摩斯探案集（漫画版 第1辑 套装共6册）', '116', '168', '重庆', '2019-01-16 16:44:56', '十二个月', '2019-02-02 00:12:33', '', '本书是《福尔摩斯探案集》彩色漫画版的第1辑，共有6个故事，将大侦探福尔摩斯和华生的形象展现在青少年读者的面前。', '红发会：一头红发的威尔逊遇到了一件奇怪的事，他入选红发会，每天只需干很少的工作就能拿到很高的薪酬。在他要拿薪水的日子，红发会却毫无征兆解散了。于是他找到福尔摩斯。', '蓝宝石：彼得森在圣诞节捡到了一只鹅和一顶帽，他把它们带给了福尔摩斯。福尔摩斯在鹅肚子里发现了一颗蓝宝石。这引起了福尔摩斯的兴趣。', 'http://192.168.21.158:8888/group1/M00/00/38/wKgVnlxX6kCAJxTkAACy_mpne_8233.jpg', 'http://192.168.21.158:8888/group1/M00/00/38/wKgVnlxX6kCALviVAAC1HMk868g615.jpg', 'http://192.168.21.158:8888/group1/M00/00/38/wKgVnlxX6kCAEBrHAACy_mpne_8360.jpg', '6', 'selling_now', '2019-01-16 16:44:56', '2019-02-02 00:12:33', '89', '2019-02-04 15:31:14');
