INSERT INTO `yien_goods` VALUES ('6287', '113971281973523', '37', '赫连小店', '1988：我想和这个世界谈谈（2018新版）', '28', '39', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:32', '一部描述世界之广大，探寻人心之复杂，贴近并穿透现实的纯粹之作，尽显韩寒黑色幽默的心智与才华。', '　　　　本书以一部旅行车为载体，通过在路上的见闻、过去的回忆、扑朔迷离的人物关系等各种现实场景，表达了韩寒对这个世界与当下现实的看法。故事由两条线索并列推进，线索一是主人公\"我\"开着一辆1988年生产的汽车，在前往远方接朋友的途中，与妓女娜娜相遇后一路相伴，由此碰撞出一连串的火花；另一条线索是在这趟旅途中，\"我\"不断地回顾自己的童年，思考着曾经的过往和当下的人生之路。', '', '', 'http://192.168.21.158:8888/group1/M00/00/38/wKgVnlxX6kCAI4FsAAAlU5x_RMk164.jpg', 'http://192.168.21.158:8888/group1/M00/00/38/wKgVnlxX6kCAGCdNAAAlU5x_RMk095.jpg', 'http://192.168.21.158:8888/group1/M00/00/38/wKgVnlxX6kCAUNzDAAAlU5x_RMk983.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:32', '97', '2019-02-04 15:31:15');
