INSERT INTO `yien_goods` VALUES ('6312', '113970677566387', '92', '章南小店', '我余生的第一天', '31', '45', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:42', '法国连续四年畅销不衰，治愈无数读者的经典心灵小说', '从一眼望穿的生活中逃离，究竟有多难？  很多时候，玛丽都觉得自己的人生索然无味，曾经，她也怀揣梦想，意气风发。她以全部的热情投入生活当中，为家人奉献一切，却唯独失去了自我。然而日复一日，丈夫对她也越来越无视，连孩子们都觉得母亲应该去过真正属于自己的生活。终于有一天，在她的丈夫40岁生日这一天，她决定给他一个惊喜：她独自踏上了环球航行的游轮，希望能从一眼望穿的生活中逃离，给自己一个重生的机会。她遇见了各种各样的人，每个人都有自己的困境，也终于在这趟旅程中找到了疗愈自己的方法。', '', '', 'http://192.168.21.158:8888/group1/M00/00/39/wKgVnlxX6kWASy_dAAEyEFDBRGc695.jpg', 'http://192.168.21.158:8888/group1/M00/00/39/wKgVnlxX6kWAUcheAAEyEFDBRGc616.jpg', 'http://192.168.21.158:8888/group1/M00/00/39/wKgVnlxX6kWAA7X-AAEyEFDBRGc849.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:42', '76', '2019-02-04 15:31:19');
INSERT INTO `yien_goods` VALUES ('6313', '113971204471617', '39', '赵凌小店', '四世同堂（足本）', '71', '92', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:44', '', '第八十八节 黑马补译', '八十八', '跟别的学校一样，铁路学校里的学生们常常悬着心。上课的时候，要是有人敲门，满教室的人就提心吊胆，大气不敢喘，手都哆嗦。门一开，第一个进来的总是日本教员，身后是日本特务和宪兵。谁也不知道自己会不会被抓走，不管你是不是干了反日的事或说了反日的话。大家浑身抖着，好像在等一个雷劈下来，不知道那残酷的雷电会落到谁头上。', 'http://192.168.21.158:8888/group1/M00/00/39/wKgVnlxX6kWAajWGAABolbDBuVQ010.jpg', 'http://192.168.21.158:8888/group1/M00/00/39/wKgVnlxX6kWAT_LiAABolbDBuVQ272.jpg', 'http://192.168.21.158:8888/group1/M00/00/39/wKgVnlxX6kWAA9q3AABolbDBuVQ915.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:44', '79', '2019-02-04 15:31:19');
