INSERT INTO `yien_goods` VALUES ('6333', '113971307681614', '88', '陈翠小店', '村上春树：1973年的弹子球（精装）  [１９７３年のピンボール]', '29', '37', '重庆', '2019-01-16 16:45:02', '十二个月', '2019-02-02 00:12:32', '《挪威的森林》作者村上春树畅销名作，同时著有《世界尽头与冷酷仙境》 《奇鸟行状录》 《海边的卡夫卡》 《天黑以后》等。', '村上春树（1949- ），日本当代作家。京都府人。早稻田大学文学部毕业。主要著作有《挪威的森林》、《寻羊冒险记》、《世界尽头与冷酷仙境》、《舞！舞！舞！》、《奇鸟行状录》、《海边的拉夫卡》、《天黑以后》等。作品真实反映当代日本都市人群的生活、心理，风格洗练，富于想象力，具有很高的艺术价值和深刻的社会批评精神，在世界各地影响广泛，因其笔下人物与我国改革开放后的都市青年群体有着共通之处，故尤其能够得到青年阅读层的喜爱和共鸣。', '', '', 'http://192.168.21.158:8888/group1/M00/00/39/wKgVnlxX6kiASQ-dAABDcxLIxS4116.jpg', 'http://192.168.21.158:8888/group1/M00/00/39/wKgVnlxX6kiAahD9AABDcxLIxS4837.jpg', 'http://192.168.21.158:8888/group1/M00/00/39/wKgVnlxX6kiAHyejAABDcxLIxS4717.jpg', '6', 'selling_now', '2019-01-16 16:45:02', '2019-02-02 00:12:32', '36', '2019-02-04 15:31:22');
