INSERT INTO `yien_goods` VALUES ('6358', '113970321480679', '86', '喻巧小店', '马尔克斯：一个海难幸存者的故事', '31', '35', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:37', '马尔克斯非虚构文学“天才之作”：一人，一船，无食物，无淡水 ，身处茫茫大海，面对无尽时间。“我只是大难不死，却因此成为英雄。”', '《一个海难幸存者的故事》内容简介：一阵风浪把军舰上的八名船员卷入了海中，经过四天搜寻，失踪人员被宣告死亡。然而，一周之后，他们当中的一位奇迹般地出现在一处荒僻的海滩。他在一只随波漂流的筏子上没吃没喝地度过了十天，终于靠岸生还。', '加西亚·马尔克斯对这位海难幸存者进行了为期二十天的采访，同时在报上连载。扣人心弦的报道轰动全国，读者每天都挤在报社门前等待。由于揭露了海难真相，惹怒当局，报社被迫关张，马尔克斯也流亡海外。直到十五年后，这篇故事才集结成书。', '本书被公认为非虚构文学的范本。', 'http://192.168.21.158:8888/group1/M00/00/3A/wKgVnlxX6k2AEGqtAAH9-knHpcc943.jpg', 'http://192.168.21.158:8888/group1/M00/00/3A/wKgVnlxX6k2AINhjAAH9-knHpcc967.jpg', 'http://192.168.21.158:8888/group1/M00/00/3A/wKgVnlxX6k2ALMeyAAH9-knHpcc280.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:37', '25', '2019-02-04 15:31:28');
