INSERT INTO `yien_goods` VALUES ('6380', '113969319734928', '58', '陶云小店', '波斯少年', '31', '39', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:34', '', '　　玛丽·瑞瑙特（Mary Renault，1905—1983），以描写古希腊的历史小说享有世界性的声誉，其作品传神地展现了忒修斯、苏格拉底、柏拉图和亚历山大大帝等名人的生平。', '　　《波斯少年》以第一人称回忆录的动人之笔，续写亚历山大大帝最后的七年。故事叙述者是一位真实的波斯人——亚历山大青春俊美的伴侣巴勾鄂斯。', null, 'http://192.168.21.158:8888/group1/M00/00/3A/wKgVnlxX6lGAR3FdAAC181thqNA190.jpg', 'http://192.168.21.158:8888/group1/M00/00/3B/wKgVnlxX6lGATCn9AAC181thqNA350.jpg', 'http://192.168.21.158:8888/group1/M00/00/3B/wKgVnlxX6lGAMbWPAAC181thqNA645.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:34', '82', '2019-02-04 15:31:32');
INSERT INTO `yien_goods` VALUES ('6381', '113969839506349', '73', '苏枫小店', '村上春树：刺杀骑士团长（套装上下册）  [騎士団長殺し]', '69', '98', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:29', '村上春树时隔七年长篇巨著。一幅藏匿于阁楼的惊世画作，串起二战创伤与现实吊诡。村上春树对“南京大屠杀”等历史事件的描写，提及对他人力量的信任的看法，家庭生活的主题也首次出现在小说中。', '　　', '　　“我”36岁，美术科班出身，原本爱好抽象画，多年来为了养家糊口成为专业肖像画家。结婚六周年纪念日前，妻子毫无征兆地提出已有外遇，要求离婚，于是“我”独自离家开车在外游荡了一个半月，最终应好友雨田政彦之邀，住进小田原郊外山间其父雨田具彦的旧居兼画室，期待通过环境的改变调整心情。　　奇妙的事件就发生在搬家后不到八个月的时间里。雨田政彦帮“我”介绍了山下绘画班任教的工作，“我”和班里的两位人妻先后成了情人，经神秘邻居免色的精心策划和班上的少女真理惠也建立了密切联系。房子主人雨田具彦是著名日本画画家，“我”搬进那栋房子后不久，意外在阁楼发现了一幅雨田具彦不为世人所知的大师级作品，名为“刺杀骑士团长”。　　由此，“我”被卷入一系列不可思议的事件……　　夜半铃声与古庙洞口、神秘邻居免色涉与绘画班女学生秋川真理惠、“骑士团长”与“长面人”、现实世界与隐喻世界……　　村上春树用他擅长的层层剥开的写法，将读者步步引入奇妙之境。　　', '', 'http://192.168.21.158:8888/group1/M00/00/3B/wKgVnlxX6lGAfaLiAAF8xLjkYmw807.jpg', 'http://192.168.21.158:8888/group1/M00/00/3B/wKgVnlxX6lGAIEXUAAF8xLjkYmw527.jpg', 'http://192.168.21.158:8888/group1/M00/00/3B/wKgVnlxX6lGAJzsMAAF8xLjkYmw547.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:29', '52', '2019-02-04 15:31:32');
