INSERT INTO `yien_goods` VALUES ('6394', '113966226671449', '50', '陈友小店', '漫长的告别（怪不得村上春树读了12遍！每每陷入困境，村上春树便打开《漫长的告别》！全新精装插图珍藏版！）（读客经典文库）', '48', '69', '重庆', '2019-01-16 16:44:56', '十二个月', '2019-02-02 00:12:42', '村上曾亲自翻译《漫长的告别》，掀起阅读狂潮！美国文学黄金时代四大杰作之一！全新译本，全新插图，生动还原硬汉派文字精髓，附赠资深书迷手册！人生是一场漫长的告别，说一声再见，就是死去一点点。读客熊猫君出品', '《漫长的告别》是真正意义上的灵魂交流的故事，是人与人之间自发地相互理解的故事，是人类抱有的美好幻想和它不可避免地引发的深深幻灭的故事。——村上春树', '', '一个神秘优雅的迷人酒鬼，一个孤独不羁的硬汉侦探。', 'http://192.168.21.158:8888/group1/M00/00/3B/wKgVnlxX6lOAcH5zAACrLYVMmGw559.jpg', 'http://192.168.21.158:8888/group1/M00/00/3B/wKgVnlxX6lOAGcVSAACpgX_Exc4469.jpg', 'http://192.168.21.158:8888/group1/M00/00/3B/wKgVnlxX6lOAftzTAACrLYVMmGw967.jpg', '6', 'selling_now', '2019-01-16 16:44:56', '2019-02-02 00:12:42', '41', '2019-02-04 15:31:34');
