INSERT INTO `yien_goods` VALUES ('6405', '113969787694845', '79', '严千小店', '作家榜经典文库：伤心咖啡馆之歌（新版，未删节插图珍藏版！愿你被很多人爱，如果没有，愿你在寂寞中学会宽容）  [The Ballad of the Sad Cafe]', '34', '45', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:31', '', '横扫欧美文坛的孤独小说家麦卡勒斯，七篇传奇之作全收录：著名的经典中篇小说《伤心咖啡馆之歌》，描写了三个因为爱而孤独挣扎的灵魂；一鸣惊人的处女作《神童》，写出了梦想与现实的艰难决择；不容错过的《赛马骑师》《旅居者》《家庭困境》《泽伦斯基夫人和芬兰国王》《一棵树· 一块石· 一片云》。每一篇都令人着迷、令人心碎、令人感叹：“孤独是你我的宿命，没有任何人任何事能改变，连爱也不能。”美国国家图书奖得主欧文·豪：“这是美国人曾写作的小说至高经典之一。”每一个渴望爱与被爱的人，都能在故事中看到自己。', '', '', 'http://192.168.21.158:8888/group1/M00/00/3B/wKgVnlxX6laASSZ1AAJSgHeXiiQ391.jpg', 'http://192.168.21.158:8888/group1/M00/00/3B/wKgVnlxX6laAGoPeAAJSgHeXiiQ258.jpg', 'http://192.168.21.158:8888/group1/M00/00/3B/wKgVnlxX6laADICNAAJSgHeXiiQ969.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:31', '47', '2019-02-04 15:31:36');
