INSERT INTO `yien_goods` VALUES ('6417', '113968257367000', '12', '赵巧小店', '曾国藩（全三册）', '67', '98', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:27', '2017全新修订版，唐浩明亲自更正百余处细节，中纪委干部必读书目', '唐浩明，湖南衡阳人，1946年出生，文学硕士、编审，长期致力于近代文献的整理出版与历史小说创作。著有经典长篇历史小说《曾国藩》《杨度》《张之洞》，其中《曾国藩》于1999年被《亚洲周刊》评为20世纪华文小说百强之一，2003年获得首届姚雪垠长篇历史小说奖。另著有《唐浩明评点曾国藩家书》《唐浩明评点曾国藩奏折》等。', '以丰富的史料为基础，以扎实的文学素养来雕琢，终成历史巨著《曾国藩》。唐浩明独辟蹊径，跳出传统习贝探索曾国藩的心路历程。既写他一生的政界传奇，又写其待人处世与生活态度，更写透他行为背后的精神和灵魂，成功塑造了一个在血雨腥风的时代，突破艰难险阻脱颖而出、有着多重人格、集功罪于一身的复杂形象。', null, 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6liAb1A5AAE3LRqnTiQ485.jpg', 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6liAfSMFAAE3LRqnTiQ050.jpg', 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6liADC3SAAE3LRqnTiQ506.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:27', '95', '2019-02-04 15:31:39');
