INSERT INTO `yien_goods` VALUES ('6421', '113969930910651', '14', '闻人小店', '巨人的陨落（通宵小说大师肯·福莱特世纪三部曲，全球读者平均三个通宵读完！以恢宏辽阔、荡气回肠的故事全景展现整个20世纪人类史。）  [Fall of Giants]', '91', '130', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:30', '世界是属于勇敢者的所以世界是属于我的。全球读者平均3个通宵读完的超级巨著。全球每三秒卖出一本！横扫欧美16国排行榜的超级小说。18次登上10国畅销榜！', '　　“福莱特再次创造了一个既熟悉又美妙的世界，以及一种纯粹的阅读乐趣，让你根本放不下这本书。帝国衰落，英雄崛起，真爱无敌。你会忍不住和书里的角色在战火硝烟中同呼吸、共命运，并希望福莱特的下一本大部头赶快砸过来。”——《Time Out纽约》', '　　在第一次世界大战的硝烟中，每一个迈向死亡的生命都在热烈地生长——威尔士的矿工少年、刚失恋的美国法律系大学生、穷困潦倒的俄国兄弟、富有英俊的英格兰伯爵，以及痴情的德国特工……从充满灰尘和危险的煤矿到闪闪发光的皇室宫殿，从代表着权力的走廊到爱恨纠缠的卧室，五个家族迥然不同又纠葛不断的命运逐渐揭晓，波澜壮阔地展现了一个我们自认为了解，但从未如此真切感受过的20世纪。', '　　', 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6lmAOo5gAAJkgdpKu7E768.jpg', 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6lmAQ0VHAAJkgdpKu7E091.jpg', 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6lmAUDy7AAJkgdpKu7E770.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:30', '13', '2019-02-04 15:31:40');
