INSERT INTO `yien_goods` VALUES ('6426', '113968170075421', '90', '奚忆小店', '三国机密：全 2 册', '55', '80', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:39', '晒单得好礼，文字鬼才马伯庸实力代表作，新增序言全新修订版。一个永远无法公开的故事，一场诡谲迭起的三国暗战。在真实历史的缝隙间闪转，历数三国诸子风起云涌的激烈暗战', '一个永远无法公开的故事，一场诡谲迭起的三国暗战   龙难日  东汉末年，灵帝宠妃王美人诞下双生子，因遭何皇后迫害，对外称只生一子刘协，另一儿子刘平则被人偷偷带出。十八年后，一批效忠汉室的志士谨遵献帝临终前嘱托，从温县司马防家秘密迎立献帝的同胞弟弟刘平入宫，命运的齿轮开始运转。   潜龙在渊  建安五年，官渡之战拉开序幕。献帝深入官渡战地，曹丕鼎力相随，多次绝处逢生。曹袁两军战况胶着不断，却不知背后操纵者竟是沉迷酒色的郭嘉和隐居东山的蜚先生，只因多年前一场爱恨情仇让二人结下积怨。究竟谁才是终结这场战争的真正王者？', '这个世界上，大概分成了两种人。  一种人的命运，是去坚守某样东西；  另外一种人的命运，却是去改变它。  一个永远无法公开的故事，一场诡谲迭起的三国暗战   ☆文字鬼才 马伯庸 实力代表作  ☆全新修订版，新增作者序言  ☆权术、阴谋、诡诈、密计，乱世群雄谁主沉浮  ☆在真实历史的缝隙间闪转，历数三国诸子风起云涌的激烈暗战', null, 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6luAcnJiAAE_m3xkpNA855.jpg', 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6luAVnCbAAE_m3xkpNA415.jpg', 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6luASqwbAAE_m3xkpNA851.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:39', '61', '2019-02-04 15:31:41');
