INSERT INTO `yien_goods` VALUES ('6428', '113969113226809', '20', '施凌小店', '大金王朝·卷一：北方的王者', '38', '48', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:34', '茅盾文学奖获得者熊召政继《张居正》之后，历经十年古战场考察和史学资料研磨，再写扛鼎之作，以古鉴今，讲述中国中世纪时期辽、宋、金三国错综复杂的政权更替与外交策略，堪称一部“大三国演义”。', '　　熊召政，湖北省英山县人，1953年12月出生。诗人，作家，学者。', '　　茅盾文学奖获得者熊召政继《张居正》之后，历经十年古战场考察和史学资料研磨，再写扛鼎之作，以古鉴今，讲述中国中世纪时期辽、宋、金三国错综复杂的政权更替与外交策略，堪称一部“大三国演义”。', null, 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6luAX7B-AACCiADMUGE582.jpg', 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6luAK8OlAACCiADMUGE549.jpg', 'http://192.168.21.158:8888/group1/M00/00/3C/wKgVnlxX6luALdvmAACCiADMUGE096.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:34', '71', '2019-02-04 15:31:42');
