INSERT INTO `yien_goods` VALUES ('6456', '113970128719184', '5', '诸葛小店', '村上春树：1Q84 BOOK 1-3 套装2018版', '131', '149', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:29', '', '《1Q84（套装全3册）》是村上春树长篇小说代表作，包括《1Q84》系列第一部、第二部、第三部，并赠精美套盒。', '东京，年轻女子青豆乔装打扮，杀死一个个滥施家庭暴力的男人；而天吾一面当数学教师，一面写小说。两个本来绝无可能相会的人，因为一部神秘小说《空气蛹》，开始进入1Q84年，被卷入各种神秘莫测的事件。', '《1Q84》系列以一对年轻男女互相寻觅对方的故事为引，构筑出情节复杂、波澜壮阔的长篇。村上春树想将这个时代的世态立体地写出，成为独有的“综合小说”，纯文学的类型，在当今时代的空气中嵌入人类的生命。', 'http://192.168.21.158:8888/group1/M00/00/3D/wKgVnlxX6mCAZRlyAAG4eTIOIc8523.jpg', 'http://192.168.21.158:8888/group1/M00/00/3D/wKgVnlxX6mCAO4cAAAG4eTIOIc8389.jpg', 'http://192.168.21.158:8888/group1/M00/00/3D/wKgVnlxX6mCAdMdtAAG4eTIOIc8138.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:29', '12', '2019-02-04 15:31:47');
