INSERT INTO `yien_goods` VALUES ('6460', '113968681211487', '55', '许书小店', '张居正/长篇历史小说经典书系（套装全4册）', '89', '128', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:32', '', '　　明代政治家只有一张居正。　　——梁启超　　张居正的不在人间，使我们这个庞大的帝国失去重心，步伐不稳，终失足而坠入深渊。　　——黄仁宇　　我读小说，尤其是故事性强的中国古典传统体裁的小说，常常是迫不及待地先睹为快，熊召政先生的《张居正》就是其中之一。　　——金庸', '　　熊召政，湖北省英山县人，中国当代著名作家、诗人、学者。现系第十二届全国人大代表、中华文化促进会常务副主席、中国文联全委会委员、湖北省文联主席、湖北省人民政府文史研究馆馆长，并兼任中国人民大学、武汉大学、中南财经政法大学等多所大学客座教授，同时受聘担任北京故宫博物院、武汉大学传统文化研究中心研究员。　　已出版长篇历史小说、中短篇小说、散文、历史札记、诗集四十余部。其中政治抒情诗获1979—1980年全国首届中青年优秀新诗奖；长篇历史小说《张居正》2002年问世后，被誉为中国新时期长篇小说的里程碑式作品，2005年以全票获得第六届茅盾文学奖名。目前，历时十二年精心创作的三卷本长篇历史小说《大金王朝》已完成卷《北方的王者》及第二卷《擒龙的骑士》，第三卷《帝国的坍塌》将于明年完成。除文学创作外，其演讲录已结集出版《历史的乡愁》《文人的情怀》两册。', null, 'http://192.168.21.158:8888/group1/M00/00/3D/wKgVnlxX6mGAJd4YAAH71SW3w8I065.jpg', 'http://192.168.21.158:8888/group1/M00/00/3D/wKgVnlxX6mGAD4fYAAH71SW3w8I495.jpg', 'http://192.168.21.158:8888/group1/M00/00/3D/wKgVnlxX6mGAT8K0AAH71SW3w8I154.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:32', '21', '2019-02-04 15:31:48');
