INSERT INTO `yien_goods` VALUES ('6485', '962173162565618', '13', '施冬小店', '【新款上市】黑科技电子产品 创意电子产品办公学习居家神器创意实用生活百货工作用品 ELFINBOOKB5英文版', '288', '310', '成都', '2019-01-23 22:26:25', '九个月', '2019-02-02 00:12:59', '商品名称：【新款上市】黑科技电子产品 创意电子产品办公学习居家神器创意实用生活百货工作用品 ELFINBOOKB5英文版null', '', null, null, 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mWAbL17AABtG1R32Qs336.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mWASrLzAAFNUJqERX8680.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mWABOtnAADRzGo9M5A273.jpg', '8', 'selling_now', '2019-01-23 22:26:25', '2019-02-02 00:12:59', '28', '2019-02-04 15:31:52');
INSERT INTO `yien_goods` VALUES ('6486', '113969447228426', '46', '戚半小店', '汴京残梦', '27', '38', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:41', '黄仁宇先生颇具想象力的历史小说。“大历史观”下的“另类”之作，比画卷更生动鲜明的小说版《清明上河图》，一幅北宋末年世间百态的浮世绘。封面设计折叠式大海报《千里江山图》和《清明上河图》，值得收藏。', '黄仁宇（1918—2000），知名度超高的华人历史学家之一。生于湖南长沙，1936年就读于天津南开大学电机工程系。曾于抗日战争时期辍学并加入国民党军队，1950年退伍后赴美求学于密歇根大学新闻系，后转入历史系，并于1964年获博士学位。曾任哥伦比亚大学访问副教授及哈佛大学东亚研究所研究员。1979年离开教学岗位，专心写作，著有《万历十五年》《中国大历史》《资本主义与二十一世纪》《现代中国的历程》《黄河青山》等畅销书。', '小说是以宋徽宗年间及靖难之役前后的历史为背景，以杭州府学子徐承茵、陆澹园和李功敏三人的仕途为线索，以徐承茵和柔福公主的爱情为铺垫。史学大师黄仁宇用考据的态度，细腻的笔法，在史料的基础上进行了合理的想象，通过《清明上河图》的创作、内容及命运，展示了宋代文化的繁荣与政治的衰落。', null, 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mWACC0GAAFFOe2BhDM072.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mWAZZzuAAFFOe2BhDM741.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mWAKNKMAAFFOe2BhDM179.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:41', '67', '2019-02-04 15:31:52');
