INSERT INTO `yien_goods` VALUES ('6498', '113970335113734', '67', '尉迟小店', '人性的枷锁(2018年新版，毛姆故居收藏版本）', '43', '68', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:28', '20世纪风靡全球的“天才著作”，马尔克斯、村上春树、莫言、乔治·奥威尔、张爱玲、奈保尔一致推崇，100多年来不断翻印，引起全世界无数读者的共鸣', '《人性的枷锁》是毛姆的代表作，具有明显的自传色彩。 　  小说主人公菲利普·凯里自幼父母双亡，不幸又先天残疾，在冷漠而陌生的环境中度过了童年，性格因此孤僻而敏感。在寄宿学校度过的岁月让他饱受了不合理的学校制度的摧残，而当他走入社会后，又在爱情上经历了伤痛。在坎坷的人生道路上，他每跨一步，都要付出艰辛的挣扎，但思想和个性都独立不羁的凯里，一直努力挣脱宗教和小市民意识这两条禁锢自己精神的桎梏，力图在混沌纷扰的生活漩流中，寻求人生的真谛。 　　这本小说里我阅尽了一个人的一生，没有谁能够把人心深处的荒芜和趋离描绘的如此贴切，我在毛姆的笔下看到了自己，看到了人生存在这个世界的惶恐与追寻。读书的过程中经历一次次的移情，无论是面对米尔德丽德绝望的爱恋，穷困潦倒时的落魄，或者是在经受许久的挣扎后终于开悟的刹那，都在人心里惊起阵阵波澜，在空旷的心里回响不息。毛姆是我经历的作家中富有灵性的人，他对于人生一切的怀疑与思考都使得他更超脱于世人，正是他灵魂中的火焰才令他的文字能够点燃每一个干涸的心灵。但他却对世人充满了柔情，觉察如他不可能不懂得所谓人生的命运，他却只是把那命运一笔带过，还依然把美好的结局留给每一个可以从黑暗中拯救出来的人物：他把希望留给了世人，无论这希望在生活中或然率大小如何。我看到毛姆他温情的坐在世人身旁，温柔笑着。 　　在他看来，他以前的所有人生都在追随着其他人通过言语或者文字灌输给他的想法，他从来就没有过自己心底的渴望。他的轨迹永远都是被他认为应该做的事情所动摇，而不是被他的整颗心想要做的事情所动摇。他现在不耐烦的把这些所有的一切都抛弃了……屈服于幸福也许就是承认失败，但是这种失败却比千百次的成功都要更好啊……', '', '', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6meAYhcoAAEYKHxdHOo608.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6meAK2u6AAEYKHxdHOo840.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6meAOHDhAAEYKHxdHOo236.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:28', '10', '2019-02-04 15:31:54');
INSERT INTO `yien_goods` VALUES ('6499', '113970446643199', '48', '葛蓝小店', '余华：在细雨中呼喊', '35', '40', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:37', '央视《朗读者》推荐，余华首部长篇小说，2018新版精装典藏。', '《在细雨中呼喊》是余华的首部长篇小说，讲述了一个家庭的欢乐和苦痛，细腻地刻画了柔弱的母亲如何完成了自己忍受的一生，粗暴的父亲如何骄傲地将自己培养成一名彻头彻尾的无赖。家中的三兄弟的道路只是短暂地有过重叠，随即就又叉向了各自的方向。无赖的父亲、沉默的母亲、平庸的哥哥、对往事沾沾自喜的祖父……每个不起眼的小人物，都卖力于自己的人生表演。爱的严重缺席、伦理的崩落、道德的沉沦、青春期的性启蒙……余华以一个孩子的目光，凝视着生活周遭的一切。', '', '', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6miAI40DAAFwHzVB_ng821.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6miAZLT_AAFwHzVB_ng962.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6miAfA4FAAFwHzVB_ng933.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:37', '99', '2019-02-04 15:31:54');
