INSERT INTO `yien_goods` VALUES ('6502', '113968603682584', '26', '金雪小店', '大秦帝国（缩写本 卷上、卷中、卷下 精装)', '126', '168', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:44', '', '孙皓晖，1949年出生于陕西省三原县，是共和国的同龄人，毕业于陕西师范大学，有与同时代人相同的基本经历与阶段归宿。曾任西北大学法律系教授，是获国务院首批特殊津贴的专家。1993—1997年，基于对中国原生文明的思考，完成136集《大秦帝国》文学剧本的创作，同期开始《大秦帝国》的案头准备。1998年后，辞职专事写作长篇历史小说《大秦帝国》，其中一部《黑色裂变》入选中宣部第十届“五个一”工程奖。', '大秦帝国（缩写本）（卷上、卷中、卷下）(精装)艺术地再现了大秦帝国时代，是从前十一卷本的浓缩，删去了不具有继承意义的历史元素，保留了主线故事情节。', null, 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6miAbu5HAACDWA_ODSQ987.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6miAAkGCAACDWA_ODSQ910.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6miAJXkSAACDWA_ODSQ886.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:44', '2', '2019-02-04 15:31:55');
