INSERT INTO `yien_goods` VALUES ('6505', '113968667620944', '5', '诸葛小店', '大秦帝国·黑色裂变', '96', '128', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:28', '战国时代的百科全书 畅销不衰的历史小说 感受大争之世的热血激荡，品读原生文明时期的生存智慧； 热播电视剧《大秦帝国之裂变》原著； 南怀瑾、二月河等激赏推荐；', '孙皓晖：', '　公元前362年，少粱之战后，秦献公中毒箭身亡。21岁的秦孝公嬴渠梁临危受命，继任国君。其时六国鄙秦，图谋分之。秦孝公血书国耻石并向列国求贤。青年士子卫鞅入秦，以法家强国之论说服了秦孝公。徙木立信、刑及公室，秦国变法震惊天下。政侠墨家欲诛暴君强臣，秦孝公亲临神农大山辩说国政。列国混战，强邻魏国骤然衰弱，秦国趁势收复河西。卫鞅受封商君。秦孝公积劳成疾而逝，老世族趁机反击，商鞅选择极心护法……', null, 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mqAKDtPAABs11st6iY679.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mqASxB7AABs11st6iY410.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mqAQG_uAABs11st6iY135.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:28', '73', '2019-02-04 15:31:56');
