INSERT INTO `yien_goods` VALUES ('6508', '113970433052035', '85', '华菡小店', '纸牌的秘密（新版）', '26', '34', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:28', '《苏菲的世界》的姐妹篇，也是一个少年的哲学解谜之旅', '《纸牌的秘密》为《苏菲的世界》的姐妹作，也是一个少年的哲学解谜之旅。', '少年汉斯与父亲从挪威出发，前往希腊寻找为追寻自我离家出走的母亲。途中，汉斯得到一把放大镜与一本神秘的小圆面包书，书中讲述一个水手遭遇沉船流落到奇异岛后，他每天把玩的一副纸牌幻化成鲜活的人物的故事。汉斯的欧洲之行变成了解谜之旅：重新洗过的纸牌带来怎样的启示？小丑牌是永生之牌吗？两百年前的沉船之谜与母亲失踪之谜又有怎样的关联……', '《纸牌的秘密》全书分成52章，结构有如一副纸牌，故事中套故事，融童话与家族史于一炉。这是一本激励读者对人生的本质、自我与家族、真实与虚幻进行探讨与想象的哲学普及佳作。', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mqARKlvAACdG__Cj4A742.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mqAAh--AACdG__Cj4A765.jpg', 'http://192.168.21.158:8888/group1/M00/00/3E/wKgVnlxX6mqAGJ8PAACdG__Cj4A816.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:28', '99', '2019-02-04 15:31:57');
