INSERT INTO `yien_goods` VALUES ('6522', '113971256008815', '29', '潘亦小店', '人世间（套装共3册）', '168', '238', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:29', '（两种封面随机发货））立足底层，直指人心，于人间烟火处彰显道义和担当，在悲欢离合中抒写情怀和热望，堪称一部“五十年中国百姓生活史”', '《人世间》（三卷本）是著名作家梁晓声的*新长篇小说。全书一百一十五万字，历经数年创作完成。作品以北方省会城市一位周姓平民子弟的生活轨迹为线索，从二十世纪七十年代写到改革开放后的今天，多角度、多方位、多层次地描写了中国社会的巨大变迁和百姓生活的跌宕起伏，艺术而雄辩地展现了平民百姓向往美好生活的人生努力和社会发展的历史进步，堪称一部“五十年中国百姓生活史”。', '作者感同身受，满怀深情，立足底层，直指人心，于人间烟火处彰显道义和担当，在悲欢离合中抒写情怀和热望。作品有筋骨、有道德、有温度，是近年来不可多得的一部长篇小说佳作，更是梁晓声长篇小说创作的一个新的高峰。', '小说系中国作家协会2017年度重点作品扶持选题，也是“十三五”国家重点出版物出版规划项目图书。', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6myATS3BAABMbkmE8xc969.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6myAT-jnAABMbkmE8xc833.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6myAd0GOAABMbkmE8xc011.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:29', '67', '2019-02-04 15:31:59');
