INSERT INTO `yien_goods` VALUES ('6526', '113967235061045', '61', '何亦小店', '东野圭吾：恶意（2016版）', '30', '40', '重庆', '2019-01-16 16:44:57', '十二个月', '2019-02-02 00:12:29', '', '《恶意》深刻揭示人性，故事中无边的恶意深不见底，有如万丈深渊，让人不寒而栗。读完《恶意》，才算真正认识东野圭吾。《纽约时报》称“《恶意》再次展现了东野圭吾对小说的掌控，比起黄金周期间东京的高速公路，《恶意》有更多的纠结、变道和反转。”知名学者止庵认为“《恶意》作为一部推理小说，极尽曲折复杂周密；同时又深刻揭示了人性，达到很多纯文学作品未能达到的深度”。', '', '畅销作家在出国前一晚被杀，警方很快锁定了凶手。此人供认自己是一时冲动犯下了罪行。案子到此已经可以了结。可办案的加贺警官并不这么认为，因为他找不到凶手作案的动机，凶手也一直对动机避而不谈。加贺不愿草草结案，大量走访。渐渐显露的真相让他感到冰冷的寒意——', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6m2ACmqqAACo5A5NP_Q353.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6m2AVUiWAAGh4UKNcs8154.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6m2ATXUSAACo5A5NP_Q073.jpg', '6', 'selling_now', '2019-01-16 16:44:57', '2019-02-02 00:12:29', '63', '2019-02-04 15:32:00');
