INSERT INTO `yien_goods` VALUES ('6530', '113971128426261', '82', '孔莲小店', '步履不停  [歩いても 歩いても]', '27', '37', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:37', '电影大师是枝裕和亲撰，经典代表作原著小说，拿遍各大国际影展重要大奖。“你在25岁，你可以成为任何你想成为的人。”', '本书是是枝裕和经典代表作《步履不停》的原著小说。', '人生路上，步履不停，总有那么一点来不及。已经是夏末的季节了，院子里的紫薇花开得璀璨，黄斑蝶在山坡上翩然飞舞着。横山良多与妻儿一同返回位于湘南海边的老家。久违的横山一家人，每年只有在大哥纯平的忌日才会团聚。在沁凉的麦茶、红透的西瓜、母亲绝手的好料理炸玉米天妇罗，加上外卖的寿司和鳗鱼饭之间，闲散地度过看似平凡的一天。然而他们细细分享品尝着的，却是欢笑背后隐隐的哀伤，小心翼翼的对话又忍不住的争执中，不经意触动的回忆以及深藏在彼此心中不曾说出口的秘密……', '', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6m6ASeISAACd_e8wRcM654.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6m6AG4IWAACd_e8wRcM950.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6m6AdZj7AACd_e8wRcM556.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:37', '31', '2019-02-04 15:32:01');
