INSERT INTO `yien_goods` VALUES ('6543', '113971346928738', '16', '冯念小店', '阿甘正传（中英双语版）', '36', '50', '重庆', '2019-01-16 16:45:02', '十二个月', '2019-02-02 00:12:25', '', '像阿甘，一路向前 / 人生的每一刻，都是新的起跑线 / 纵使风雨来袭，依然纯真坚定 / 奔跑，朝着自在而丰盈的终点。', '本书是经典电影《阿甘正传》的小说原著，该电影曾荣获1995年奥斯卡金像奖*佳影片、*佳导演、*佳男主角、*佳视觉效果、*佳剪辑、*佳改编剧本六项大奖，及*佳男配角、*佳摄影等七项提名；金球奖*佳导演、*佳男主角；英国电影学院奖*佳影片提名等上百项电影界大奖，成为一代又一代人心目中的经典。', '阿甘是常人眼中的弱智和白痴，但他善良单纯的天性，加上天赋异禀，使他先后成为大学美式橄榄球明星、越战英雄、世界级乒乓球运动员、摔跤选手、国际象棋大师和商业大亨，既获得肯尼迪总统的接见，又获得约翰逊总统的授勋，甚至还无意间发现了水门事件的真相。阿甘“轰轰烈烈”的传奇一生，看似荒诞不经，其实正是20世纪50年代到70年代美国历史与社会的缩影。透过阿甘的眼睛，我们看到了世态的险恶复杂与庸俗市侩，从而更觉人性真诚的可贵。', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6nGAet2XAAEe4r9OwkA138.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6nGACtnLAAEe4r9OwkA505.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6nGAQX8SAAEe4r9OwkA979.jpg', '6', 'selling_now', '2019-01-16 16:45:02', '2019-02-02 00:12:25', '87', '2019-02-04 15:32:03');
INSERT INTO `yien_goods` VALUES ('6544', '962168800311795', '61', '何亦小店', '创意厨房用品用具用具小百货调味瓶罐小工具六件套调味盒', '30', '52', '成都', '2019-01-23 22:26:20', '九个月', '2019-02-02 00:12:53', '商品名称： 创意厨房用品用具用具小百货调味瓶罐小工具六件套调味盒null', '', null, null, 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6nGAJgxPAADPQ8Hvid0185.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6nGAVl71AADDey64xWY164.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6nGAc7joAADAb0f6Z-4870.jpg', '8', 'selling_now', '2019-01-23 22:26:20', '2019-02-02 00:12:53', '84', '2019-02-04 15:32:03');
INSERT INTO `yien_goods` VALUES ('6545', '113971436653073', '27', '谢槐小店', '遮蔽的天空（蒙尘70年的世纪文学经典，兰登书屋、《时代周刊》百大英语小说）', '33', '49', '重庆', '2019-01-16 16:45:02', '十二个月', '2019-02-02 00:12:28', '', '　　《遮蔽的天空》是蒙尘70年，再次爆火的20世纪美国文学经典，讲述了我们一生中会遇到的绝大多数问题：爱情、婚姻、旅行、死亡、存在价值、人生意义。意识到人生虚无的人，比任何人都更渴望真实地活着。　　二战结束后，三个美国知识分子前往非洲撒哈拉旅行。波特和姬特结婚12年后彼此疏远，渴望通过这次旅行来恢复感情。然而他们在空旷浩渺的沙漠中，逐渐迷失了自己，两人更加疏远。在死亡降临时，他们才真正面对彼此，发现每个人的生命都极其有限，但为时已晚，过于触碰虚无的他们注定要在沙漠里永远流浪下去……　　“因为我们不知道死亡何时降临，我们才会以为生命是一口永不干涸的井。然而每件事情都只会发生一个特定的次数，一个很少的次数，真的。你还会想起多少次童年的那个特定的下午，那个已经深深成为你生命一部分、没有它你便无法想象自己人生的下午？也许还有四五次。也许更少。你还会看到多少次满月升起？也许二十次。然而我们却总觉得这些都是无穷的。”——摘自本书', '', '', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6nGAH06IAAGc-SW7ZjY431.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6nGAd6gRAAGc-SW7ZjY134.jpg', 'http://192.168.21.158:8888/group1/M00/00/3F/wKgVnlxX6nGAS9X0AAGc-SW7ZjY527.jpg', '6', 'selling_now', '2019-01-16 16:45:02', '2019-02-02 00:12:28', '7', '2019-02-04 15:32:03');
