INSERT INTO `yien_goods` VALUES ('6555', '113970639455583', '67', '尉迟小店', '诺贝尔经典文学：鼠疫·局外人', '25', '40', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:34', '那些值得热爱一辈子的诺贝尔文学奖经典作品 我们不能选择怎么生，怎么死，但我们能决定怎么爱，怎么活。', '本书收录了文学大师加缪著名的两本小说《鼠疫》和《局外人》。', '《鼠疫》是加缪重要的代表作之一，描写了北非一个叫奥兰的城市在突发鼠疫后，以主人公里厄医生为代表的一大批人面对瘟疫奋力抗争的故事。', '《局外人》是加缪的成名作，堪称20世纪西方文学界具划时代意义的小说之一，“局外人”也由此成为整个西方文学（哲学）中经典的人物形象之一。', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6nOAa0GNAAFds_-pcZA578.jpg', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6nOAWQQmAAFds_-pcZA453.jpg', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6nOABlxdAAFds_-pcZA454.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:34', '70', '2019-02-04 15:32:05');
