INSERT INTO `yien_goods` VALUES ('6564', '113971359159234', '32', '云靖小店', '山本（贾平凹2018年新作）', '44', '59', '重庆', '2019-01-16 16:45:02', '十二个月', '2019-02-02 00:12:39', '一个发生在乱世时期的互为知己般的绝美爱情； 一部写尽人间纠结苦痛和欲望，瞻远未来的现代启示录； 《山本》，当代中国集叛逆性、创造精神和广泛影响力于一身的作家——贾平凹的全新旷世奇书！', '《山本》是贾平凹全新长篇小说。小说精彩绝伦，是贾平凹的全新之作，结构行云流水，叙述潺潺流淌，文字通透爽朗，而且故事推进大刀阔斧，有一股所向披靡，特别洒脱的气势，并且还有现代启示录的意味。小说结构的力量源于螺旋上升，而非假性圆环，作家的才华长驱直入，攻城略地，作家一会儿是参与者，一会儿又是观望者，《山本》是一部写尽人间纠结苦痛和欲望，也抽离出了人世间的清醒和瞻远未来的大作，这是一部充盈着历史节奏和现实表现力的大书，在磅礡的时代中发现了人生精密的轨迹并兼顾记录了时代寿命和芸芸众生的肖像谱。这一部发生在战争时期一个绝美的爱情故事。', '', '', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6nWAeQiNAABXH6itstU201.jpg', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6nWAMjUxAABXH6itstU253.jpg', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6nWASxHhAABXH6itstU980.jpg', '6', 'selling_now', '2019-01-16 16:45:02', '2019-02-02 00:12:39', '86', '2019-02-04 15:32:07');
