INSERT INTO `yien_goods` VALUES ('6582', '113971192245154', '56', '戚静小店', '鱼王', '52', '78', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:29', '王小波推崇的俄罗斯文学遗珠，国内一次正版完整引进。', '', '维克托·彼得洛维奇·阿斯塔菲耶夫（Виктор Петрович Астафьев，1924—2001），苏俄著名小说家、散文家，20世纪下半叶俄罗斯文学代表人物之一。生于西伯利亚克拉斯诺亚尔斯克一个农民家庭，作品多取材于自身经历，被认为继承了屠格涅夫、普里什文和巴乌斯托夫斯基的自然文学传统，并创造出将小说、道德思辨和抒情散文熔于一炉的独特风格。阿斯塔菲耶夫善于描写自然生活，洞察人与大自然的关系，开掘人的心灵，返照时代的剪影。正如评论家马卡洛夫所说：“阿斯塔菲耶夫的作品是关于我们生活的沉思，是关于人在大地上和社会上的使命以及人的道德标准的沉思，是关于俄罗斯民族性格的沉思。”代表作有《鱼王》《树号》《牧童和牧女》《最后一次鞠躬》等。', '', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6neAExWAAAEBihUUJSM691.jpg', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6neAB7j5AAEBihUUJSM411.jpg', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6neACjMQAAEBihUUJSM897.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:29', '49', '2019-02-04 15:32:10');
INSERT INTO `yien_goods` VALUES ('6583', '4403041662464', '22', '王觅小店', '洁柔(C&S)抽纸 黑Face 加厚4层100抽面巾纸*6包 无香(L号软抽 面子系列可湿水替代毛巾)干湿两用', '25', '45', '东莞', '2019-01-21 10:01:59', '六个月', '2019-02-02 00:12:35', '1月23日大牌聚惠—国民年货，八大品牌推出年终大戏，让你get吉祥猪年，抢99减88神券商品名称：洁柔抽纸', '', null, null, 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6niAJ3S2AAFi6enyiV4457.jpg', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6niAPgn5AABCvBCvHNA703.jpg', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6niAV9oKAAGFoIvF6-w478.jpg', '7', 'selling_now', '2019-01-21 10:01:59', '2019-02-02 00:12:35', '49', '2019-02-04 15:32:10');
INSERT INTO `yien_goods` VALUES ('6584', '113970257714537', '95', '上官小店', '摆渡人（精装插图纪念版）', '36', '58', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:26', '百万册畅销插图纪念版，收录中文版自序+精美插图。荣获多项图书大奖，畅销欧美33个国家。如果命运是一条孤独的河流，谁会是你灵魂的摆渡人？如果我真的存在，也是因为你需要我。随书赠精美卡册。白马时光', '　　单亲女孩迪伦，15岁的世界一片狼藉：与母亲总是无话可说，在学校里经常受到同学的捉弄，谈得来的好友也因为转学离开了。这一切都让迪伦感到无比痛苦。　　她决定去看望久未谋面的父亲，然而，路上突发交通事故。等她拼命爬出火车残骸之后，却惊恐地发现，自己是wei一的幸存者，而眼前，竟是一片荒原。　　此时，迪伦看到不远处的山坡上一个男孩的身影。　　男孩将她带离了事故现场。但是，迪伦很快意识到，男孩并不是偶然出现的路人，他似乎是特意在此等候。　　命运，从他们相遇的那刻开始，发生了无法预料的转变……　　这是一个史诗般的动人故事，它令人激奋、恐惧、温暖，回归人性，引人深思。', '', '', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6niAXLGTAADU4V_HK6I076.jpg', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6niAedBVAADU4V_HK6I119.jpg', 'http://192.168.21.158:8888/group1/M00/00/40/wKgVnlxX6niAavuKAADU4V_HK6I327.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:26', '49', '2019-02-04 15:32:10');
