INSERT INTO `yien_goods` VALUES ('6599', '113967507784199', '77', '章蓝小店', '玛丽.罗素与大侦探福尔摩斯:蜂房之神', '29', '40', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:43', '英国几大情报机构的对立与争夺，迄今无人逾越的福尔摩斯新故事。 美国版阿加莎•克里斯蒂首度引进中国。', '劳拉.金（Laurie R. King），', '出生于1952年，美国著名推理小说家，著作数十部，部部登上畅销书排行榜，其中“玛丽.罗素与大侦探福尔摩斯”系列令其声名远播。', '迄今她已获得或提名了几乎全部推理界的奖项，堪称阿加莎.克里斯蒂之后的女性推理小说家*一人。这些奖项包括美国侦探作家协会颁发的全世界侦探小说*权*奖项埃德加.爱伦.坡奖，美国国家悬疑作品协会颁发的美国*著名推理小说奖项阿加莎奖，英国*重要的文学奖项之一橘子奖，以及尼禄.沃尔夫奖、克利西奖、麦克维蒂奖、巴利奖等等。', 'http://192.168.21.158:8888/group1/M00/00/41/wKgVnlxX6nuATIpHAADfEAggifs699.jpg', 'http://192.168.21.158:8888/group1/M00/00/41/wKgVnlxX6nuAEESoAABZOAVIczg261.jpg', 'http://192.168.21.158:8888/group1/M00/00/41/wKgVnlxX6nuABbw3AADfEAggifs751.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:43', '97', '2019-02-04 15:32:13');
