INSERT INTO `yien_goods` VALUES ('6601', '113970060318703', '39', '赵凌小店', '奇迹唱片行(《一个人的朝圣》作者蕾秋·乔伊斯沉淀三年重磅新作！)（京东专供签章版）  [THE MUSIC SHOP]', '34', '48', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:43', '全球热销500万册，感动38国的口碑书！随书附赠作者特别写给中国读者的一封信，以及一份《奇迹乐单》，专治你的各种烦恼忧愁！“上一次被感动，还是在17岁，如今我65岁了，这本书又一次让我泪流满面。”', '蕾秋?乔伊斯（Rachel Joyce），1962年出生于伦敦。英国畅销书作家、BBC资深剧作家。作为剧作家，于2007年获 Tinniswood  zui jia广播剧奖。20年的舞台剧和电视职业生涯之后，乔伊斯转向写作，2012年出版小说《一个人的朝圣》，入围当年布克文学奖及英联邦书奖，目前已畅销近四十个国家，全球销量近500万册。乔伊斯也凭此书获得当年英国图书奖“年度作家”，并在2014年入围“英国年度作家”短名单。之后，乔伊斯相继出版《时间停止的那一天》（2013），“一个人的朝圣”系列之《一个人的朝圣2：奎妮的情歌》（2014）。《奇迹唱片行》（2017）是蕾秋·乔伊斯沉淀三年的全新力作。', '', '', 'http://192.168.21.158:8888/group1/M00/00/41/wKgVnlxX6nuAfOFDAAGsiiLRLdw358.jpg', 'http://192.168.21.158:8888/group1/M00/00/41/wKgVnlxX6nuAZlf6AAGsiiLRLdw200.jpg', 'http://192.168.21.158:8888/group1/M00/00/41/wKgVnlxX6nuASMsJAAGsiiLRLdw979.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:43', '59', '2019-02-04 15:32:14');
