INSERT INTO `yien_goods` VALUES ('6626', '113969190667586', '58', '陶云小店', '大金王朝·卷二：降龙的骑士', '33', '48', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:36', '', '　　熊召政，湖北省英山县人，1953年12月出生。诗人，作家，学者。', '　　茅盾文学奖获得者熊召政继《张居正》之后，历经十年古战场考察和史学资料研磨，再写扛鼎之作，以古鉴今，讲述中国中世纪时期辽、宋、金三国错综复杂的政权更替与外交策略，堪称一部“大三国演义”。', null, 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oCAOrqCAACLAnRAd3c143.jpg', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oCAZheSAACLAnRAd3c729.jpg', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oCAZn-VAACLAnRAd3c852.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:36', '81', '2019-02-04 15:32:19');
INSERT INTO `yien_goods` VALUES ('6627', '113968458138593', '58', '陶云小店', '大秦帝国（精装大字版）', '1620', '2880', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:34', '战国版大国崛起、畅销不衰的经典之作，25年前珍贵手稿首度披露、限量发售2000套，作者签章的收藏证，金属虎符，可收藏亦可把玩，布面礼盒，高端典雅', '在礼崩乐坏、群雄逐鹿的战国末年，面临亡国之祸的秦国于列强环伺之下，崛起于铁血竞争的群雄列强之林。从秦孝公开始，筚路蓝缕、彻底变革、崇尚法制、统一政令，历一百六十余年六代领袖坚定不移地努力追求，才完成了一场伟大的帝国革命，扫六合而一统天下，建立起一个强大统一的帝国。', '', null, 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oCAN14-AAByB3sQMU0755.jpg', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oCAGxvMAAByB3sQMU0149.jpg', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oCAJzl2AAByB3sQMU0978.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:34', '27', '2019-02-04 15:32:19');
