INSERT INTO `yien_goods` VALUES ('6630', '113969851586659', '3', '陈芙小店', '圣殿春秋（全3册）(通宵小说大师肯•福莱特中世纪三部曲，欧美读者平均3个通宵读完！）', '136', '188', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:42', '', '　　十二世纪英国。一个贫困的建筑匠，一心只想建造一座美丽的大教堂。', '　　几经波折，他终于遇到了一个机会。但一座大教堂的建造过程是各方势力的角力：教会、贵族、王室、“巫女”……教堂的建造屡遭干涉。每一种声音都有可能成就他，也有可能毁灭他。', '　　在那个风云诡谲的时代，一个普通建筑匠的信念能否改变世界……', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oGAWNz5AADcLaMeAf8321.jpg', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oGAZqwAAADcLaMeAf8455.jpg', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oGAUtqaAADcLaMeAf8450.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:42', '13', '2019-02-04 15:32:19');
