INSERT INTO `yien_goods` VALUES ('6633', '113968319093227', '5', '诸葛小店', '大清相国（典藏版）', '32', '45', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:37', '“强素质·做表率”读书活动推荐图书。全国热销，同名话剧热映中！', '　《大清相国（典藏版）》塑造了以陈廷敬为主要代表的大臣群相，反映了一个特定历史境遇中官场人物的人格、道德和行为的艰难选择，再现出三百多年前的官场风云。　　小说着重刻画了清代名相陈廷敬曾这个历史人物，陈廷敬原名陈敬，二十一岁中进士，因同科进士中有两个陈敬，顺治皇帝给他赐名廷敬，从此声名鹊起士林。他从晋身官场之日起，就同后来权倾天下的明珠、索额图恩怨难断，又遭遇徐乾学、高士奇等康熙心腹的明争暗斗。君王如虎，同僚似狼。陈廷敬如履薄冰半辈子，慢慢悟透官场秘诀，终于建功立业，名垂青史。他入仕五十三年，历任康熙帝师，工、吏、户、刑四部尚书，至文渊阁大学士、《康熙字典》总修官等职，最后老死相位。　　康熙朝名臣辈出，那时候的官场关系复杂，几乎没有人能独善其身，为何唯陈廷敬为官善始善终？带着这样的疑问，作者王跃文查阅了大量史料，终成《大清相国》。究其原因，可总结为以下几句话：清官多酷，陈廷敬是清官，却宅心仁厚；好官多庸，陈廷敬是好官，却精明强干；能官多专，陈廷敬是能官，却从善如流。', '', null, 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oGATjMEAADPAclFe8E449.jpg', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oGAKBi_AADPAclFe8E622.jpg', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oGAIO6uAADPAclFe8E954.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:37', '30', '2019-02-04 15:32:20');
