INSERT INTO `yien_goods` VALUES ('6635', '113970395081177', '75', '上官小店', '地下铁道', '29', '40', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:32', '世纪文景出品。2017年普利策奖得主！奥巴马、奥普拉齐声赞叹，新晋奥斯卡奖得主导演巴里·詹金斯新片改编！人生终需一次妄想，带领我们去那从未到过的地方。', '　　少女科拉无家可归，受到欺辱和强暴，过着没有希望的生活。又一次残忍的鞭打，让她下定决心，逃出人间地狱，穿过沼泽的黑水和森林的幽暗，搭乘秘密的地下铁道，一路向北，投奔自由。这是怎样的旅程啊。她沿路看到社会的邪恶，法律的不公，暴力无处不在，善良的光却是那么脆弱。好心人一个个倒下，但那身高两米、冷酷无情的猎奴者仍紧追不舍。　　也许你要有足够的勇气，才会决定看一本讲述奴隶制的小说。但你一旦踏上科拉的逃亡之路，便不可以中途放弃。这是令人心碎的故事，也是一段充满启迪的旅程，在无望的逆境中寻找生机，在黑暗的地下寻找光明。', '', '', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oGADg3sAADMn2RkDdQ271.jpg', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oGAfdDHAADMn2RkDdQ170.jpg', 'http://192.168.21.158:8888/group1/M00/00/42/wKgVnlxX6oGAAzGrAADMn2RkDdQ122.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:32', '70', '2019-02-04 15:32:20');
