INSERT INTO `yien_goods` VALUES ('6643', '113967246815540', '46', '戚半小店', '漫长的告别  [The Long Goodbye]', '26', '40', '重庆', '2019-01-16 16:44:57', '十二个月', '2019-02-02 00:12:26', '雷蒙德·钱德勒代表作，村上春树2万字长文推荐', '说一声再见，就是死去一点。      私人侦探马洛偶然遇到被人扔在停车场的陌生醉鬼，将其带回了家。醉鬼并不老，但满头白发，半边脸上有刀疤，整过容，尽管落魄之至，仍表现得很有教养。酒鬼失意的样子打动了马洛。从那之后，马洛和他成了偶尔一起安静喝酒的朋友。      某天一大早，这位绅士酒鬼找到马洛，说自己杀了妻子——一个百万富翁的荡妇女儿，还请马洛帮帮自己，从而把马洛拖进了一场匪夷所思的漫长告别之中……', '', '', 'https://img11.360buyimg.com/n1/jfs/t26023/77/2430351657/757145/1a41effa/5be518abN9bd823e9.jpg', '', 'https://img11.360buyimg.com/n1/jfs/t26023/77/2430351657/757145/1a41effa/5be518abN9bd823e9.jpg', '6', 'selling_now', '2019-01-16 16:44:57', '2019-02-02 00:12:26', '36', '2019-02-02 00:12:26');
