INSERT INTO `yien_goods` VALUES ('6661', '113969254399596', '59', '韩海小店', '战神卫青（套装上下册）', '48', '70', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:36', '', '　　杨永峰，原名杨永锋。80后，法律人，资深驴友。自小熟读诸子百家经典，喜好历史、国学，2013年开始创作《战神卫青》(原名《卫青—屌丝逆袭的传奇》)。小说连载伊始，便同时被数家网站及APP转载，累计点击量巨大。2014年，笔者原创剧本、动画长片《阿古顿巴的故事》由北京国是经纬文化影视公司正式投拍。笔者熟悉中国历史，熟读经典，作品逻辑严谨，严格把握历史主线，行文风格古朴用词雅致，尤其是人物对白，尽显中华文化底蕴。', '　　依据《史记》、《汉书》、《资治通鉴》、《剑桥中国史》成文，在尊重史实的基础上进行合理的文学加工，着力展示中华民族伟大英雄卫青从奴隶到大将军的传奇一生，描述他出身低微却自强不息的奋斗历程，颂扬无数有名无名的华夏英烈“壮士饥餐胡虏肉，渴饮匈奴血”和“追亡逐北”的千古绝唱及英雄故事。', null, 'http://192.168.21.158:8888/group1/M00/00/43/wKgVnlxX6oaAQgbRAAHKhE5lAV8959.jpg', 'http://192.168.21.158:8888/group1/M00/00/43/wKgVnlxX6oaAa3x8AAHKhE5lAV8968.jpg', 'http://192.168.21.158:8888/group1/M00/00/43/wKgVnlxX6oaADEnXAAHKhE5lAV8247.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:36', '76', '2019-02-04 15:32:25');
