INSERT INTO `yien_goods` VALUES ('6665', '113966238297480', '68', '施平小店', '阿加莎·克里斯蒂作品02:罗杰疑案', '19', '28', '重庆', '2019-01-16 16:44:56', '十二个月', '2019-02-02 00:12:36', '全新版阿加莎·克里斯蒂作品集 内附阿婆遗产继承人手写序言', '　　金斯艾伯特村里坐落着两座豪宅，“皇家围场”是其中之一，而居住其中的弗拉尔斯太太刚刚过世。　　此后不久，她的情人，也就是住在另一所大宅里的罗杰·艾克罗伊德先生便得知，弗拉尔斯太太一年前杀害了自己的丈夫，最终因愧疚而自杀。更重要的是，罗杰还发现她在死之前一直被一个神秘人敲诈。他展开她最后的来信，打算读出那个人的名字，可惜没有人听到。　　因为一把短剑插进了他的后颈……', '', '', 'https://img13.360buyimg.com/n1/g10/M00/0D/0B/rBEQWFFL1vcIAAAAAAuNNu-ercwAACnBAOkS8QAC41O159.jpg', '', 'https://img13.360buyimg.com/n1/g10/M00/0D/0B/rBEQWFFL1vcIAAAAAAuNNu-ercwAACnBAOkS8QAC41O159.jpg', '6', 'selling_now', '2019-01-16 16:44:56', '2019-02-02 00:12:36', '92', '2019-02-02 00:12:36');
