INSERT INTO `yien_goods` VALUES ('6672', '113968220212543', '13', '施冬小店', '风起陇西：新版', '29', '42', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:28', '', '暗流与洪流， 危机与逃亡，疑窦与谋杀  三国时代秘密情报战线上的生死角逐   诸葛亮北伐期间，一名强悍而狡猾的间谍潜入蜀汉腹心。  蜀汉靖安司闻讯而动，铺下天罗地网。  一场惊心动魄的情报战争，  在不被历史记录的黑暗中拉开序幕……', '1.“文字鬼才”马伯庸成名代表作  2.出版十年初心修订，重新填写历史“可能性”  3.史书不会记录这些事件，也不会留下他们的名字  4.暗流与洪流， 危机与逃亡，疑窦与谋杀  三国时代秘密情报战线上的生死角逐', null, 'http://192.168.21.158:8888/group1/M00/00/43/wKgVnlxX6oiANKxpAAETypz-SI0346.jpg', 'http://192.168.21.158:8888/group1/M00/00/43/wKgVnlxX6oiAS6SJAAETypz-SI0290.jpg', 'http://192.168.21.158:8888/group1/M00/00/43/wKgVnlxX6oiAQjYSAAETypz-SI0023.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:28', '8', '2019-02-04 15:32:26');
