INSERT INTO `yien_goods` VALUES ('6674', '113971088973407', '78', '诸葛小店', '捎话', '46', '58', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:36', '', '位于东边的毗沙国与西边的黑勒国势不两立，开启了长达数十年的战争。两国间书信断绝，民间捎话人由此成了一种秘密职业，承担着传递两地间信息的重要角色。小说中的捎话人库，是毗沙国著名翻译家，通数十种语言，他受托将一头小母驴谢如同“捎话”一般，从毗沙捎到黑勒。库说，我只捎话 ，不捎驴。委托人却说，驴也是一句话。 故事就这样开始了…… 在人和万物共存的声音世界里，风声、驴叫、人语、炊烟、鸡鸣狗吠都在向远方传递着话语。各种语言悄无声息穿行期间，神不知鬼不觉，却神鬼俱现。小母驴谢能听见鬼魂说话，能看见所有声音的形状和颜色，懂得为人服役也懂得猜度人心。于是，一人一驴，背负着“捎话”的任务，穿越战场，跨越语言间的沙漠戈壁，见证了许多生死和不可思议之事。', '', '', 'http://192.168.21.158:8888/group1/M00/00/43/wKgVnlxX6oiAACPlAADfvMgfeZ0162.jpg', 'http://192.168.21.158:8888/group1/M00/00/43/wKgVnlxX6oiAC30dAADfvMgfeZ0057.jpg', 'http://192.168.21.158:8888/group1/M00/00/43/wKgVnlxX6oiAFag7AADfvMgfeZ0827.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:36', '42', '2019-02-04 15:32:27');
