INSERT INTO `yien_goods` VALUES ('6715', '4406540669038', '19', '孔恨小店', '泉林本色 抽纸 baby专用本色面巾纸巾不漂白无刺激3层加厚压花90抽*4包', '35', '55', '东莞', '2019-01-21 10:02:03', '六个月', '2019-02-02 00:12:30', '【为宝宝健康定制】远离二噁英,妈妈更放心,健康本色,照顾宝宝每一刻。健康年货合家欢，进店领10元优惠券。商品名称：泉林本色软抽', '', null, null, 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pGABjV9AADLR2ZTYH8084.jpg', 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pGAaoJoAADLR2ZTYH8805.jpg', 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pGAHkNJAACunR-XHjI526.jpg', '7', 'selling_now', '2019-01-21 10:02:03', '2019-02-02 00:12:30', '9', '2019-02-04 15:32:35');
INSERT INTO `yien_goods` VALUES ('6716', '113971398347401', '99', '韩觅小店', '我们一无所有', '31', '50', '重庆', '2019-01-16 16:45:02', '十二个月', '2019-02-02 00:12:39', '纽约时报年度好书，一部堪比米兰·昆德拉《笑忘书》的伟大作品，用厚重而文艺的笔触控诉时代的罪恶。震撼西方文坛，29个各类书单奖项，19国出版，40余家媒体重点关注，Goodreads万人好评。', '这是一部回忆之书，由多个故事串联而成。全书在列宁格勒的地底隧道揭开序幕，在太阳系的边境谱下终曲。', '二十世纪三十年代，一位不成材的肖像画家受到当局指派，删除官方照片和艺术作品之中的异议份子，而头一个对象就是他的弟弟。于是，他做出了“将自己弟弟的脸孔画入每一幅经他审查的图片中”的决定，其后的数十年，因为这一决定引出了无数串联的故事。', '一幅名为“午后空旷的牧野”的油画和一位肖像画家，一位传奇芭蕾女伶和她的曾孙女，一位失明的文物修护师，一位金盆洗手的帮派份子，一位在因地雷爆炸痛失妻儿的鳏夫，还有一位在战争中葬身在画中同一片牧野上的士兵……', 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pGAT1QuAAEefF9Pil4116.jpg', 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pGAL6vsAAEefF9Pil4309.jpg', 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pGAVMAwAAEefF9Pil4970.jpg', '6', 'selling_now', '2019-01-16 16:45:02', '2019-02-02 00:12:39', '30', '2019-02-04 15:32:35');
