INSERT INTO `yien_goods` VALUES ('6721', '113968445809732', '13', '施冬小店', '鬼谷子的局：全十卷', '342', '498', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:44', '百万册级畅销书讲述纵横家、阴阳家、命相家、兵家、道家的祖师爷鬼谷子布局天下的辉煌传奇！附赠导读册、人物关系图、战役地形图、职官隶属简表，系统梳理鬼谷子四子、战国各地的人物关系，还原战国时代！', '　　寒川子，原名王月瑞，河南省镇平县人，1981年毕业于西峡师范学校，1985年毕业于河南师范大学，1987年服军役，1989年毕业于解放军外国语学院研究生院，1998年退役，从事自由撰稿，现为译者、作者和编剧。2003年起心系春秋战国，神交诸子百家，开写《鬼谷子的局》，历时十四载，仍在过程中，易稿无数，历劫千重，力图全方位展开先秦战国社会生活的画轴，再现百家诸子纵横天下的风采，探求两千多年来中华智慧之流的源泉。', '　　“智慧的游戏”系列作品《鬼谷子的局：全十卷》盒装典藏版，是一部长篇历史小说。讲述谋略家、兵法家、纵横家、阴阳家、道家共同的祖师爷——鬼谷子布局天下的辉煌传奇！', null, 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pKAfxGlAAFe-6Tfqqg015.jpg', 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pKAIcwYAAFe-6Tfqqg960.jpg', 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pKAEaBeAAFe-6Tfqqg365.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:44', '26', '2019-02-04 15:32:36');
