INSERT INTO `yien_goods` VALUES ('6724', '113970536160564', '22', '王觅小店', '永恒的边缘（通宵小说大师肯·福莱特世纪三部曲，全球读者平均三个通宵读完！以恢宏辽阔、荡气回肠的故事全景展现整个20世纪人类史。）', '121', '168', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:26', '《巨人的陨落》大结局！全球读者平均3个通宵读完的超级小说！火遍全球的20世纪人类史诗 “世纪三部曲”第三部。我亲眼目睹，每一个迈向死亡的生命都在热烈地生长。16国争相出版，首次登陆中国。读客出品', '　　“世纪三部曲”终于迎来了一个完美结局。', '　　《永恒的边缘》是《巨人的陨落》的大结局！火遍全球的20世纪人类史诗“世纪三部曲”的第三部。我亲眼目睹，每一个迈向死亡的生命都在热烈地生长。', '　　真正残酷和激烈的世界大战，是思想的大战。来自美国、德国、苏联、英国和威尔士的五大家族，又一次迎来了新的考验。东西德分裂、柏林墙、苏联秘密警察、刺杀肯尼迪、民权运动、古巴导弹危机、入侵黎巴嫩、弹劾尼克松……此外，第三代生活中还有摇滚、嬉皮士、跨种族婚恋、性解放，以及对过去的误会与和解。', 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pKAEA6RAAJUOAn6ZoA284.jpg', 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pKADvqzAAJUOAn6ZoA921.jpg', 'http://192.168.21.158:8888/group1/M00/00/44/wKgVnlxX6pKAMlzmAAJUOAn6ZoA242.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:26', '41', '2019-02-04 15:32:37');
