INSERT INTO `yien_goods` VALUES ('6728', '113969409237399', '58', '陶云小店', '曾国藩:全3册(修订版)', '90', '99', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:33', '读曾国藩，悟政商之道，品人生得失；唐浩明亲自修改，全新读本，堪称人生哲学殿堂级教科书', '唐浩明，湖南衡阳人，1946年出生，长期从事湖南地方文献的整理与出版，业余撰写历史小说。编有《曾国藩全集》等，著有长篇历史小说《曾国藩》《杨度》《张之洞》及随笔集“评点曾国藩”系列。所创作的历史小说多次获国家文学大奖，《曾国藩》被香港《亚洲周刊》列为20世纪100强小说。', '翻开本书，感受曾国藩六十年的人生岁月，三十余载的宦海沉浮，二十余年的惊涛骇浪，其为官之道，处世之法，识人秘术尽蕴其中，唐浩明以平实，客观的笔法深入浅出，一层层讲透曾国藩奋斗的一生，一步步剖析曾国藩在识人，读人，荐人上的独特秘术。  唐浩明亲自修改的《曾国藩》既有对历史的探索，又有对人生的思考，往往寥寥数语就让人茅塞顿开，来回翻阅，反复阅读，吸取曾国藩毕生所学精髓。一路读来，令人惊叹不已。', null, 'http://192.168.21.158:8888/group1/M00/00/45/wKgVnlxX6pOAE8s3AAKqtMvl41c294.jpg', 'http://192.168.21.158:8888/group1/M00/00/45/wKgVnlxX6pOAXSoeAAKqtMvl41c899.jpg', 'http://192.168.21.158:8888/group1/M00/00/45/wKgVnlxX6pOAAwAMAAKqtMvl41c495.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:33', '1', '2019-02-04 15:32:37');
