INSERT INTO `yien_goods` VALUES ('6746', '113970219540122', '72', '卫蕾小店', '我们之间', '31', '45', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:32', '《偷影子的人》作者马克?李维温情疗愈新作。孤独是人生的选择，而非注定的命运，总会有一个人出现，让毫无波澜的人生从此充满期待', '独居巴黎的马提亚斯在好友安托万的帮助下移居伦敦，并开始接手一家法语书店，也希望趁此机会与前妻瓦伦蒂娜和女儿艾米丽重回一家人的生活状态。然而阴错阳差，任职于外交部门的瓦伦蒂娜不得不重返巴黎，由马提亚斯单独照顾留在伦敦念书的女儿艾米丽。建筑师安托万独自带着儿子路易在伦敦生活，他为身边的每一位朋友考虑周到，却从来不曾关注过自己内心的孤独。 　　 　　 两位单身父亲带着孩子在同一栋楼里比邻而居，做好了单身一辈子的打算，然而生活总在不断向前。马提亚斯渐渐喜欢上了伦敦的生活和这里的朋友，然而他却不能继续在伦敦生活下去了。安托万终于找到了直面内心的勇气，人生终于有了全新的开始', '', '', 'http://192.168.21.158:8888/group1/M00/00/45/wKgVnlxX6paAVe1WAAEwe-hjM8w374.jpg', 'http://192.168.21.158:8888/group1/M00/00/45/wKgVnlxX6paAUdpfAAEwe-hjM8w444.jpg', 'http://192.168.21.158:8888/group1/M00/00/45/wKgVnlxX6paAMV7xAAEwe-hjM8w316.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:32', '79', '2019-02-04 15:32:40');
INSERT INTO `yien_goods` VALUES ('6747', '113970651574992', '56', '戚静小店', '生死疲劳 (莫言作品全编）', '33', '48', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:29', '2017定稿版，诺贝尔文学奖获得者莫言亲认。诺贝尔文学奖评委会认定的莫言代表作，借六道轮回书写历史变迁与农民命运的史诗巨著，内附精美插页、书签', '《生死疲劳》是莫言以寓言的方式观照历史、借荒诞的想象书写现实，从而讲述一个农民家族半个多世纪以来悲欢离合、兴衰演变的长篇巨著。在小说中，被冤杀的地主西门闹经历了六道轮回，变成驴、牛、猪、狗、猴，*终又转世为一个大头婴儿，滔滔不绝地讲述着自己每一世的离奇经历。小说通过六道轮回的想象跨越生与死，悲悯着历史变迁之中无常的命运，也歌颂着生存于这片土地上的农民们世代相继、生生不息的执着生命力。', '“小说中那位以一己之身与时代潮流对抗的蓝脸，在我心目中是一位真正的英雄。这个人物的原型，是我们邻村的一位农民，我童年时，经常看到他推着一辆吱吱作响的木轮车，从我家门前的道路上通过。我知道，我总有一天要把他的故事讲给天下人听，但一直到了2005年，当我在一座庙宇里看到“六道轮回”的壁画时，才明白了讲述这个故事的正确方法。”——莫言2012年诺贝尔文学奖获奖演说', '', 'http://192.168.21.158:8888/group1/M00/00/45/wKgVnlxX6paAbV1PAAFOj8bdmCs278.jpg', 'http://192.168.21.158:8888/group1/M00/00/45/wKgVnlxX6paAPPTtAAFOj8bdmCs734.jpg', 'http://192.168.21.158:8888/group1/M00/00/45/wKgVnlxX6paAURA4AAFOj8bdmCs882.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:29', '22', '2019-02-04 15:32:41');
