INSERT INTO `yien_goods` VALUES ('6772', '113971011547214', '92', '章南小店', '村上春树：奇鸟行状录（精装）  [ねじまき鳥クロニクル]', '54', '69', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:29', '', '村上春树（1949- ），日本当代作家。京都府人。早稻田大学文学部毕业。主要著作有《挪威的森林》、《寻羊冒险记》、《世界尽头与冷酷仙境》、《舞！舞！舞！》、《奇鸟行状录》、《海边的拉夫卡》、《天黑以后》等。作品真实反映当代日本都市人群的生活、心理，风格洗练，富于想象力，具有很高的艺术价值和深刻的社会批评精神，在世界各地影响广泛，因其笔下人物与我国改革开放后的都市青年群体有着共通之处，故尤其能够得到青年阅读层的喜爱和共鸣。', '', '', 'http://192.168.21.158:8888/group1/M00/00/46/wKgVnlxX6puAC0QAAAA_k5GtIEY727.jpg', 'http://192.168.21.158:8888/group1/M00/00/46/wKgVnlxX6puAZ-l4AAA_k5GtIEY620.jpg', 'http://192.168.21.158:8888/group1/M00/00/46/wKgVnlxX6puAaNSqAAA_k5GtIEY393.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:29', '91', '2019-02-04 15:32:46');
INSERT INTO `yien_goods` VALUES ('6773', '113969892778747', '11', '诸葛小店', '月亮与六便士（畅销百万册精装纪念版，荣获2017豆瓣阅读图书桂冠译本）【大星文化出品】  [The Moon and Sixpence]', '34', '45', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:26', '', '　　“满地都是六便士，他却抬头看见了月亮。”', '　　银行家查尔斯，人到中年，事业有成，为了追求内心隐秘的绘画梦想，突然抛妻别子，弃家出走。', '　　在异国他乡，他贫病交加，对梦想却愈发坚定执着。在经历种种离奇遭遇后，他来到南太平洋的一座孤岛，同当地一位姑娘结婚生子，成功创作出一系列惊世杰作。就在此时，他被绝症和双目失明击倒，临死之前，他做出了让所有人震惊的决定……', 'http://192.168.21.158:8888/group1/M00/00/46/wKgVnlxX6puASLcYAAEKEk48laY070.jpg', 'http://192.168.21.158:8888/group1/M00/00/46/wKgVnlxX6puALcjzAAEKEk48laY448.jpg', 'http://192.168.21.158:8888/group1/M00/00/46/wKgVnlxX6puAD1O6AAEKEk48laY155.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:26', '3', '2019-02-04 15:32:46');
