INSERT INTO `yien_goods` VALUES ('6789', '113970420783372', '8', '秦友小店', '4 3 2 1（京东定制版4321主题纽约黄铅笔套装)', '117', '148', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:08:12', '', '1947年3月3日，在新泽西州纽瓦克的一间产科病房，露丝和斯坦利*一的孩子阿奇?艾萨克?弗格森出生了。从那时起，弗格森的生活展开了四条彼此独立的平行路径。四个男孩是同一个男孩，由同样的DNA造就，却沿着四种轨迹经历了四重的人生。', '四个弗格森在不同的城镇长大，有着不一样的知识激情、感情生活和社交圈，他们如影子般彼此映照，相互阐释，也走向不同的人生境遇。在美国社会激荡变革的大时代背景下，弗格森们在各自的青春之路上奔袭，经历着伤痛、失去和蜕变……', '一部全景式的社会写实作品，一卷奇特的史诗级成长小说，关于传统、家庭、爱情和现代生活包罗万象的故事，关于自我的禀赋与人生的可能性。“保罗?奥斯特是当代文学一个*为独特的声音”，《4 3 2 1》是一部精彩绝伦、感人至深的杰作。', 'http://192.168.21.158:8888/group1/M00/00/46/wKgVnlxX6p6AS5MrAAC-meURBjA371.jpg', 'http://192.168.21.158:8888/group1/M00/00/46/wKgVnlxX6p-AfhbkAAC-meURBjA564.jpg', 'http://192.168.21.158:8888/group1/M00/00/46/wKgVnlxX6p-AZw3pAAC-meURBjA164.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:08:12', '1', '2019-02-04 15:32:49');
