INSERT INTO `yien_goods` VALUES ('6801', '113969879199685', '51', '朱凌小店', '上帝怀中的羔羊', '34', '40', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:33', '', '故事开始于南北战争爆发前二十年……', '第一代南方垦荒者文斯和妻子西恩生育了四名子女，女儿希恩跟随丈夫伦祖去了属于他们的土地。大儿子贾斯帕内敛沉默，在父母家帮忙。次子里阿斯野心勃勃，从海岸镇带回了勇敢叛逆的新娘玛戈特。小儿子杰克聪慧敏感，对身边的人和事总是体察入微，特别是姐姐希恩……', '有些人来到此处耕耘，有些人则渴望更远的地方。恶劣的生存条件带给垦荒者重重考验，更让年轻的主妇希恩措手不及；幼年漂泊的经历让玛戈特渴望平静的生活，但流淌着开拓者血液的里阿斯却执意去了远方；一次意外让希恩和杰克产生了难以弥合的裂痕，不过她和玛戈特却在岁月流年里从陌生人变成了相互支撑的挚友……', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qCAcxuxAADGE-bd8QM443.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qCAFtXEAADGE-bd8QM692.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qCAHyYvAADGE-bd8QM880.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:33', '3', '2019-02-04 15:32:51');
INSERT INTO `yien_goods` VALUES ('6802', '113970691094870', '40', '陶听小店', '鼠疫', '35', '49', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:36', '诺贝尔文学奖获得者加缪代表作，首师大教授李玉民法语直译，万字解析。2018全新修订，瑞典轻型纸环保印刷不伤眼，果麦文化 出品。', '　　　　《鼠疫》讲述了阿尔及利亚的奥兰，突如其来的瘟疫让人不知所措。政客狂妄无知，掩饰诿过，甚至想利用灾难来获取利益；原来过着委靡不振生活的小人物，凭著黑市门路，为人民带来各种禁品，突然成为了城中的风云人物；小百姓恐慌无助、自私贪婪，每天都只是过著颓废生活。瘟疫城市被重重封锁，无人能够自由进出。被困在城中的人民，朝思暮想着住在城外的亲朋好友。一位到城公干的记者被迫过著无亲无友的生活，只有寄望参与自愿队消磨时间。主角里厄医师这时挺身而出救助病人，与一些同道成了莫逆之交。不过，他的妻子却远在疗养院，生死未卜。　　最终鼠疫退却了，然而尽管喧天的锣鼓冲淡了人们对疾病的恐惧，可是奥兰人永远不会忘记鼠疫曾给他们带来的梦魔。', '', '', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qCARzPkAAB17pxk-HU342.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qGAeUi1AAB17pxk-HU351.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qGAOAz3AAB17pxk-HU232.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:36', '25', '2019-02-04 15:32:51');
