INSERT INTO `yien_goods` VALUES ('6806', '4406213936825', '49', '赫连小店', '【工厂直供】抽纸巾餐巾纸整箱面巾纸 金装抽纸原生纯木卫生纸家庭装面巾纸厕纸宝宝用纸巾擦手纸抽纸批发 8包试用', '10', '30', '东莞', '2019-01-21 10:02:02', '六个月', '2019-02-02 00:12:33', '商品名称：【工厂直供】抽纸巾餐巾纸整箱面巾纸 金装抽纸原生纯木卫生纸家庭装面巾纸厕纸宝宝用纸巾擦手纸抽纸批发 8包试用', '', null, null, 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qGAIq1xAAEEkiVZ0Os224.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qGABPk6AAEEkiVZ0Os027.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qGAIgd-AAIn3KDC5Lo212.jpg', '7', 'selling_now', '2019-01-21 10:02:02', '2019-02-02 00:12:33', '97', '2019-02-04 15:32:52');
INSERT INTO `yien_goods` VALUES ('6807', '113967420864671', '98', '范玉小店', '马伯庸作品：长安十二时辰（上下共两册）+古董局中局（套装共4册）+四海鲸骑（套装全2册）', '202', '297', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:36', '', '　　古董造假、字画仿冒，古已有之。在古董斑驳的纹理中，承载着一个民族的文化，一个时代的风貌，它的价值，本不是金钱可以衡量的。然而巨大的利益，令无数人铤而走险，更有一些家族，父传子，子传孙，世世代代在这个晦暗不明、凶险万状的江湖上营生……　　一个突然到来的访客，把平凡的古董店店主许愿带进了一个做梦都想不到的阴谋中，一件坊间传说的稀世珍宝，竟然和自己有着千丝万缕的联系，一个几十年前做的局，竟然已经编排进自己的命运。许愿将使出浑身解数，置身生死之间，和蛰伏了几十年的各方神圣斗智斗勇，和古董江湖里造假做局的各种奇技淫巧一一遭遇……　　翻开本书，了解古董行当里的文化传承与江湖险恶。', '', '唐天宝三年，元月十四日，长安。 大唐皇都的居民不知道，上元节辉煌灯火亮起之时，等待他们的，将是场吞噬一切的劫难。 突厥、狼卫、绑架、暗杀、烈焰、焚城，毁灭长安城的齿轮已经开始转动。而拯救长安的全部希望，只有一个即将被斩首的独眼死囚和短短的十二个时辰……', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qGAStE0AAC3ze5CqwA434.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qGAR-KSAAC3ze5CqwA809.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qGAYTFeAAC3ze5CqwA113.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:36', '59', '2019-02-04 15:32:52');
