INSERT INTO `yien_goods` VALUES ('6813', '113967283807710', '46', '戚半小店', '守护天使（套装全5册）', '194', '258', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:38', '守护天使——芝加哥首席女侦探精选集,莎拉˙派瑞斯基，美国冷硬派三大女杰之一 包揽钻石匕首奖、金匕首奖、银匕首奖、爱伦坡终身大师奖等多项推理小说大奖 作品被翻译成二十多种语言，在全球销量逾千万册。', '　　维˙艾˙华沙斯基，毕业于芝加哥大学法学院，从初出茅庐的公辩律师，到独当一面的芝加哥首席女侦探，丝质外套与牛仔裤包裹下的曼妙曲线由于史密斯威森手枪的存在，平添了一丝冷酷与不可侵犯。', '　　芝加哥深不可测的泥沼中，埋葬着不可饶恕的罪恶。沉默的亡灵永远无法再开口说话，华沙斯基便成为了他们的代言人。', '　　那些转瞬即逝的温存，犹如暗夜中的微光，星星点点照亮了前路。', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qOACHZCAABo1u4lSXU048.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qOAft_XAABO4ExYn8k106.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qOAMnpgAABo1u4lSXU690.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:38', '64', '2019-02-04 15:32:53');
