INSERT INTO `yien_goods` VALUES ('6826', '113968822397928', '40', '陶听小店', '平家物语', '74', '98', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:26', '军记物语鼻祖 历史小说翘楚古雅之风 武士之道 争战之烈 人情之美 六十万言足本，周作人未竟之业,，终得全貌四十载磨一剑，林文月撰文力荐，译文典范', '　　《平家物语》是一部战争题材的历史小说，塑造了许多广被传颂的武士典型。在日本文学史上与《源氏物语》并列为二大物语经典，一文一武，菊花与剑，影响极为深远。书中叙述平安朝末期，平家与源氏逐鹿天下，享尽荣华之际，泰极否生，一门大小先后被歼灭的凄惋过程。揭示诸行无常，盛者必衰之理；业因果报，人情义理，尽在其中。而凝练雅致的文体布局下，人物之特出，情节之殊胜，贵族的风华行止，武士的贞亮死节，以及可歌可泣的女性轶事等，莫不感人肺腑。　　本书由深耕汉和文学六十年的郑清茂教授，依据经典“觉一本”，历时多年完成汉译，并详加注释。译本附有珍贵彩色绘卷及年表、系谱、地图等，实乃制作严谨的文学名著。', '　　军记物语鼻祖 历史小说翘楚 　　古雅之风 武士之道 争战之烈 人情之美 　　六十万言足本，周作人未竟之业,，终得全貌 　　四十载磨一剑，林文月撰文力荐，译文典范', null, 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qWAaC5CAAEMBkrZ8S4959.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qWAdyIdAAEMBkrZ8S4087.jpg', 'http://192.168.21.158:8888/group1/M00/00/47/wKgVnlxX6qWANxD8AAEMBkrZ8S4903.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:26', '83', '2019-02-04 15:32:55');
