INSERT INTO `yien_goods` VALUES ('6832', '113970510697921', '89', '魏书小店', '兄弟', '54', '68', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:32', '余华搁笔十年颠覆震撼之作，2018新版精装典藏', '《兄弟》是余华搁笔十年，继《活着》《许三观卖血记》之后的颠覆震撼之作。', '《兄弟》讲述了江南小镇两兄弟李光头和宋钢的一生。这对没有血缘关系的兄弟从小历经磨难，好得像一个人，可双亲去世、两人长大后却因一个名叫林红的美丽女人反目，从此走上了截然不同的道路：一个成了巨富，产业遍布全国；一个穷困潦倒……但即使多年过去，他们也依然牵挂着彼此——就算天翻地覆慨而慷了，他们还是兄弟；就算生离死别了，他们还是兄弟。', '', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qaAfrBBAAEbnTX3rYE934.jpg', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qaAeO3BAAEbnTX3rYE305.jpg', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qaAUrNDAAEbnTX3rYE205.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:32', '93', '2019-02-04 15:32:56');
