INSERT INTO `yien_goods` VALUES ('6836', '113970818640498', '43', '云恨小店', '万寿寺', '36', '45', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:43', '王小波经典代表作，逝世二十周年精装纪念版！王小波奇想与荒诞的结晶——“一个人只拥有此生此世是不够的，他还应该拥有诗意的世界。”', '《万寿寺》是王小波的长篇小说代表作，是王小波奇想与荒诞的结晶。', '《万寿寺》的主人公王二的遭遇和唐代传奇人物薛嵩、红线的遭遇古今交错，讲述了关于现在、过去、自我、记忆，穿越时空和地域的故事。作者以借古喻今的手法，自由奔放的想象力，收放自如的叙述技巧，构筑了一个虚拟、魔幻、诡异的时空世界。通过一段段荒诞有趣的故事，展现了作者对中国历史和中国人性格的独到解析，同时影射了当代的现实弊病。', '', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qaANkxyAADz7ME4rcw493.jpg', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qaABnF3AADz7ME4rcw883.jpg', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qaAUa7pAADz7ME4rcw643.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:43', '54', '2019-02-04 15:32:57');
