INSERT INTO `yien_goods` VALUES ('6838', '113967408916858', '87', '金代小店', '西夏死书3', '23', '37', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:28', '南派三叔鼎力推荐，一部令人心惊肉跳的探险传奇！', '佛像中的头骨不翼而飞，唐风和韩江再次上路；山中客栈惊现神秘宝藏图，芬妮被杀死在客栈后的树林中，唐风和韩江的行动从一开始就危机四伏；寻找消失的上寺遗址，众人再次迷失在巨大的玄宫中；巨大的石壁上惊现可怕的图案，勾起了几十年前的惊人往事，至今想起仍然令人心有余悸；打开石壁，唐风、韩江、马卡罗夫三人勇闯山中玄宫，发现了惊世宝藏和身负重伤的史蒂芬，就此，一段尘封的家族往事在众人面前徐徐展开，山巅上决战，史蒂芬与斯捷奇金同归于尽，中留下已经破碎的两块玉插屏……', '四块玉插屏终于聚齐，通往瀚海宓城的地图惊现，叶莲娜的调查也初露曙光，就在这时，韩江被指责为老K中的内鬼而身陷囹圄，老K就此解散，四块玉插屏被迫封存，一场风暴正在向唐风袭来……', '', 'https://img14.360buyimg.com/n1/jfs/t18217/338/2296340701/601536/72152fa8/5aefbdb6Nfb32e2e3.jpg', '', 'https://img14.360buyimg.com/n1/jfs/t18217/338/2296340701/601536/72152fa8/5aefbdb6Nfb32e2e3.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:28', '29', '2019-02-02 00:12:28');
