INSERT INTO `yien_goods` VALUES ('6848', '113971217925318', '38', '孔灵小店', '草枕（浮世绘彩图版 ）', '25', '36', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:41', '带给动画大师宫崎骏，音乐大师坂本龙一等无数艺术家灵感的美学巨作。行旅在外，结草为枕，只盼能在非人情的天地，逍遥片刻。夏目漱石经典小说集，浮世绘彩图纪念版，隐逸美学的诗意书写。', '《草枕》描写一名画师为了逃避现实生活，开始一段“非人情”之旅，并在途中邂逅了一名神祕的女子……', '“非人情”，意谓远在世俗人情与道德的美的境界之上。《草枕》藉画师走进深山田野的旅途所见，抒发漱石大量对艺术观、人生观以及美学的思想独白。在迟暮的春色中，带领不安迷茫的人心，感受广阔天地之美以及全然孤独的狂喜。是夏目漱石前期重要的代表作品。“这是与世上的小说全然相反意义的创作，我只想纯粹将美的感觉留驻人们心中。”夏目漱石作为明治维新的国民作家，面对汹涌而来的西方文明，并不动摇他对汉学的偏爱。坚守东洋文化的实践。字句间展纸上桃花源。', '', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qiAClbyAACF_EYI6K8872.jpg', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qiAb2tlAACF_EYI6K8863.jpg', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qiATTGlAACF_EYI6K8195.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:41', '49', '2019-02-04 15:32:59');
