INSERT INTO `yien_goods` VALUES ('6858', '113969332020658', '80', '王青小店', '长篇历史小说经典书系：孝庄皇太后（套装全3册）', '95', '120', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:30', '淋漓再现大清兴国太后的柔情与智慧         全景展现宫廷深处的权谋与尔虞我诈', '代序 《孝庄皇太后》：政治史的战争风俗画——兼谈长篇历史小说的当代启示性 /001', '　　颜廷瑞，男，汉族，陕西省华县人，1931年8月生，沈阳军区政治部离休干部，一级作家，中国作家协会会员、中国戏剧家协会会员。主要著作有：大型话剧《太后不嫁》，大型歌剧《菊花岛》，长篇历史小说《孝庄皇太后》《大宋王朝》（原名《汴京风骚》），长篇纪实文学《威震台海》，长篇传记文学《范文臣》《清吏范仲淹》等。作品屡获姚雪垠长篇历史小说奖、中国大众文学奖、辽宁省传记文学奖等奖项。', null, 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qqAKpb5AAEsn6Ngp4Q190.jpg', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qqAKkjTAAEsn6Ngp4Q011.jpg', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qqAEe3RAAEsn6Ngp4Q318.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:30', '68', '2019-02-04 15:33:01');
INSERT INTO `yien_goods` VALUES ('6859', '113968886188894', '73', '苏枫小店', '李鸿章（套装全3册）/长篇历史小说经典书系', '85', '120', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:44', '晚清四大中兴名臣之一，十九世纪世界三大名人之一。被称为晚清改革的“总设计师”、东方的“俾斯麦”。为官从政、为人处世必读经典。', '　　第一册内容简介：　　本册主要记叙李鸿章为保卫上海，千里运兵赴沪；在上海三战三捷，出任江苏巡抚；创办近代军工企业，以洋枪洋炮装备淮军，收复江苏失地，封肃毅伯、太子少保。后因曾国藩剿捻无功，李鸿章代师平定捻军，晋升协办大学士。由此，淮军崛起。　　李鸿章通过镇压内乱而平步青云，勇于任事、不惧困苦、不畏人言、坚持已见是他成功的重要因素。用人不究细故，只重其长，不重其德，使他帐下很快聚集了一批能征善战的将领和通达实用人才，但这也埋下了文官多贪墨之辈、武将多怕死之徒的隐患。　　本书是迄今为止写李鸿章好的小说，与二月河的《雍正皇帝》、熊召政的《张居正》、孙皓晖的《大秦帝国》、唐浩明的《曾国藩》并称为“当代长篇历史小说五大名作”。　　第二册内容简介：　　本册主要记叙李鸿章出任天下督抚之首——直隶总督二十五年，长期影响着大清的军事、外交和洋务。他痛感大清积弱不振，得出“富强相因”“必先富而后能强”的认识，将洋务运动的重点转向“求富”。他千方百计创办了一系列民用企业，推进了中国近代化的进程，缩短了与列强的差距。在经历了日本侵台、俄罗斯强占伊犁、法国进攻越南等战事后，他深感海洋武备的重要，以敏锐的目光，强烈的责任感创办了大清支近代化海军——北洋舰队。　　此一时期，李鸿章堪称晚清洋务运动的巨擘，他的见识走在了时代的前列。可在朝堂上，他依然要与顽固派争斗，又要与疑心重重、善耍手腕的慈禧周旋，才能克服重重阻力推进洋务大业。可以说，没有李鸿章，就没有晚清的近代化。　　本书是迄今为止写李鸿章好的小说，与二月河的《雍正皇帝》、熊召政的《张居正》、孙皓晖的《大秦帝国》、唐浩明的《曾国藩》并称为“当代长篇历史小说五大名作”。　　第三册内容简介：　　历经三十年的洋务运动，大清国力、军力大增，拥有了号称东亚的北洋舰队。可甲午战争爆发，北洋舰队全军覆没，大清与日本签订《马关条约》，割让辽东半岛和台湾。列强完全认清了大清的不可救药，侵吞中国的野心疯长。随后李鸿章出使俄国，为制衡日本签订中俄密约，并游历欧美、开阔眼界。长期的民教相仇、华洋积怨，导致义和团运动爆发。八国联军进京，李鸿章为国家计，谋求东南互保。两宫仓惶西逃，推出李鸿章收拾残局，因签订丧权辱国的《辛丑条约》，忧愤而死。　　这一时期，中央对地方的控制力明显降低，帝党与后党的斗争进入白热化，国家力量更加分散，国策不定，带来了灾难性后果。李鸿章深深感叹，像中国这样的大国，没有一个可做砥柱的中枢来领导，自强难求，保国也难。　　本书是迄今为止写李鸿章好的小说，与二月河的《雍正皇帝》、熊召政的《张居正》、孙皓晖的《大秦帝国》、唐浩明的《曾国藩》并称为“当代长篇历史小说五大名作”。', '迄今为止写李鸿章很好的小说！', null, 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qqATbibAAFlocV9wuw392.jpg', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qqAUPlDAAFlocV9wuw042.jpg', 'http://192.168.21.158:8888/group1/M00/00/48/wKgVnlxX6qqABeMPAAFlocV9wuw195.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:44', '70', '2019-02-04 15:33:01');
