INSERT INTO `yien_goods` VALUES ('6870', '113966276693449', '68', '施平小店', '劳伦斯·布洛克：八百万种死法  [Eight Million Ways to Die]', '46', '58', '重庆', '2019-01-16 16:44:56', '十二个月', '2019-02-02 00:12:40', '在荒凉的城市里，人人都可以在马修的身上照见自己', '1938年6月24日生于纽约水牛城，1959年毕业于俄亥俄州安提阿科学院，目前定居纽约。当代美国硬汉派侦探小说大师，纽约犯罪行吟诗人。19岁发表处女作《你不可错过》，之后近50年，笔耕不缀, 至今已有30多部小说问世，被誉为当代欧美侦探推理小说大师级人物。', '', '', 'https://img14.360buyimg.com/n1/jfs/t24103/302/302387924/342121/3e56de4c/5b2b596bNcd64f8ed.jpg', '', 'https://img14.360buyimg.com/n1/jfs/t24103/302/302387924/342121/3e56de4c/5b2b596bNcd64f8ed.jpg', '6', 'selling_now', '2019-01-16 16:44:56', '2019-02-02 00:12:40', '97', '2019-02-02 00:12:40');
INSERT INTO `yien_goods` VALUES ('6871', '113968874116341', '86', '喻巧小店', '崇祯大传奇（套装全3册，作家榜重磅推荐）', '89', '118', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:44', '失败的经验比成功的经验更重要！揭开传奇皇帝崇祯掌权、用权、失权的全部细节！导演尤小刚亲笔作序隆重推荐！政商必读！创业必读！历史爱好者必读！横扫京东小说热卖榜！读者满分推荐！限时秒杀！', '十八岁登基掌权，少年天子崇祯，接手的大明帝国却是一个危机四伏的烂摊子：内有民众揭竿造反，外有满洲铁骑虎视眈眈，眼皮底下的大太监魏忠贤，结党营私弄权……', '　　◆本书作者耗费10年心血，将史料化为精彩纷呈的历史小说，首次完整还原崇祯的传奇一生，让您在享受阅读乐趣的同时，深入了解崇祯掌权后遭遇的所有危局、陷阱和诡计，失败的细节、教训和规律。', null, 'http://192.168.21.158:8888/group1/M00/00/49/wKgVnlxX6q2AJ9kBAAHZKe29qf4589.jpg', 'http://192.168.21.158:8888/group1/M00/00/49/wKgVnlxX6q2AKTF-AAHZKe29qf4522.jpg', 'http://192.168.21.158:8888/group1/M00/00/49/wKgVnlxX6q2ABhrMAAHZKe29qf4992.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:44', '3', '2019-02-04 15:33:04');
