INSERT INTO `yien_goods` VALUES ('6878', '113970858106384', '90', '奚忆小店', '我们的天空', '28', '45', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:35', '一部跨越生死、激荡灵魂的爱之经典 “一位普通的英国父亲，为已经离去的儿子创建了一个网站 3年来走遍和儿子曾去过的每个地方，拍下天空上传， 渐渐地，这份爱感染了整个英国，乃至全世界……”（白马时光）', '罗伯一个人独自住在英国西南部的康沃尔郡，成天酒瓶不留手，其他时间都用来旅行，登上高处拍下360度的全景照片，然后上传到他建立的网站“我们的天空”。', '没有人知道，照片里的那些地方，都是他与儿子杰克曾经去过的地方，上传照片时，他会在每张照片上设一段密码，那是他再也没有机会对杰克说出口的话。', '罗伯曾经是个电脑天才，在剑桥大学念书时与美丽的安娜相遇，两人热恋成婚，婚后安娜多次流产，才终于迎来活泼可爱、宛如天使般的儿子杰克。', 'http://192.168.21.158:8888/group1/M00/00/49/wKgVnlxX6q-AOjoHAAEGLm3YxJE229.jpg', 'http://192.168.21.158:8888/group1/M00/00/49/wKgVnlxX6q-AWYWXAAEGLm3YxJE808.jpg', 'http://192.168.21.158:8888/group1/M00/00/49/wKgVnlxX6q-ARBQbAAEGLm3YxJE121.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:35', '91', '2019-02-04 15:33:05');
