INSERT INTO `yien_goods` VALUES ('6894', '113968932592480', '63', '公羊小店', '曾国藩（精装珍藏本 全3册）', '116', '168', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:08:12', '唐浩明2017年全新修订版，精装珍藏本，修身、齐家、经世、治国之典范！', '唐浩明，湖南衡阳人，1946年出生，长期从事湖南地方文献的整理与出版，业余撰写历史小说。编有《曾国藩全集》等，著有长篇历史小说《曾国藩》《杨度》《张之洞》及随笔集“评点曾国藩”系列。', '本书是著名作家唐浩明先生的代表作，晚清三部曲之一。  荣获首届姚雪垠长篇历史小说奖；  被《亚洲周刊》评为20世纪中文小说百强之一；  白岩松、柳传志、宗庆后鼎力推荐！   曾国藩是对中国近代史产生过巨大影响的人物，但由于种种原因，长期被当代历史忽略。  作者掌握大量珍贵史料，在尊重史实的基础上，全面地刻画了曾国藩的文韬武略、进退宠辱、人生态度、人格学养、处世哲学、治军威权、行政手腕，把一个活生生的历史和文学形象，重现在读者面前。', null, 'http://192.168.21.158:8888/group1/M00/00/49/wKgVnlxX6rGAB8J1AABhg2jCkGA343.jpg', 'http://192.168.21.158:8888/group1/M00/00/49/wKgVnlxX6rGALhTeAABhg2jCkGA857.jpg', 'http://192.168.21.158:8888/group1/M00/00/49/wKgVnlxX6rGAVIoqAABhg2jCkGA219.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:08:12', '37', '2019-02-04 15:33:08');
