INSERT INTO `yien_goods` VALUES ('6910', '113970154379178', '83', '尉迟小店', '长日将尽/2017年诺贝尔文学奖获得者石黑一雄作品  [The Remains of the Day]', '38', '48', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:34', '2017诺贝尔文学奖得主石黑一雄代表作、布克奖获奖小说；一曲帝国衰落的挽歌，一场擦肩而过的爱情；同名电影（又译《告别有情天》）获多项奥斯卡奖、英国电影学院奖提名，安东尼·霍普金斯、爱玛·汤普森主演。', '　　石黑一雄，日裔英国小说家，1954年生于日本长崎，与奈保尔、拉什迪并称为“英国文坛移民三雄”。石黑一雄的作品并不多，但几乎每部作品都获得重要的文学奖项：《远山淡影》获温尼弗雷德·霍尔比纪念奖，《浮世画家》获惠特布莱德年度*佳小说奖，《长日将尽》获布克奖，《无可慰藉》获切尔特纳姆文学艺术奖，《浮世画家》《我辈孤雏》和《莫失莫忘》均入围布克奖决选名单；1995年英女王授予石黑一雄文学领域的大英帝国勋章，1998年获法国文学艺术骑士勋章，2017年因“以其巨大的情感力量，发掘了隐藏在我们与世界的虚幻联系之下的深渊”而获诺贝尔文学奖。', '', '', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6rSAVV-MAAHZ9MwHsLs853.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6rSAAx2aAAHZ9MwHsLs982.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6rSAeyeBAAHZ9MwHsLs068.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:34', '14', '2019-02-04 15:33:11');
INSERT INTO `yien_goods` VALUES ('6911', '4401243056333', '20', '施凌小店', '植护黄色原生竹浆本色抽纸6包装面巾纸巾餐巾纸卫生本色纸', '10', '30', '东莞', '2019-01-21 10:01:57', '六个月', '2019-02-02 00:12:42', '居家好物暖冬放价！Pick个护/清洁/美妆心水爆款更多人气精选品满199减100等您抢购！猛戳→商品名称：植护本色100抽*6包', '', null, null, 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6rSALl54AAB3SncL4n4230.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6rSABHw4AABTwz27Fuo779.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6rSAY1C1AABqux3G_II457.jpg', '7', 'selling_now', '2019-01-21 10:01:57', '2019-02-02 00:12:42', '31', '2019-02-04 15:33:11');
INSERT INTO `yien_goods` VALUES ('6912', '113969268122327', '80', '王青小店', '南荣家的越', '45', '65', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:42', '', '张广天，诗人，作家，导演，音乐家。1966年出生于上海。为多部电影和戏剧作曲，又编剧导演诸多舞台剧，如《切·格瓦拉》、《圣人孔子》、《野草尖叫蓝靛厂》等。出版书籍有《板歌》（作家出版社）、《手珠记》（作家出版社）、《妹方》（四川文艺出版社）和《既生魄》（江苏凤凰文艺出版社）。他系统地承继和贯穿自孔孟以来的思想成就，由汉代经学到宋代理学、事功学，经明清心学，发展为内学。此内学提倡向心求知的学习路径，探索古典信仰传统在当今的新机缘。其思想深具原创性和体系性，可概括为“心学为体，诸学为用”。', '1193年，时值宋、金、蒙古长久并存，江南临安城南荣家梨云园失火，三岁的南荣越丧父失母。父亲南荣靖桑幽魂未灭，含冤欲吐，不忍抛下儿子，遂暗中跟随其成长、迁居、投奔，后南荣越因擅制火器征战于宋金之间，又入蒙古国随军抵斡罗思（今俄罗斯）、马扎儿（今匈牙利），直至欧洲腹地，历千难万险，至老终归于江南。其时，中原文明随蒙古西征经中亚传至欧洲，亚欧大陆各方思想和生活方式因战争而交织、融合、重铸，南荣越的所见所历，遂铺排出一幅当时的世界图景，一个全然不同于以往、延续至今的崭新的中国文明正在诞生。', null, 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6rWAbSbnAADryWbAxFE396.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6rWAbRKMAADryWbAxFE094.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6rWAUVEOAADryWbAxFE993.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:42', '64', '2019-02-04 15:33:11');
