INSERT INTO `yien_goods` VALUES ('6924', '113970767187702', '35', '万俟小店', '绿毛水怪', '34', '39', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:37', '', '王小波短篇小说集，其中同名小说《绿毛水怪》是王小波小说处女作，可以一窥作者创作的源头及其后的发展走向。小说中肆意的想象力、幽默的调侃以及人对自我意志的彰显，是作者*突出的写作风格，也是一以贯之的精神内核。小说《绿毛水怪》也是王小波和李银河的定情之作，其间洋溢的强烈诗意，令人看到小说和杂文之外的另一个王小波。', '', '', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6riAXks6AAHjorbqBuM173.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6riAAZ1ZAAHjorbqBuM004.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6riAMyfxAAHjorbqBuM733.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:37', '99', '2019-02-04 15:33:14');
INSERT INTO `yien_goods` VALUES ('6925', '96301338439531', '43', '云恨小店', '多功能家用厨房做饭神器做饭用品做饭工具厨房用品用具小百货懒人 五件套', '17', '29', '成都', '2019-01-22 11:33:37', '九个月', '2019-02-02 00:12:47', '商品名称：多功能家用厨房做饭神器做饭用品做饭工具厨房用品用具小百货懒人 五件套', 'https://misc.360buyimg.com/lib/img/e/blank.gif', null, null, 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6riABwB-AABsqTMw_nk078.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6riAYXgkAAE3iUD2Fx8698.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6riAS1_SAADDKyZqi_w974.jpg', '8', 'selling_now', '2019-01-22 11:33:37', '2019-02-02 00:12:47', '62', '2019-02-04 15:33:14');
INSERT INTO `yien_goods` VALUES ('6926', '113968195109849', '97', '杨柏小店', '雍正皇帝（全三册）二月河文集系列', '65', '100', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:30', '“二月河的意思我听懂了，因为我了解他比他了解我多。他写的‘帝王系列’我认真看了，看了他的书就能读懂他。”', '　　二月河，本名凌解放，中国作家协会会员，汉族，1945年出生于山西省昔阳县。高中毕业后入伍，由战士而及副指导员，1978年转业南阳市委，现任河南省作协副主席。40岁开始文学创作，致力于营建“帝王系列”，目前已出版长篇系列历史小说13卷，计500余万字。　　《康熙大帝》、《雍正皇帝》、《乾隆皇帝》出版后曾分别获得河南省政府优秀文学艺术成果奖，湖北省出版佳作奖，并获得美国“海外华人作家作品奖”。其中《雍正皇帝》曾获“八五”期间全国优秀长篇小说奖，香港《亚洲周刊》评为“二十世纪中文小说一百强”之一。香港明窗出版社、台湾巴比伦出版社相继出版中文繁体字本，韩国车老师语言语亮度等即将出版韩文本。', '　  《雍正皇帝（套装全3册）》是系列长篇历史小说《雍正皇帝》的第1卷。帝王行止、宫闱秘闻素来为读者关心，《雍正皇帝（全3册）》描写鲜为人知的清廷生活，却又不拘囿于那小小的紫禁城。阿哥党争，杀机隐隐，龙庭易主，雍正险胜。改诏说，弑父说，继位说？一段历史，几多疑云，扑朔迷离，令人难解难分。作者用史笔著文，用文笔立史，庙堂之高，江湖之远，无不尽收笔底。上至典章制度、宫廷建筑、饮食服饰、礼仪乐律，娓娓道来，书卷气浓；下至勾栏瓦舍、寺庙堂肆、市井乡野、客旅古渡，徐徐展开，风情万种。阿哥逐鹿，明争暗斗，字字权谋机诈；女伶歌伎，绕梁余音，句句回肠荡气。其情节铺设，天矫跌宕，人物塑造，浓淡相宜，谋篇均别出心裁；以思想为经，艺术为纬，鸟瞰历史，探究人生，非大家而不可为。正如一位评论家读后所言：难得的历史小说佳作。　  《雍正皇帝（套装全3册）》是系列历史长篇小说《雍正皇帝》的第2卷。　  九王夺嫡，雍正险胜，紫禁城新桃换旧符。但树欲静而风未止，皇城内外，大江南北，仍杀机四伏。　  八爷党死而未僵，取代之心，咄咄逼人；专间将军年羹尧倨功自傲，拥军干政；连托孤重臣隆科多也脚踏两只船，擅派兵丁入禁苑。一时间，风急浪险，浮云蔽日。　  沧海横流，正试帝王才干。雍正依靠方苞等股肱重臣，整肃史治，擢用新人田文镜、刘墨林等，不顾安危，巡视黄河防务，体恤民心。借青海大捷之利，雕弓轻舒，粉碎八爷党和十四弟政变阴谋，圈禁隆科多，赐杀年羹尧。　  《雍正皇帝（套装全3册）》是深受读者喜爱和评论家赞赏的《雍正皇帝·九三夺嫡》的姊妹篇。全书不仅保持了上卷的艺术特色，涉笔广泛，场面恢宏，有波谲云诡的政治斗争，缠绵徘侧的儿女情长，并且结构上较上卷更为详略得当，疏密有致。作家擅于写帝王史实，对宫闲秘闻，分寸把握得当，特别是对宫庭斗争中微妙的人际关系，权谋机变，揣摩体味得玲拢剔透。　  《雍正皇帝（套装全3册）》是系列历史长篇小说《雍正皇帝》的第3卷。　  年羹尧赐死，隆科多圈禁，但八爷党余威未尽。王府密议，欲借铁帽子王逼雍正逊位；乾清宫内，唇枪舌战，风浪迭起。　  一边是赫赫天威，雍正严惩骨肉众兄弟，一边是缠绵缝绻，强留酷似旧情人的弟媳。是上天报应，抑或世事偶然，承欢什御却是天家骨血。乱伦之煎熬，丹药之蚀毁，亡灵之作祟，刚刚还抖擞精神，指点江山，转瞬却白虎玉免同赴大真。鼎丹烛影千古迷案，掩卷深思云遮雾隐。　  该卷是著名历史小说作家二月河先生系列历史长篇小说《雍正皇帝》的压轴之卷。作家在传统文化中浸润日久，不仅对三教九流，佛道掸儒谙熟于心，尤对帝王生涯，清宫史实颇有研究。他借助于自己对杰出的古典小说《红楼梦》的多年探讨，把传统小说的艺术手法与现代意识有机地结合起来，所以这部恢弘的历史画卷谋篇出神入化，布局呈大家气象，不仅描写了雍正后期紫禁城内错综复杂的政治斗争，而且展示了各地官吏之间的倾轧和无情争斗，以及文人命运的莫测和不幸。宫闱秘闻，市井风情，科举应试，秦楼酒肆，在作者的笔下均得到了淋漓尽致的表现。展卷品读，无疑是对雍、乾交替时期历史的一次艺术巡礼。', null, 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6riAA2NfAADrZu7V2cQ464.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6riAB-u0AADrZu7V2cQ985.jpg', 'http://192.168.21.158:8888/group1/M00/00/4A/wKgVnlxX6riACYqDAADrZu7V2cQ534.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:30', '15', '2019-02-04 15:33:14');
