INSERT INTO `yien_goods` VALUES ('6932', '113966545862111', '68', '施平小店', '柏林孤谍（1个人，对抗3个国家，他要回家）', '27', '40', '重庆', '2019-01-16 16:44:57', '十二个月', '2019-02-02 00:12:36', '', '　　1个人，对抗3个国家，他要回家！', '　　1949年，犹太作家亚力克斯因其社会主义信仰使他成为麦卡锡政治迫害的对象。面对驱逐出境与骨肉分离，他被迫与中情局定下协约——以在柏林搜集情报换取回美资格。', '　　然而，重新踏上柏林的那一刻事情便走向失控边缘——中情局接线人制造的绑架案，致使东德特工被杀；他的特殊身份，又迫使他成为德共线人；更令他没想到的是，他真正的任务是监视独一爱过的女人艾琳。亚力克斯于不知不觉间深陷绝境，要在世界危险的间谍战场扮演双面线人。', 'https://img12.360buyimg.com/n1/jfs/t3193/264/954242201/432137/d13ac56b/57c3a1e3N46565082.jpg', '', 'https://img12.360buyimg.com/n1/jfs/t3193/264/954242201/432137/d13ac56b/57c3a1e3N46565082.jpg', '6', 'selling_now', '2019-01-16 16:44:57', '2019-02-02 00:12:36', '52', '2019-02-02 00:12:36');
