INSERT INTO `yien_goods` VALUES ('6941', '113970522693830', '58', '陶云小店', '我辈孤雏/2017年诺贝尔文学奖获得者石黑一雄作品  [When We Were Orphans]', '36', '46', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:27', '2017诺贝尔文学奖得主石黑一雄作品，入围“布克奖”短名单；以惊叹的历史细节把握再现了20世纪上半叶的老上海滩；“记忆、时间与自我欺骗”的又一杰作；对人心精准的把握，波澜不惊的表象下蕴藏着的情感力量。', '　　《我辈孤雏》是诺贝尔文学奖得主石黑一雄的第五部长篇小说，首次出版于2000年。　　英国伦敦，1930年代。年少得志的克里斯托弗·班克斯是全英国闻名遐迩的大侦探，他的破案传奇早已在伦敦社交圈中口口相传。然而，多年来，一桩未解的悬案却久久地在名侦探的心头挥之不去，那便是儿时他生身父母在旧上海滩的离奇失踪案。“追逐着父母消逝的暗影”，我们的主人公从纸醉金迷的伦敦上流社会一路寻觅，最终回到了侵华日军炮口下的上海。这绝非一次温存的归乡。在这座曾经车水马龙，如今遍地狼烟的城市中，等待着他的是一个黑暗的秘密，一个残酷的真相，而他那福尔摩斯式的童话人生也将如同他的儿时故乡一样，化作一片废墟……', '', '', 'http://192.168.21.158:8888/group1/M00/00/4B/wKgVnlxX6rqAGNb1AAFm7zUBLrQ503.jpg', 'http://192.168.21.158:8888/group1/M00/00/4B/wKgVnlxX6rqAffeCAAFm7zUBLrQ593.jpg', 'http://192.168.21.158:8888/group1/M00/00/4B/wKgVnlxX6rqAPObxAAFm7zUBLrQ196.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:27', '8', '2019-02-04 15:33:17');
