INSERT INTO `yien_goods` VALUES ('6945', '113970116460451', '14', '闻人小店', '余华：第七天（2018版）', '25', '40', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:34', '比《活着》更绝望，比《兄弟》更荒诞，获华语文学传媒大奖·年度杰出作家', '《第七天》是余华的zuixin长篇小说，讲述了一个普通人死后的七日见闻：叫杨飞的人死去了，但他的灵魂似乎还没走远，他接到一通电话，殡仪馆的人抱怨他火化迟到，而即将被火化的竟是杨飞自己……他在去殡仪馆的路上经历了一系列光怪陆离的事件，以及与生前亲友的爱恨离别。生活的不易、爱情的曲折、亲情的温暖……让活着的人无从找寻出口，只能在死后的世界里得到和解与救赎。余华用拙朴简白的手法写出了深沉的悲痛和感人的温情，写尽了中国人的善良与悲哀。', '', '', 'http://192.168.21.158:8888/group1/M00/00/4B/wKgVnlxX6ruABFVDAAGv7u3D-ts384.jpg', 'http://192.168.21.158:8888/group1/M00/00/4B/wKgVnlxX6ruAHoioAAGv7u3D-ts615.jpg', 'http://192.168.21.158:8888/group1/M00/00/4B/wKgVnlxX6ruARS4AAAGv7u3D-ts622.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:34', '5', '2019-02-04 15:33:18');
