INSERT INTO `yien_goods` VALUES ('6948', '113967296869191', '13', '施冬小店', '阿加莎·克里斯蒂作品43:波洛圣诞探案记', '24', '32', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:26', '圣诞节期间和平、友好，却“有很多伪善的东西”', '　　对于自己在南非的发家之路以及手边留有一堆未经切割的钻石，老西米恩·李一直引以为傲，更不用说他哄起女人来确实有一手。可到了风烛残年的岁数，他在病痛中想到的消遣方式，便是借着过圣诞节的机会，把四散各处的儿子们叫回身边，挨个儿数落。当然，他也没忘了提及修改遗嘱——挑起家人之间的猜忌是多么有趣的事！', '　　圣诞前夜，李家笼罩在不祥的气氛中，一声惨叫，老西米恩死在自己的卧室中。呈密室状态的现场，家里每个人都有作案的可能，面对如此棘手的案子，大侦探波洛也不得不度过一个并不轻松的圣诞节了……', '', 'https://img13.360buyimg.com/n1/jfs/t1969/125/2122741681/250185/27b43b47/569c467fN26172384.jpg', '', 'https://img13.360buyimg.com/n1/jfs/t1969/125/2122741681/250185/27b43b47/569c467fN26172384.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:26', '57', '2019-02-02 00:12:26');
