INSERT INTO `yien_goods` VALUES ('6955', '113969242193924', '17', '吕槐小店', '三国志异（线装 附赠《三国演义》清代大魁堂刻本绣像图复刻珍藏卡牌）', '40', '55', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:41', '', '三国正史人物，在《三国志》出场，到《三国演义》里是一番模样，再经由明清两朝戏剧将许多人物脸谱化深入人心。及至二次元，动漫、游戏、卡牌、古风小说轮番改编，终于到了如今的地步。', '老话说，从前评书艺人里说三国的，一百人里不过一二。因三国人物超过四百个，跨度长，战役多，情节复杂，还有无数诗词歌赋、书信文章、历史典故、成语名句。寻常人拿不起来。所以说三国是很考校水平的事。著名知识青年张佳玮从2013年起断断续续在知乎、豆瓣、大家等平台上自由自在地写三国冷知识，zui终从中筛选出二十八篇zui下功夫的评述解读。', null, 'http://192.168.21.158:8888/group1/M00/00/4B/wKgVnlxX6r2ACZaWAADlxvp0Y3s985.jpg', 'http://192.168.21.158:8888/group1/M00/00/4B/wKgVnlxX6r2AR5tOAADlxvp0Y3s945.jpg', 'http://192.168.21.158:8888/group1/M00/00/4B/wKgVnlxX6r2AYzbEAADlxvp0Y3s936.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:41', '9', '2019-02-04 15:33:19');
