INSERT INTO `yien_goods` VALUES ('6990', '113968207044939', '91', '韩云小店', '大秦帝国（全新修订版）（套装共11册）', '346', '598', '重庆', '2019-01-16 16:44:58', '十二个月', '2019-02-02 00:12:31', '升级修订，作者定本，央视热播剧原著小说，南怀瑾、二月河等热忱推荐！', '', '　　全新修订版《大秦帝国》洋洋五百万言，六部十一卷，将战国后期齐、楚、燕、秦、韩、赵、魏七国群雄并起的历史苍劲地铺展开来，描绘了近200年的战国风云与帝国生灭。　　在礼崩乐坏，群雄逐鹿的战国末年，面临亡国之祸的秦国于列强环伺之下，崛起于铁血竞争的群雄列强之林。从秦孝公开始，筚路蓝缕、彻底变革、崇尚法制、统一政令，历一百六十余年六代领袖坚定不移地努力追求，才完成了一场伟大的帝国革命，扫六合而一统天下，建立起一个强大统一的帝国。　　《大秦帝国（全新修订版）》共分为六部《黑色裂变》《国命纵横》《金戈铁马》《阳谋春秋》《铁血文明》《帝国烽烟》。这部鸿篇巨著还原了巨大的历史落差与戏剧性的帝国命运，再现了一个国家一步步实现自己梦想的悲壮历程。书中每一行每一页都充满着智慧方略、阳谋政治的风骨，奋发惕励、强势生存的精神，充满着来自中国原生文明时代的英雄风骨与本色灵魂。　　全新修订版《大秦帝国》为作者孙皓晖创作十年来首次亲自全面修订，历时半年多。对原书知识性的错误与模糊，以及未被发现的笔误，进行了全面纠错；对原来靠拢通俗话本的某些写法，进行了文风的校正；新版《大秦帝国》的历史知识进一步精确化明晰化，叙事文风进一步整肃化厚重化。除此以外，新版《大秦帝国》还重新校定绘制了所有地图；对整体装帧进行了全面调整。', null, 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sOASaucAAAsw20rFvc747.jpg', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sOAEoclAAAsw20rFvc107.jpg', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sOAAja3AAAsw20rFvc541.jpg', '6', 'selling_now', '2019-01-16 16:44:58', '2019-02-02 00:12:31', '62', '2019-02-04 15:33:25');
INSERT INTO `yien_goods` VALUES ('6991', '113971411542621', '5', '诸葛小店', '朝圣', '34', '45', '重庆', '2019-01-16 16:45:02', '十二个月', '2019-02-02 00:12:33', '', '《朝圣》被誉为《牧羊少年奇幻之旅》的前传，是保罗·柯艾略徒步近六百公里的朝圣实录。', '圣地亚哥之路，中世纪的苦行朝圣之路。一九八六年，保罗·柯艾略踏上朝圣之旅，历时三个月，徒步近六百公里。朝圣之路点亮了灵感之光，也成为柯艾略找寻自己道路的预言。一九八七年，《朝圣》问世，开启了“牧羊少年奇幻之旅”，也挖掘了人类灵魂探寻的深度。', '你愿意相信生本身就是奇迹，奇迹才会降临于你。《牧羊少年奇幻之旅》令我们拥有梦想，《朝圣》带领我们找到通达梦想的路。', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sOAEDvKAACT1xu0Jiw913.jpg', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sOAMRb2AACT1xu0Jiw365.jpg', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sOADMHFAACT1xu0Jiw979.jpg', '6', 'selling_now', '2019-01-16 16:45:02', '2019-02-02 00:12:33', '1', '2019-02-04 15:33:25');
INSERT INTO `yien_goods` VALUES ('6992', '113970935454382', '59', '韩海小店', '诺贝尔经典文学：荒原狼', '23', '36', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:35', '那些值得热爱一辈子的诺贝尔文学奖经典作品 我们不能选择怎么生，怎么死，但我们能决定怎么爱，怎么活。', '本书是一本诗意哲理交相辉映的伟大小说，作者以摄人心魄的笔法描述一个人如何冒着生命全面崩溃的危险，经历种种生命中的折磨，追索人类存在的意义的故事。小说幻想色彩浓郁，象征意味深远，被著名作家托马斯·曼誉为“德国的《尤利西斯》”。', '', '', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sOAJWAMAAEpgbEdBww049.jpg', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sOAVIeKAAEpgbEdBww497.jpg', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sSAWBpaAAEpgbEdBww453.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:35', '76', '2019-02-04 15:33:26');
