INSERT INTO `yien_goods` VALUES ('6999', '113969866854998', '22', '王觅小店', '兄弟（新版）', '33', '49', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:41', '中国享誉世界的作家之一，他的作品成了当代中国的典范。世界华文“冰心文学奖”，入选香港《亚洲周刊》评选的“20世纪中文小说百年百强”、中国百位批评家和文学编辑评选的“20世纪具有影响的10部作品”等', '这是两个时代相遇以后出生的小说，前一个是文化大革命中的故事，那是一个精神狂热、本能压抑和命运惨烈的时代，相当于欧洲的中世纪；后一个是现在的故事，那是一个伦理颠覆、浮躁纵欲和众生万象的时代，更甚于今天的欧洲。一个西方人活四百年才能经历这样两个天壤之别的时代，一个中国人只需四十年就经历了。四百年间的动荡万变浓缩在了四十年之中，这是弥足珍贵的经历。连结这两个时代的纽带就是这兄弟两人，他们的生活在裂变中裂变，他们的悲喜在爆发中爆发，他们的命运和这两个时代一样地天翻地覆，最终他们必须恩怨交集地自食其果。', '', '', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sWAAV1ZAABh_3qLqYE510.jpg', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sWAOZQ0AABh_3qLqYE174.jpg', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6sWAGkBzAABh_3qLqYE095.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:41', '74', '2019-02-04 15:33:27');
