INSERT INTO `yien_goods` VALUES ('7003', '113970193796657', '37', '赫连小店', '豆树青青', '39', '50', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:42', '', '《豆树青青》内容简介：如果说这世界上有什么东西是泰勒不想要的，那便是早早结婚生子的命运。可就在离家途中，有人硬塞了一个小女孩给她，她迷迷糊糊，背起了这个“累赘”。', '露安觉得生活会自然而然地从容演变，她无需做任何筹划。可忽然有一个下午，丈夫搬空了半个家，不告而别。她茫茫然继续过她的万圣节。', '两个对未来没有把握的姑娘，在机缘巧合下成为室友……', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6saAcGDkAAETC379ymM413.jpg', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6saAdUxhAAETC379ymM325.jpg', 'http://192.168.21.158:8888/group1/M00/00/4C/wKgVnlxX6saAYzRfAAETC379ymM837.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:42', '87', '2019-02-04 15:33:28');
