INSERT INTO `yien_goods` VALUES ('7012', '113970498131370', '70', '上官小店', '教父三部曲精装典藏版（《教父》是男人的哲学，是智慧的总和，是一切问题的答案）（套装共3册）', '165', '270', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:42', '载入美国出版史的重磅畅销书！《教父》三部曲全新精装典藏版。《教父》是男人的哲学，是智慧的总和，是一切问题的答案。随书附赠3册精美“教父语录”日程本！读客出品。', '《教父》', '教父的世界里，友谊，是通行的货币；忠诚，是上好的礼物；缄默，是必守的规则。', '他藐视一切价值，不给警告，不虚张声势，不留余地。', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6seAGQzoAAGdQyITbi8779.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6seABRD-AAGdQyITbi8855.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6seATspfAAGdQyITbi8590.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:42', '54', '2019-02-04 15:33:30');
INSERT INTO `yien_goods` VALUES ('7013', '113968538585252', '62', '戚平小店', '大明王朝（1566 套装上下册）', '65', '88', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:26', '', '刘和平，著名剧作家、小说家、历史学者。祖籍湖南邵东，生于湖南衡阳，长期从事历史学研究，舞台剧、电视剧和小说创作，曾任南开大学中国思想政治史研究中心兼职教授、北京大学产业与文化研究所研究员、副理事长。现任中国电视剧编剧工作委员会常务副会长兼专家学术委员会主任。其编剧创作的电视剧《雍正王朝》《北平无战事》，囊括了包括“飞天奖”“金鹰奖”及“白玉兰奖”在内的各种编剧奖，后者更为业界视为史诗级的巨作。其编剧创作的电视剧《大明王朝1566》，被历史学界认可为是“对历史学的研究和阐述已达到史学研究的前沿”，更被众多业内外人士称为“中国电视剧历史剧高峰之作”。', '　　《大明王朝（1566 套装上下册）》展现的是中国封建史上社会矛盾空前尖锐的时代，土地兼并使得大量的农民失去了赖以生存的基础，贪墨横行使得大明王朝的统治濒临崩溃。全书以“扳倒严嵩”为主要线索，全面展现了这一时期的一幅幅历史画面：从朝廷到各级官府惊心动魄的政治斗争，从官场到商场波谲云诡的尔虞我诈，忠勇的官兵和忠义的百姓风起云涌的抗倭之战；国与家命运的休戚与共，敌和友关系的错综变化，大情大我和小情小我的矛盾交织在这里，折射出历史深处的伟大理想和人生命运的严酷现实。一批赫赫有名的历史人物——海瑞、嘉靖、严嵩、严世藩、徐阶、高拱、张居正、胡宗宪、戚继光、李时珍等，从历史如烟的迷雾中有血有肉地向大家清晰地走来。', null, 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6siAFqrYAAGa8Utv9JU053.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6siALkNjAAGa8Utv9JU524.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6siATy4iAAGa8Utv9JU122.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:26', '91', '2019-02-04 15:33:30');
