INSERT INTO `yien_goods` VALUES ('7022', '113970844570143', '26', '金雪小店', '檀香刑 (莫言作品全编）', '31', '45', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:39', '2017定稿版，诺贝尔文学奖获得者莫言亲认。以清末酷刑挑战阅读神经，内附精美插页、书签。', '《檀香刑》一开腔，就把读者拉进了莫言独特的叙述世界里：荡气回肠的“猫腔”大戏，“凤头-猪肚-豹尾”的传统讲述方式，“说书人”天马行空的想象，“高密东北乡”的奇人异事。面对这个色彩斑斓的叙述世界，有人读后惊悚万分、心有余悸，有人拍案叫绝、大呼过瘾，亦有人远观而却步……', '', '', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6smAQs-EAAFSL1WRSvw754.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6smAI2XJAAFSL1WRSvw595.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6smAZni2AAFSL1WRSvw479.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:39', '11', '2019-02-04 15:33:31');
