INSERT INTO `yien_goods` VALUES ('7026', '113969421467895', '31', '陶冰小店', '蔡东藩历朝通俗演义（全21册）', '472', '598', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:26', '', '在《蔡东藩历朝通俗演义》创作100周年之际，中华书局推出了《蔡东藩历朝通俗演义》双色绣像典藏本。中华版《蔡东藩历朝通俗演义》由中华书局总经理徐俊先生亲笔题写每一册的书名。可以说，这是一套有着中华书局鲜明特色的《蔡东藩历朝通俗演义》。', '蔡东藩（1877-1945），名郕，字椿寿，号东藩，著作署名亦作东帆或东颿，是中国近现代著名历史演义小说家和史学家，他被称为“中国近现代历史小说史上‘正史演义’创作的集大成者”。        蔡东藩历十年寒暑，用600余万言的煌煌巨著，记述了上起秦始皇、下迄民国（1920年）的2166年间中国发生的重大历史事件和重要历史人物。他创作的“历朝通俗演义”按著述时序为《清史演义》（1916年）、《元史演义》（1920年）、《明史演义》（1920年）、《民国演义》（1921年）、《宋史演义》（1922年）、《唐史演义》（1922年）、《五代史演义》（1923年）、《南北史演义》（1924年）、《两晋演义》（1924年）、《前汉演义》（1925年）、《后汉演义》（1926年）。以上11部书初版由上海会文堂新记书局印行，全套均为有光纸石印插图本。1935年该书局把这套书连同许廑父续写的《民国演义》后四十回，全部改排为铅印本再次出版，分装44册，总书名为“古今通俗演义”。', null, 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6smAIea2AACOMW6qUuI663.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6smAZ5V4AACOMW6qUuI170.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6smAc-QKAACOMW6qUuI839.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:26', '78', '2019-02-04 15:33:32');
