INSERT INTO `yien_goods` VALUES ('7028', '962168525260330', '60', '沈筠小店', '厨房用品用具小百货调料架调味罐多功能置物架收纳神器碗架沥水架 n型调味料架+刀架筷筒+砧板架 [绿 双盘]', '120', '142', '成都', '2019-01-23 22:26:20', '九个月', '2019-02-02 00:12:53', '商品名称：厨房用品用具小百货调料架调味罐多功能置物架收纳神器碗架沥水架 n型调味料架+刀架筷筒+砧板架 [绿 双盘]null', 'https://misc.360buyimg.com/lib/img/e/blank.gif', null, null, 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6sqAf2SuAAElLIquPf0996.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6sqAZ98yAAF3keyoYrA762.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6sqABAAEAAFljKiwMGI571.jpg', '8', 'selling_now', '2019-01-23 22:26:20', '2019-02-02 00:12:53', '44', '2019-02-04 15:33:32');
INSERT INTO `yien_goods` VALUES ('7029', '113969524712025', '41', '尤曼小店', '粉墨春秋', '56', '70', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:32', '', '　　在我的认识中，汪精卫在本质上应该是一位诗人，不幸这位诗人一开始便走上“烈士”的道路，因而终生陷进了权力的世界。这样一来，他个人的悲剧便注定了。', '　　高阳，1926-1992年，本名许晏骈，浙江杭州人。当代知名度最高的历史小说家之一，也是著名的“红学”专家。“有井水处有金庸，有村镇处有高阳”，高阳之誉满华人社会，由此可见一斑。高阳的文笔冷静而客观，对小说情节创作与现实间的关联相当考究，以考证入小说，以小说成考证，绝非虚言。至于人物性格的描述也是层层细腻叙写，如现在前。高阳的作品不仅在质的方面获得肯定，量的成绩更是惊人。代表作有《胡雪岩》《慈禧全传》《红顶商人》《粉墨春秋》等，一生著作凡九十余部。', null, 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6sqAFhXZAAF4TUNcFrw118.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6sqADqUnAAF4TUNcFrw117.jpg', 'http://192.168.21.158:8888/group1/M00/00/4D/wKgVnlxX6sqADT4YAAF4TUNcFrw875.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:32', '90', '2019-02-04 15:33:33');
