INSERT INTO `yien_goods` VALUES ('7038', '113969761918489', '22', '王觅小店', '月亮与六便士（未删减足本，毛姆经典著作，毛姆故居典藏版本，豆瓣高分推荐！）', '31', '50', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:33', '20世纪英国风云小说家经典代表作，平庸生活的告别书！毛姆三大代表作之一，马尔克斯、奥威尔、伍尔芙、张爱玲、村上春树、王安忆、冯唐、曹文轩等人一致推荐', '　  一个英国证券交易所的经纪人，本已有牢靠的职业和地位、美满的家庭，但却迷恋上绘画，像“被魔鬼附了体”，突然弃家出走，到巴黎去追求绘画的理想。他的行径没有人能够理解。他在异国不仅肉体受着贫穷和饥饿煎熬，而且为了寻找表现手法，精神亦在忍受痛苦折磨。经过一番离奇的遭遇后，主人公*后离开文明世界，远遁到与世隔绝的塔希提岛上。他终于找到灵魂的宁静和适合自己艺术气质的氛围。他同一个土著女子同居，创作出一幅又一幅使后世震惊的杰作。在他染上麻风病双目失明之前，曾在自己住房四壁画了一幅表现伊甸园的伟大作品。但在逝世之前，他却命令土著女子在他死后把这幅画作付之一炬。通过这样一个一心追求艺术、不通人性世故的怪才，毛姆探索了艺术的产生与本质、个性与天才的关系、艺术家与社会的矛盾等等引人深思的问题。同时这本书也引发了人们对摆脱世俗束缚逃离世俗社会寻找心灵家园这一话题的思考，而关于南太平洋小岛的自然民风的描写也引人向往。　　《月亮和六便士》说问世后，以情节入胜、文字深刻在文坛轰动一时，人们争相传看。在小说中，毛姆用*一人称的叙述手法，借“我”之口，叙述整个故事，有人认为这篇小说的原型是法国印象派画家高更，这更增加了它的传奇色彩，受到了*世界读者的关注。', '', '', 'http://192.168.21.158:8888/group1/M00/00/4E/wKgVnlxX6s2ASpzWAADkSD1JErg323.jpg', 'http://192.168.21.158:8888/group1/M00/00/4E/wKgVnlxX6s2AAZU7AADkSD1JErg262.jpg', 'http://192.168.21.158:8888/group1/M00/00/4E/wKgVnlxX6s2Ab93SAADkSD1JErg520.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:33', '97', '2019-02-04 15:33:35');
