INSERT INTO `yien_goods` VALUES ('7044', '113965231890084', '33', '夏侯小店', '周浩晖悬疑经典：刑警罗飞系列 套装共6册（就是他！轰动欧美的中国悬疑作家）', '197', '272', '重庆', '2019-01-16 16:44:55', '十二个月', '2019-02-02 00:12:34', '《暗黑者》作者周浩晖悬疑经典，《纽约时报》《华尔街日报》《参考消息》等海内外媒体重磅推荐！《邪恶催眠师》同名影视火热制作中！读客出品。', '《周浩晖悬疑经典》囊括了周浩晖4部经典作品：《凶画》《鬼望坡》《摄魂谷》和《邪恶催眠师三部曲》。', '《凶画》刑警罗飞系列第一部长篇小说，曾获得2005年网络BBS原创推理小说大赛一等奖，再现暴风雪山庄模式，演绎置之死地而后生的惊险。', '《鬼望坡》“刑警罗飞”系列第二部作品，讲述罗飞将帮助一位失忆的少年为探寻身世之谜，踏上一座神秘岛屿，走近那诡谲的地带——鬼望坡！海上孤岛连环凶案，破解跨越十八年的悲欢离合。', 'http://192.168.21.158:8888/group1/M00/00/4E/wKgVnlxX6s6ATzbxAAH8guFNLBw285.jpg', 'http://192.168.21.158:8888/group1/M00/00/4E/wKgVnlxX6s6AcbB-AAFozcuI5eQ612.jpg', 'http://192.168.21.158:8888/group1/M00/00/4E/wKgVnlxX6s6AKitRAAH8guFNLBw057.jpg', '6', 'selling_now', '2019-01-16 16:44:55', '2019-02-02 00:12:34', '16', '2019-02-04 15:33:36');
INSERT INTO `yien_goods` VALUES ('7045', '113969942926109', '86', '喻巧小店', '白鹿原', '32', '45', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:27', '1993年原版再现，未删节，中国当代文学扛鼎之作，人民文学出版社出版，张嘉译、何冰、雷佳音主演同名电视剧点击量破60亿，特别收录陈忠实珍贵生活照片及《白鹿原》创作札记', '陈忠实（1942-2016） 生于西安市灞桥区。1965年初发表散文处女作，1979年加入中国作家协会。作品《信任》获1979年全国短篇小说奖，《渭北高原，关于一个人的记忆》获1990-1991全国报告文学奖，长篇小说《白鹿原》获第四届茅盾文学奖（1998）。曾任中国作家协会副主席、陕西省作协主席、陕西省作协名誉主席。', '', '', 'http://192.168.21.158:8888/group1/M00/00/4E/wKgVnlxX6s6AQD8JAAGB8-ebpls540.jpg', 'http://192.168.21.158:8888/group1/M00/00/4E/wKgVnlxX6s6AI02xAAGB8-ebpls086.jpg', 'http://192.168.21.158:8888/group1/M00/00/4E/wKgVnlxX6s6AQWOfAAGB8-ebpls030.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:27', '95', '2019-02-04 15:33:37');
