INSERT INTO `yien_goods` VALUES ('7078', '113970458840493', '24', '周翠小店', '黄金时代', '26', '35', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:38', '王小波代表作，逝世二十周年精装纪念版！李银河亲自作序纪念！特别收入珍贵手稿！——“写出《黄金时代》之前，我从未觉得自己写得好。”', '写出《黄金时代》之前，我从未觉得自己写得好。——王小波', '本书收入王小波颇负盛名的三篇小说《黄金时代》《三十而立》《似水流年》，其中《黄金时代》获第13届《联合报》文学奖中篇小说大奖！故事以上世纪七八十年代为背景，正面书写对“性爱”“自由”的追求，反思人的生存现状，并彰显了人性中的自由与本真。王小波说：“写《黄金时代》用了我很多时间和才华，写得很精致，倾注了我对小说的许多想法。”', '', 'http://192.168.21.158:8888/group1/M00/00/4F/wKgVnlxX6tSAHRE2AADudvOCkQc133.jpg', 'http://192.168.21.158:8888/group1/M00/00/4F/wKgVnlxX6tSACDaAAADudvOCkQc789.jpg', 'http://192.168.21.158:8888/group1/M00/00/4F/wKgVnlxX6tSAZfvgAADudvOCkQc464.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:38', '96', '2019-02-04 15:33:43');
