INSERT INTO `yien_goods` VALUES ('7111', '113968334297644', '19', '孔恨小店', '胡雪岩/长篇历史小说经典书系', '27', '45', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:39', '', '　　二月河沉寂数年后，与著名作家薛家柱强强联手的又一力作。以作者惯有的历史小说笔法全新演绎红顶商人胡雪岩从无到有、从小到大的经商之道。既展现了晚清官场的波诡云谲、政治的风云变幻，也展示了胡雪岩纵横驰骋、玩转政商两界的智慧谋略。本书将胡雪岩由“神”还原成了有血有肉的人，对当代的商人、商事有极大的借鉴意义！', '　　二月河继《康熙大帝》《雍正皇帝》《乾隆皇帝》之后再度出山。　　与著名作家薛家柱强强联手，历经数年写就四十万字巨著。　　以独到的眼光重新诠释胡雪岩辉煌又充满悲剧色彩的一生。　　刚一出炉便以数万美元高价卖出台湾版权。', null, 'http://192.168.21.158:8888/group1/M00/00/50/wKgVnlxX6tuAPpwbAACgGlvJKh0947.jpg', 'http://192.168.21.158:8888/group1/M00/00/50/wKgVnlxX6tuASZbiAACgGlvJKh0488.jpg', 'http://192.168.21.158:8888/group1/M00/00/50/wKgVnlxX6tuAKPBsAACgGlvJKh0462.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:39', '90', '2019-02-04 15:33:49');
