INSERT INTO `yien_goods` VALUES ('7152', '113971374685743', '84', '蒋灵小店', '那不勒斯的萤火', '26', '42', '重庆', '2019-01-16 16:45:02', '十二个月', '2019-02-02 00:12:25', '那不勒斯的萤火（被誉为欧美文坛近十年来的“灯塔”巨作，跟《追风筝的人》《阿甘正传》一样震撼灵魂、给人力量。每个人的孤独背后，都印着另一个人的名字。随书附赠精美书签）', '在那不勒斯有这么一群人，他们代表着这片地区ZUI强大的生命力，却默默无闻，被这座城市的黑暗淹没，迷失在无为的生活里。也有那么一些人，他们无视绚丽的霓虹，在这片黑暗中追寻着希望的萤火。', '马尔切罗是银行职员的儿子，性格乖顺温和，一次偶然，使他的人生与黑手党的儿子利奥有了交集。利奥桀骜、叛逆、无畏而又自由，他们彼此吸引着，一起度过了美好的童年。然而在利奥十六岁那年，父亲在一次追杀中丧命，利奥和马尔切罗也开始渐行渐远。马尔切罗逐渐成长为一个优秀的少年，利奥则开始了抢劫、贩毒的浑噩生活，仿佛在一步步沿着父亲的轨迹走下去。', '三年后，利奥离开了那不勒斯去往美国，在那里娶妻生子，生活渐渐恢复正常。此时的马尔切罗也一步步按照计划好的人生平顺地生活着，他们的人生好似再没了交集。然而一通电话，利奥再次回到那不勒斯，并意外开始了长达十二年的囚徒生活，而马尔切罗看似风光优秀的人生也是暗潮涌动……', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uOAVEpjAAE-ZmxR5U4836.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uOACIA8AAE-ZmxR5U4927.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uOANHKGAAE-ZmxR5U4149.jpg', '6', 'selling_now', '2019-01-16 16:45:02', '2019-02-02 00:12:25', '42', '2019-02-04 15:33:57');
