INSERT INTO `yien_goods` VALUES ('7157', '113968307281326', '72', '卫蕾小店', '大唐狄公案（套装1-6册）', '217', '316', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:39', '东方推理殿堂级世纪小说！风靡全球100年的大唐神探狄仁杰，从这旷世巨著中诞生！', '东方推理殿堂级世纪小说！一个极真实、残酷、神秘莫测的推理盛唐！', '东方推理殿堂级世纪小说！', null, 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSAOhqxAAKdptC-bfA201.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSASJzcAAKdptC-bfA723.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSAEs82AAKdptC-bfA362.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:39', '39', '2019-02-04 15:33:58');
INSERT INTO `yien_goods` VALUES ('7158', '113970168024955', '20', '施凌小店', '喧哗与骚动', '63', '88', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:25', '诺贝尔文学奖得主威廉·福克纳代表杰作，博尔赫斯、萨特、加缪、马尔克斯、大江健三郎、库切等大师的偶像！随书附赠阅读指南卡片，正文14种颜色标注复杂叙事结构，带来奇妙阅读体验的珍藏读本。果麦文化 出品', '　　康普逊家族是杰弗逊镇名门，祖上曾经担任过州长和将军，但到了杰森·康普逊这一代已经没落。康普逊夫妇育有三儿一女，但两人感情并不美满。二女儿小卡自幼任性，以至于未婚先孕。长兄昆汀从小迷恋自己的妹妹，受小卡的失贞和婚姻刺激，他在哈佛读书期间沉河自杀。昆汀的自杀给原本就因为小卡而郁郁寡欢的康普逊先生造成了沉重的打击，他很快与世长辞，于是三儿子杰森成了一家之长。杰森性情孤僻，才干平庸，贪婪的本性让他最终举步维艰。小儿子本杰明是智力障碍症患者，唯有姐姐小卡和黑人女佣狄尔希给过他真正的关怀。', '', '', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSAdzTDAAEEy5CWp2o936.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSAD4OBAAEEy5CWp2o765.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSAMEI3AAEEy5CWp2o928.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:25', '34', '2019-02-04 15:33:58');
INSERT INTO `yien_goods` VALUES ('7159', '113970703289061', '94', '陈萱小店', '寻找时间的人（系列套装`全3册)', '77', '112', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:39', '', '一桩多年前的家族隐私引起了吉吉的好奇心，但留给少年探寻的时间并不多，因为时间似乎正以不可思议的速度从我们的世界流出，于是为了满足妈妈的心愿，也为了弄清困扰自己的家族秘密，吉吉在安妮的带领下来到了永恒之地，和一个出色的小提琴手、一只受伤的狗，一起踏上只属于他的奇幻旅程。', '', '时间慢慢远去，吉吉的两个儿子已经长大，他和妻子也在年老时去往了永恒之地。这时一场巨大灾难突然降临地球。暴雨肆虐，家园被毁，田埂荒芜。迁移到永恒之地，成了人类仅有的希望。吉吉的大儿子唐纳尔想护送幸存者前往永恒之地；小儿子艾登却似乎另有计划。就在兄弟两人相持不下之际，神秘少年帕普的出现打破了僵局，他在阴差阳错下肩负起带领人类寻找永恒之地的重任。帕普能否快速成长起来，完成这项任务？而在时间膜另一端，又有怎样的命运在等待着人类？', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSAfyzoAAE44lBaoj8540.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSAXGL_AAE44lBaoj8750.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSAfMS6AAE44lBaoj8629.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:39', '90', '2019-02-04 15:33:58');
INSERT INTO `yien_goods` VALUES ('7160', '113969101003139', '63', '公羊小店', '高阳版〈胡雪岩全传〉6', '43', '60', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:33', '讲透一代商圣胡雪岩的天才与宿命，影响中国一代企业家的经典。马云读了两遍，强烈推荐！胡雪岩传记小说至高经典，其他版本大多是这套书的删减版或改编版。“有井水处有金庸，有村镇处有高阳。”读客出品。', '　　高阳版《胡雪岩全传》出版40年来，一直被视为胡雪岩研究的至高经典，是商人必备的生存手册。', '◆轻松有趣，扎实有力，锁定读客“这本史书真好看文库”！', null, 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSAQc-WAAED_Q5qUNA638.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSAIsn2AAED_Q5qUNA901.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uSABDWpAAED_Q5qUNA584.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:33', '97', '2019-02-04 15:33:59');
