INSERT INTO `yien_goods` VALUES ('7165', '113968380645375', '10', '赵兰小店', '大秦帝国点评本（京东特别收藏版 含收藏证）', '336', '598', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:26', '央视一套热播剧原著小说；点评、注释、精美插图本，荣获中宣部“五个一工程”入选作品奖，畅销长篇历史小说。南怀瑾、二月河亲切推荐', '　　孙皓晖，1949年生，生于陕西三原，曾任西北大学法律系教授，现任西北大学特聘教授、秦文明研究院院长。', '　　《大秦帝国》是一部多卷本的长篇历史小说，凡六部十一册，作家孙皓晖毕十六年之功，创作了煌煌五百万言。这部作品，与坊间流行的历史小说在艺术品质上是大异其趣的。作者以敢为天下先的艺术勇气和历史眼光，开宗明义地宣告了他的大秦史观：“大秦帝国是中国文明的正源”、“我对大秦帝国有着一种神圣的崇拜”。　　《大秦帝国》是一部描述秦兴亡生灭过程的长卷历史小说。秦帝国崛起于铁血竞争的群雄列强之际，建立了一个强大统一的帝国，开创了一个全新的铁器文明。但她只有十五年生命，像流星一闪，轰鸣而逝。这巨大的历史落差与戏剧性的帝国命运中，隐藏了难以计数的神奇故事以及伟人名士的悲欢离合。他们以或纤细、或壮美、或正气、或邪恶、或英雄、或平庸的个人命运奏成了这部历史交响乐。帝国所编织的社会文明框架及其所凝聚的文化传统，今天仍然规范着我们的生活，构成了中华民族的巨大精神支柱。秦帝国崛起于铁血竞争的群雄列强之林，包容裹挟了那个时代的刚健质朴、创新求实精神。她崇尚法制、彻底变革、努力建设、统一政令，历一百六十余年六代领袖坚定不移地努力追求，才完成了一场*伟大的帝国革命，建立起一个强大统一的帝国，开创了一个全新的铁器文明时代，使中国农业文明完成了伟大的历史转型。在这部堪称鸿篇巨制的艺术佳构中，作家力图艺术地再现，在礼崩乐坏，群雄逐鹿的战国末年，面临亡国之祸的秦国于列强环伺之下，从秦孝公开始，筚路蓝缕，变法图强，经过几代君臣的不懈努力，*终扫六合而一统天下的艰辛悲壮历程。全书共分为六部《黑色裂变》《国命纵横》《金戈铁马》《阳谋春秋》《铁血文明》《帝国烽烟》。', null, 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uWAa-GxAAD3D8L_4Xc453.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uWAQT8tAAD3D8L_4Xc373.jpg', 'http://192.168.21.158:8888/group1/M00/00/51/wKgVnlxX6uWAOVPAAAD3D8L_4Xc501.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:26', '50', '2019-02-04 15:34:00');
