INSERT INTO `yien_goods` VALUES ('7179', '113966300343937', '64', '魏青小店', '东野圭吾：名侦探的咒缚', '34', '45', '重庆', '2019-01-16 16:44:57', '十二个月', '2019-02-02 00:12:36', '东野圭吾奇幻长篇小说，用悬念写出人生的彷徨与抉择：刹那间，身份、记忆、城市都变了，我成了另一个人。我只能努力活下去。', '《名侦探的咒缚》是日本作家东野圭吾的奇幻长篇小说，就在刹那间，身份、记忆、城市都变了，我成了另一个人。我只能努力活下去。《名侦探的咒缚》也是东野圭吾对读者的真诚告白，这一次东野圭吾不再是对笔下人物生杀予夺的神，而是将自己毫无保留地呈现给读者，出人意料的结尾就像是他与读者的约定，也是给自己下的战书。', '《名侦探的咒缚》故事简介：太奇怪了！绕了半天竟然又回到了原点，我不禁脊背发凉。又不是初次来这个图书馆，怎么会迷路？书架间闪过一个人影，是个穿格子西装的男人。这下有救了！我慌忙追上去，他却瞬间消失了。天花板上不知何时垂下一架楼梯，我爬了上去，昏暗中只见一个白衣少女站在面前。“您就是侦探天下一先生吧？”她露出天真无邪的笑容，“我专程来接您。”侦探？我狐疑地接过她递来的照片，一时说不出话来——照片上的人身穿格子西装，和我长得一模一样。', '', 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6ueASDtLAAHdkymPZHE124.jpg', 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6ueAW1lUAAHDt7Cf3XQ781.jpg', 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6ueAJ-h0AAHdkymPZHE612.jpg', '6', 'selling_now', '2019-01-16 16:44:57', '2019-02-02 00:12:36', '10', '2019-02-04 15:34:02');
