INSERT INTO `yien_goods` VALUES ('7185', '113969061700161', '10', '赵兰小店', '源义经：镰仓战神', '40', '55', '重庆', '2019-01-16 16:44:59', '十二个月', '2019-02-02 00:12:33', '司马辽太郎再现日本名将、英雄人物源义经的绚丽人生, 连续再版40余年，日本销售800万册，中文繁体版畅销十余年.', '　　司马辽太郎，日本最受欢迎的大众文学巨匠。原名福田定一，因敬慕司马迁及其《史记》而改名。1943年毕业于大阪外国语学校蒙古语科，1946年进入京都新日本新闻社，两年后任产经新闻社记者，同时发表作品。1961年开始专职创作。', '　　他，容貌俊美，骁勇善战，为镰仓幕府的建立立下了汗马功劳，是日本家喻户晓的古代英雄。', null, 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6uiAPRBuAACf7ROK4UY309.jpg', 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6uiAbKfXAACf7ROK4UY742.jpg', 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6uiAJbX2AACf7ROK4UY183.jpg', '6', 'selling_now', '2019-01-16 16:44:59', '2019-02-02 00:12:33', '88', '2019-02-04 15:34:03');
INSERT INTO `yien_goods` VALUES ('7186', '113970754866908', '26', '金雪小店', '王小波：黑铁时代', '47', '63', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:27', '', '王小波小说、随笔未竞稿合集，收入《黑铁时代》《黑铁公寓》等未完成的小说作品，亦包括《白银时代》《寻找无双》等经典作品创作材料、写作笔记，以及题材罕见的对科学论文的眉批、自书简介、年谱等。其中，《一个愤世嫉俗的人》《海鬼》《大学四年级》等9篇根据手稿整理的未竞稿为SHOU次出版。本书充满了王小波作品中一以贯之的幻想与批判，清晰勾勒了王小波的创作版图，令读者得以一窥其日臻成熟的创作过程。', '', '', 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6umAOyy8AADzh9Nr3eQ173.jpg', 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6umAXcdoAADzh9Nr3eQ923.jpg', 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6umAUtrbAADzh9Nr3eQ936.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:27', '96', '2019-02-04 15:34:03');
