INSERT INTO `yien_goods` VALUES ('7200', '113969435122360', '38', '孔灵小店', '杨贵妃（日本文坛巨匠、芥川龙之介奖得主井上靖长篇历史小说代表作）', '34', '49', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:12:32', '谷崎润一郎奖入围作品；以大量史料和文献为基础，以丰沛的想象和细致的心理刻画， 重塑中国历史上这位饱受争议的传奇人物——杨贵妃生动笔墨再现了大唐帝国政治、社会，以及宫廷生活中的奢华与阴暗', '《杨贵妃》是二十世纪日本文坛巨匠井上靖继《天平之甍》《敦煌》《苍狼》之后，创作的又一部以中国历史为题材的长篇小说。在占有与杨贵妃有关的大量史料和文献的基础上，井上靖以丰沛的想象和细致的心理刻画，重塑了中国历史上这位一度深陷权力斗争漩涡，饱受争议的传奇人物形象。在作者笔下，杨贵妃既非荒淫误国的红颜祸水，也非无辜善良、忠贞不渝的女人，而是一个复杂鲜活的、有血有肉的真实个体。这是一部严格遵循史料记载，以编年体和纪传体糅合而成的作品。在描写杨贵妃悲剧性的波折命运的同时，也以生动笔墨再现了大唐帝国政治、社会，以及宫廷生活中的奢华与阴暗。', '日本文坛巨匠、芥川龙之介奖得主井上靖长篇历史小说代表作', null, 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6uuAK-c9AAEhf2SxlEQ387.jpg', 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6uuAA51oAAEhf2SxlEQ516.jpg', 'http://192.168.21.158:8888/group1/M00/00/52/wKgVnlxX6uuAADWFAAEhf2SxlEQ590.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:12:32', '58', '2019-02-04 15:34:05');
