INSERT INTO `yien_goods` VALUES ('7223', '113969473121145', '64', '魏青小店', '日本时代小说精选：风神之门', '40', '55', '重庆', '2019-01-16 16:45:00', '十二个月', '2019-02-02 00:08:12', '历史比动漫更精彩！ 胜过火影，战国史上令人热血沸腾的忍者传奇！', '?【日本】司马辽太郎 司马辽太郎（1923—1996），毕业于大阪外国语学校，原名福田定一，笔名取自“远不及司马迁”之意，代表作包括《龙马奔走》《燃烧吧！剑》《新选组血风录》《国盗物语》《丰臣家的人们》《坂上之云》等。司马辽太郎曾以《枭之城》夺得第42届直木奖，此后更有多部作品获奖，是当今日本大众类文学巨匠，也是日本受欢迎的国民级作家。', '他出身伊贺，如风般自由，一身本事只肯待价而沽；他出身甲贺，如磐石般顽固，认定主公便付出无悔的忠诚。他们明争暗斗，又惺惺相惜，双双拜服于真田家的六文钱大旗之下。然而等待着他们的敌人，却是那个全日本可怕的男人……', null, 'http://192.168.21.158:8888/group1/M00/00/53/wKgVnlxX6u-ARF_DAAHwBPpRaQA815.jpg', 'http://192.168.21.158:8888/group1/M00/00/53/wKgVnlxX6u-ANAJlAAHwBPpRaQA634.jpg', 'http://192.168.21.158:8888/group1/M00/00/53/wKgVnlxX6u-ADhr_AAHwBPpRaQA934.jpg', '6', 'selling_now', '2019-01-16 16:45:00', '2019-02-02 00:08:12', '41', '2019-02-04 15:34:09');
