INSERT INTO `yien_goods` VALUES ('7227', '113970792826595', '35', '万俟小店', '与你重逢', '27', '40', '重庆', '2019-01-16 16:45:01', '十二个月', '2019-02-02 00:12:39', '《偷影子的人》作者马克·李维浪漫之作，由爱而生的勇气，足以抵抗世间所有的孤独。', '旧金山医院的住院实习医生劳伦从车祸造成的漫长昏迷中活了过来，却对中间发生的所有事情失去了记忆。她模糊记得苏醒时有个人在病房守护着她，可之后却再也没有见到他的身影，而她身边的所有人都对此事绝口不提。  建筑设计师阿瑟结束了在巴黎的自我放逐之旅重回旧金山，朋友、工作等一切都恢复了原样。可只有一件事他始终无法释怀，他从不曾忘记劳伦。他曾经不惜一切代价要救活她，却在她活过来的一瞬间失去了她。  然而，命运似乎跟他们开了一个玩笑，这一次阿瑟遭遇车祸住院，换劳伦来挽救阿瑟的生命。这一次，他们能结束漫长的等待，找回彼此吗？', '', '', 'http://192.168.21.158:8888/group1/M00/00/53/wKgVnlxX6vCANIHkAAC3Yq08kYQ471.jpg', 'http://192.168.21.158:8888/group1/M00/00/53/wKgVnlxX6vCATbMaAAC3Yq08kYQ972.jpg', 'http://192.168.21.158:8888/group1/M00/00/53/wKgVnlxX6vCAAoTpAAC3Yq08kYQ036.jpg', '6', 'selling_now', '2019-01-16 16:45:01', '2019-02-02 00:12:39', '72', '2019-02-04 15:34:10');
