DROP TABLE IF EXISTS `yien_goods`;
CREATE TABLE `yien_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键，自增',
  `goods_id` varchar(33) DEFAULT NULL COMMENT '商品表的唯一索引',
  `goods_merchants_id` int(11) DEFAULT NULL COMMENT '商品对应的 商家的id',
  `goods_merchants_name` varchar(255) DEFAULT NULL COMMENT '商品对应的 商家的name',
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `goods_now_amount` decimal(17,0) DEFAULT NULL COMMENT '商品现在的价格',
  `goods_default_amount` decimal(17,0) DEFAULT NULL,
  `goods_prod_place` varchar(255) DEFAULT NULL COMMENT '商品的生产地',
  `goods_prod_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '商品的生产时间',
  `goods_shelf_life` varchar(20) DEFAULT NULL COMMENT '商品的保质时间',
  `goods_expir_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '商品的过期时间',
  `goods_desc` text COMMENT '商品的总体描述',
  `goods_detail1` text COMMENT '商品的细节1',
  `goods_detail2` text COMMENT '商品的细节2',
  `goods_detail3` text COMMENT '商品的细节3',
  `goods_image1` varchar(255) DEFAULT NULL COMMENT '商品的图片1',
  `goods_image2` varchar(255) DEFAULT NULL COMMENT '商品的图片2',
  `goods_image3` varchar(255) DEFAULT NULL COMMENT '商品的图片3',
  `goods_type_id` int(11) DEFAULT NULL COMMENT '商品所属类别的id',
  `goods_state` varchar(30) DEFAULT NULL COMMENT 'selling_will：准备开始销售；selling_now：正在销售；discontinued：已停售',
  `goods_sell_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '商品开始销售的时间',
  `goods_discontinued_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '商品停止销售的时间',
  `goods_inventory` int(11) DEFAULT NULL COMMENT '商品的库存',
  `raw_add_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '新增时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=7247 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

