  `bank_card_amount` decimal(17,0) unsigned zerofill DEFAULT NULL COMMENT '银行卡的余额',
  `bank_user_id` varchar(33) DEFAULT NULL COMMENT '对应的user对象',
  `raw_add_time` timestamp NULL DEFAULT NULL,
  `raw_update_time` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `bank_id_index` (`bank_id`) USING BTREE COMMENT '唯一索引'
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用于表示的是用户对应的银行卡的信息，，，一个用户对应着多张卡，也就是一条用户表数据对应着这个表的多条数据。';

