-- ----------------------------
-- Table structure for yien_user_trans
-- ----------------------------
DROP TABLE IF EXISTS `yien_user_trans`;
CREATE TABLE `yien_user_trans` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键，自增',
  `trans_id` varchar(33) DEFAULT NULL COMMENT '交易记录表中的  唯一索引',
  `trans_goods_num` int(11) DEFAULT NULL COMMENT '购买的商品的数量',
  `trans_user_id` varchar(33) DEFAULT NULL COMMENT '交易记录表中的  用户的id',
  `trans_user_name` varchar(30) DEFAULT NULL COMMENT '交易记录表中的  用户的name',
  `trans_address_id` varchar(33) DEFAULT NULL COMMENT '交易记录表中的  地址的id',
  `trans_address_place` varchar(255) DEFAULT NULL COMMENT '交易记录表中的  地址的place',
  `trans_merchants_id` int(11) DEFAULT NULL COMMENT '交易记录表中的  商家的id',
  `trans_goods_id` varchar(33) DEFAULT NULL COMMENT '交易记录表中的  商品的id',
  `trans_goods_name` varchar(255) DEFAULT NULL COMMENT '交易记录表中的  商品的name',
  `trans_goods_amount` decimal(17,0) DEFAULT NULL COMMENT '交易记录表中的  商品的购买价格',
  `trans_create_time` timestamp NULL DEFAULT NULL COMMENT '交易记录表中的  这条记录创建的时间',
  `trans_pay_status` varchar(30) DEFAULT NULL COMMENT '交易记录表中的  这条商品记录是都已经付款   ''未付款'',''已付款''',
  `trans_kd_status` varchar(30) DEFAULT NULL COMMENT '交易记录表中的  物流状态',
  `trans_pay_time` timestamp NULL DEFAULT NULL COMMENT '交易记录表中的  这条商品记录的付款时间',
  `trans_pay_type` varchar(30) DEFAULT NULL COMMENT '交易记录表中的  这条商品记录的付款方式  ''银行卡'',''账户余额''',
  `trans_delivery_time` timestamp NULL DEFAULT NULL COMMENT '交易记录表中的  这条商品记录的发货时间',
  `trans_delivery_amount` decimal(17,0) DEFAULT NULL COMMENT '交易记录表中的  这条商品记录的运费',
  `trans_delivery_type` varchar(30) DEFAULT NULL COMMENT '交易记录表中的  这条商品记录的发货方式  ''中通快递'',''申通快递'',''邮政快递'',''韵达快递'',''顺丰快递'',''汇通快递''',
  `trans_receive_time` timestamp NULL DEFAULT NULL COMMENT '交易记录表中的  这条商品记录的收货时间',
  `raw_add_time` timestamp NULL DEFAULT NULL COMMENT '新增时间',
  `raw_update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `trans_id_index` (`trans_id`) USING BTREE COMMENT '交易记录表中的唯一索引'
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='交易记录表，记录交易的过程，物流过程。';

